.th","https://www.tycons.com","https://www.uic.com.sg","https://www.uac.co.th","https://www.ultra.com.br","https://www.unisys.com","https://www.ushamartin.com","https://puraniumenergy.com","https://v-capital.co","https://www.vmoto.com","https://vonex.com.au","https://www.vulcan.co","https://www.wendtindia.com","https://www.wyncoast.com","https://www.winton.nz","https://www.vicom.com.sg","https://www.wtfglimited.com","https://www.xrfscientific.com","https://corporate.yp.ca","https://www.clearme.com","https://www.zensar.com","https://www.zentechnologies.com"],"shape":[461],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["Synopsys, Inc. provides electronic design automation software products used to design and test integrated circuits. The company offers Fusion Design Platform that provides digital design implementation solutions; Verification Continuum Platform that provides virtual prototyping, static and formal verification, simulation, emulation, field programmable gate array (FPGA)-based prototyping, and debug solutions; and FPGA design products that are programmed to perform specific functions. It also provides intellectual property (IP) solutions for USB, PCI Express, DDR, Ethernet, SATA, MIPI, HDMI, and Bluetooth low energy applications; analog IP, including data converters and audio codecs; and system-on-chip (SoC) infrastructure IP, datapath and building block IP, and verification IP products, as well as mathematical and floating-point components, and Arm AMBA interconnect fabric and peripherals. In addition, the company offers logic libraries and embedded memories; configurable processor cores and application-specific instruction-set processor tools for embedded applications; IP subsystems for audio, sensor, and data fusion functionality; and security IP solutions. Further, it provides Platform Architect solutions for SoC architecture analysis and optimization; virtual prototyping solutions; and HAPS FPGA-based prototyping systems, as well as a series of tools used in the design of optical systems and photonic devices. Additionally, the company offers security testing, managed services, programs and professional services, and training that enable its customers to detect and remediate security vulnerabilities, and defects in the software development lifecycle, as well as manufacturing solutions. It serves electronics, financial services, automotive, medicine, energy, and industrial areas. The company was incorporated in 1986 and is headquartered in Mountain View, California.","Nippon Yusen Kabushiki Kaisha provides marine, land, and air transportation services worldwide. The company offers various logistics services, including liner trading services, such as container shipping, and terminal and stevedoring services for containerships, car carriers, and cruise ships; and air cargo transportation services. It also provides bulk shipping services comprising transport services for finished automobiles, heavy construction machines, and used cars; transportation services for bulk freight, which include iron ore, coal, and wood chips; and transportation services for crude oil, petroleum products, chemicals, LNG, LPG, and ammonia for oil, petrochemical, and energy companies. In addition, the company is involved in the upstream areas of the supply chain for oil and natural gas. Further, it operates Asuka II, a luxury cruise ship; and manages commercial and residential buildings. Nippon Yusen Kabushiki Kaisha was incorporated in 1885 and is headquartered in Tokyo, Japan.","DATA Communications Management Corp. provides marketing and workflow solutions that solve the complex branding, communications, logistics, and regulatory challenges in North America. Its solutions include DCMFlex workflow management platform to create, edit, track, and execute digital and print assets ranging from email campaigns and welcome kits to retail collateral and HR training material; ASMBL digital asset management; and print and communications management. The company also offers product sales; warehousing and freight services; and marketing solutions, which include business and brand strategy, consumer insights, strategic marketing, and design services. It serves the financial institutions, insurance, healthcare, lottery and gaming, retailing, not-for-profit, energy, and governmental industries. The company was formerly known as DATA Group Ltd. and changed its name to DATA Communications Management Corp. in July 2016. DATA Communications Management Corp. was founded in 1959 and is headquartered in Brampton, Canada.","Mader Group Limited, a contracting company, provides specialized technical services in the mining, energy, and industrial sectors in Australia and internationally. It offers rail services, digger and drill support team, fabrication and line boring, non-processing and processing infrastructure, power generation and marine, field support, professional support roles, maintenance projects, electrical services, component exchange, rapid response teams, rostered support, HME shutdown teams, specialized tool hire, clean team, trade upgrade program, training national workforces, and maintenance centre services. The company also provides in-field technical support, major overhauls and repairs, preventative equipment maintenance, training of maintenance teams, and ancillary services. Mader Group Limited was founded in 2005 and is headquartered in Perth, Australia.","Fitipower Integrated Technology Inc. engages in the research, design, development, production, and sale of LCD driver ICs and analogs, and digital and mixed-signal power management ICs in Taiwan. It offers power management products comprising buck DC-DC, boost DC-DC, linear regulator, LCD power, power switch, WLED driver, reset IC, and motor driver, as well as other products, such as PMUs, ASICs, etc.; and display driver products, including AV/tablet, DSC, NBMNT, TV, and gate products. The company's products are used for various applications consisting of LCD-TVs, notebooks, networking, portable devices, set-top boxes, CCTV/security, desktops, LED lighting, and TFT-LCD driver products. Fitipower Integrated Technology Inc. was incorporated in 1995 and is headquartered in Hsinchu City, Taiwan.","China Airlines, Ltd., together with its subsidiaries, provides air transportation services for passengers, cargo, and others. The company offers airport, ground, aircraft and flight equipment maintenance, machine and equipment maintenance, and investment services, as well as communications and data processing services to other airlines. It is also involved in the sale of aircrafts, aircraft parts, and equipment; cleaning of aircrafts; forwarding and storage of air cargo; and sale and maintenance of hardware and software. In addition, the company engages in the hotel, international trading, inflight catering, and travel businesses, as well as real estate leasing activities; and cleaning and leasing of the towels of airlines, hotels, restaurants, and health clubs. As of April 30, 2022, its fleet consisted of 85 aircraft, including 63 passenger jets and 22 freighters. The company was incorporated in 1959 and is headquartered in Taoyuan City, Taiwan.","The St. Joe Company, together with its subsidiaries, operates as a real estate development, asset management, and operating company in Northwest Florida. It operates through three segments: Residential, Hospitality, and Commercial. The Residential segment plans and develops residential communities of various sizes for homebuilders or retail consumers. It primarily sells developed homesites and parcels of entitled or undeveloped land. The Hospitality segment owns and operates a private membership club, golf courses, beach clubs, retail outlets, marinas, and other entertainment assets. This segment also engages in the hotel, food and beverage, and gulf-front vacation rental operations, as well as provides management services. The Commercial segment engages in leasing of commercial property, multi-family, a senior living community, and other assets. This segment also plans, develops, entitles, manages, and sells commercial land holdings for retail, office, hotel, senior living, multi-family, self-storage, and industrial uses; and grows and sells pulpwood, sawtimber, and other forest products. The company owns 170,000 acres of land in Northwest Florida. The St. Joe Company was incorporated in 1936 and is based in Panama City Beach, Florida.","NS United Kaiun Kaisha, Ltd., together with its subsidiaries, owns and operates land and sea transportation vessels. The company operates through International Shipping and Coastal Shipping segments. It also operates as a shipping agent for land, air, and marine transportation. The company provides iron ore and coking coal transportation services; energy resources transport services; and tramp chartering services. In addition, it engages in the sale, lease, repair, and maintenance of vessels; manufacture, sale, and maintenance of shipping equipment; real estate operations; personnel placement agency operations; and property and life insurance agency operations, as well as in the provision of data-processing and business information services. The company operates in Japan, rest of Asia, Brazil, Europe, the Middle East, North America, South America, Australia, and internationally. As of March 31, 2020, it operated a fleet of 197 vessels. The company was founded in 1950 and is headquartered in Tokyo, Japan.","Mirai Industry Co.,Ltd. manufactures and sells electrical equipment materials in Japan. The company provides fire protection materials; tools; underground and protective pipes; CD, PF, and flexible tubes; resins; cable support insert; retractable covers; mall; vinyl conduit accessories; mounting plates; mirai panel; air conditioner piping materials; and duct, lighting, support bracket, and cable rack, as well as iron, slide, pool, wall, and electricity meter boxes. It also offers pipework equipment, such as drainage related; fire protection materials; water supply and hot water supply reform; gas/kerosene reform and plumbing related; air-conditioning related, insert, and burial related; tool; resin pipe; scabbard and resin pipes; around the header; fittings; faucet box; bathroom parts; reheating; snow melting; heating; and others products. Mirai Industry Co.,Ltd. was incorporated in 1965 and is based in Wanouchi, Japan.","Syscom Computer Engineering Co. provides information technology services worldwide. It offers services in the areas of system integration, online custom information integration, e-business, high-tech manufacturing, network planning and implementation, outsourcing, hardware sales and maintenance, software development and maintenance, and training. The company's industry-specific solutions include planning, integration, deployment, and maintenance services; networking; electronic transaction real-time risk management systems; banking and securities trading platforms; healthcare information solutions; telecom infrastructure; and value-added telecom services. Its industry-specific solutions also comprise real-time transit system management; eGovernment; public sector unified portal platforms; information security; office automation; data warehouse outsourcing; computer center facilities management; database design; and Internet database application design services. The company offers its solutions for financial institutions, high-tech manufacturers, public sector, securities companies, healthcare and medical industries, telecommunications, and educational institutions. Syscom Computer Engineering Co. was founded in 1975 and is headquartered in Taipei, Taiwan.","Cadence Design Systems, Inc. provides software, hardware, services, and reusable integrated circuit (IC) design blocks worldwide. The company offers functional verification services, including emulation and prototyping hardware. Its functional verification offering consists of JasperGold, a formal verification platform; Xcelium, a parallel logic simulation platform; Palladium, an enterprise emulation platform; and Protium, a prototyping platform for chip verification. The company also provides digital IC design and sign off products, including Genus logic synthesis and Joules RTL power solutions, as well as Modus software solution to reduce systems-on-chip design-for-test time; physical implementation tools, such as place and route, optimization, and multiple patterning preparation; and signoff products to signoff the design as ready for silicon manufacturing. In addition, it offers custom IC design and simulation products to create schematic and physical representations of circuits down to the transistor level for analog, mixed-signal, custom digital, memory, and radio frequency designs; and system design and analysis products to develop printed circuit boards and IC packages, as well as to analyze electromagnetic, electro-thermal, and other multi-physics effects. Further, the company provides intellectual property (IP) products comprising pre-verified and customizable functional blocks to integrate into customer's ICs; and verification IP and memory models to emulate and model the expected behavior and interaction of standard industry system interface protocols. Additionally, it offers services related to methodology, education, and hosted design solutions, as well as technical support and maintenance services. The company serves 5G communications, aerospace and defense, automotive, industrial and healthcare, mobile, consumer, and hyperscale computing markets. Cadence Design Systems, Inc. was incorporated in 1987 and is headquartered in San Jose, California.","Simpson Manufacturing Co., Inc., through its subsidiaries, designs, engineers, manufactures, and sells wood and concrete construction products. The company offers wood construction products, including connectors, truss plates, fastening systems, fasteners and shearwalls, and pre-fabricated lateral systems for use in light-frame construction; and concrete construction products comprising adhesives, specialty chemicals, mechanical anchors, carbide drill bits, powder actuated tools, fiber-reinforced materials, and other repair products for use in concrete, masonry, and steel construction, as well as grouts, coatings, sealers, mortars, fiberglass and fiber-reinforced polymer systems, and asphalt products for use in concrete construction repair, and strengthening and protection products. It also provides connectors and lateral products for wood framing, timber and offsite construction, structural steel construction, and cold-formed steel applications; and mechanical and adhesive anchors for concrete and masonry construction applications. In addition, the company offers engineering and design services, as well as software solutions that facilitate the specification, selection, and use of its products. It markets its products to the residential construction, light industrial and commercial construction, remodeling, and do-it-yourself markets in the United States, Canada, France, the United Kingdom, Germany, Denmark, Switzerland, Portugal, Poland, the Netherlands, Belgium, Spain, Sweden, Norway, Australia, New Zealand, China, Taiwan, and Vietnam. The company was founded in 1956 and is headquartered in Pleasanton, California.","Fabrinet provides optical packaging and precision optical, electro-mechanical, and electronic manufacturing services in North America, the Asia-Pacific, and Europe. The company offers a range of advanced optical and electro-mechanical capabilities in the manufacturing process, including process design and engineering, supply chain management, manufacturing, printed circuit board assembly, advanced packaging, integration, final assembly, and testing. Its products include switching products, including reconfigurable optical add-drop multiplexers, optical amplifiers, modulators, and other optical components and modules that enable network managers to route voice, video, and data communications traffic through fiber optic cables at various wavelengths, speeds, and over various distances. The company's products also comprise tunable lasers, transceivers, and transponders; and active optical cables, which provide high-speed interconnect capabilities for data centers and computing clusters, as well as Infiniband, Ethernet, fiber channel, and optical backplane connectivity. In addition, it provides solid state, diode-pumped, gas, and fiber lasers used in semiconductor processing, biotechnology and medical device, metrology, and material processing industries; and differential pressure, micro-gyro, fuel, and other sensors used in automobiles, as well as non-contact temperature measurement sensors for the medical industry. Further, the company designs and fabricates application-specific crystals, lenses, prisms, mirrors, laser components, and substrates; and other custom and standard borosilicate, clear fused quartz, and synthetic fused silica glass products. It serves original equipment manufacturers of optical communication components, modules and sub-systems, industrial lasers, automotive components, medical devices, and sensors. The company was incorporated in 1999 and is based in George Town, the Cayman Islands.","Civitas Resources, Inc., an exploration and production company, focuses on the acquisition, development, and production of oil and natural gas in the Rocky Mountain region, primarily in the Wattenberg Field of the Denver-Julesburg Basin of Colorado. As of December 31,2021, it had proved reserves 397.7 MMBoe comprising 143.6 MMbbls of crude oil, 106.0 MMbbls of natural gas liquids, and 888.5 Bcf of natural gas. The company was formerly known as Bonanza Creek Energy, Inc. Civitas Resources, Inc. was founded in 1999 and is based in Denver, Colorado.","Banco BTG Pactual S.A. provides financial products and services in Brazil and internationally. Its investment banking services include advisory services relating to mergers and acquisitions, divestitures, restructurings, spin-offs, reorganizations, and other corporate transactions; placement and advisory services in primary and/ or secondary public offerings; structuring and distribution of fixed income instruments; and financial advisory, issuance coordination, and specific financing structures for energy and infrastructure projects. The company's wealth management products and services comprise trading in bonds, equities, options, futures, structured products, and cash instruments; investment funds; alternative investments, such as hedge funds, private equity, real estate, and structured credit funds; debit and credit cards; portfolio solutions; and clearing and custody services. It also offers credits to large and medium-sized companies, as well as offers a platform for the management and acquisition of non-performing corporate loans, and distressed real estate portfolios; credit operations and anticipation of receivables for small and medium-sized companies; and deals with companies under liquidation or bankruptcy. The company also provides products and services in the local and international markets which include market making, brokerage and settlement, transactions with derivatives, interest rates, exchange, equities, energy, insurance, and reinsurance. In addition, it offers asset management services through investment funds and managed portfolios, as well as invests on behalf of institutional investors, including pension funds, corporations, insurance companies, financial intermediaries, governments, and high-net-worth individuals and family offices. The company was founded in 1983 and is based in Sao Paulo, Brazil. Banco BTG Pactual S.A. is a subsidiary of BTG Pactual Holding Financeira Ltda.","The Coca-Cola Company, a beverage company, manufactures, markets, and sells various nonalcoholic beverages worldwide. The company provides sparkling soft drinks, sparkling flavors; water, sports, coffee, and tea; juice, value-added dairy, and plant-based beverages; and other beverages. It also offers beverage concentrates and syrups, as well as fountain syrups to fountain retailers, such as restaurants and convenience stores. The company sells its products under the Coca-Cola, Diet Coke/Coca-Cola Light, Coca-Cola Zero Sugar, caffeine free Diet Coke, Cherry Coke, Fanta Orange, Fanta Zero Orange, Fanta Zero Sugar, Fanta Apple, Sprite, Sprite Zero Sugar, Simply Orange, Simply Apple, Simply Grapefruit, Fresca, Schweppes, Thums Up, Aquarius, Ayataka, BODYARMOR, Ciel, Costa, Dasani, dogadan, FUZE TEA, Georgia, glac\u00e9au smartwater, glac\u00e9au vitaminwater, Gold Peak, Ice Dew, I LOHAS, Powerade, Topo Chico, AdeS, Del Valle, fairlife, innocent, Minute Maid, and Minute Maid Pulpy brands. It operates through a network of independent bottling partners, distributors, wholesalers, and retailers, as well as through bottling and distribution operators. The company was founded in 1886 and is headquartered in Atlanta, Georgia.","D-Link (India) Limited markets and distributes D-Link branded networking products for consumers, small businesses, medium to large-sized enterprises, and service providers in India. The company offers home networking products, such as Wi-Fi systems, routers, range extenders, adapters, switches, DSL modems and routers, and mobile Wi-Fi hotspots; home cameras, CCTV solutions, smart plugs, and sensors; USB hubs; smart home eco systems; and cloud services. It also provides core and edge routers; chassis, cloud managed, unmanaged, smart managed, fully managed, and industrial switches, as well as switch accessories; and video management software, and related accessories. In addition, the company offers point-to-point/multipoint, software managed, and controller managed access points, as well as wireless controllers; VPN routers; copper, fiber, and structured cabling solutions; and optical transport network accessories and switches. Further, it provides nuclias cloud, a cloud-based networking solution; and nuclias connect, a network management solution. The company was formerly known as Smartlink Network Systems Limited. D-Link (India) Limited was incorporated in 2008 and is headquartered in Mumbai, India. D-Link (India) Limited is a subsidiary of D-Link Holding Mauritius Inc.","Inari Amertron Berhad, an investment holding company, engages in the provision of electronic manufacturing, outsourced semiconductor assembly, and testing services for radio frequency, fiber-optics transceivers, optoelectronics, sensors, and custom integrated circuit (IC) technologies in Malaysia, Singapore, the United States, China, the Philippines, and internationally. The company offers wafer processing services covering bumping, probing, laser marking, die sawing, back grinding, flip-chip dice tape and reel, and automated visual inspection; and chip fabrication and wafer certification in fiber optic chips, such as wafer scribe and cleave, bar aligning, demount-load fixtures and facet coating, and chip on carrier. It also provides advanced system in package assembly and test services, including fine-pitch surface mount technology, high speed and high accuracy flip-chip dice placement, in-line post vision, molding underfill, and post-mold oxide plating and final testing, as well as finial testing of advanced communication chips; and other services, such as new product introduction services, failure analysis lab, sensor and IC package design and characterization, process customization and assembly, product testing, box build, and direct-to-end-customer dropship services. In addition, the company manufactures electronics optical fiber and optoelectronics devices, communication chips, and die preparations, as well as offers manufactures, assembles, and tests optoelectronic and sensor components, modules, and systems; designs, develops, and manufactures fiber optic products; designs, assembles, and supplies semiconductor manufacturing process tools, as well as customized semiconductor process tools and parts; and invests in properties. Inari Amertron Berhad was founded in 2006 and is based in Petaling Jaya, Malaysia.","Computershare Limited provides issuer, employee share plans and voucher, business, communication and utilities, technology, and mortgage and property rental services. The company offers issuer services that include register maintenance, corporate actions, stakeholder relationship management, corporate governance, and related services; mortgage services and property rental, including tenancy bond protection services; and employee share plans and voucher services comprising administration and related services for employee share and option plans, and childcare voucher administration services. It also provides business services, including the provision of bankruptcy, class action, and corporate trust administration services; communication services and utilities operations consisting of document composition and printing, intelligent mailing, inbound process automation, scanning, and electronic delivery; and technology services, such as software solutions in share registry and financial services, as well as agency services in connection with the administration of debt securities. It operates in Australia, New Zealand, Asia, Canada, Continental Europe, the United Kingdom, the Channel Islands, Ireland, Africa, and the United States. The company was incorporated in 1978 and is based in Abbotsford, Australia.","Chevron Corporation, through its subsidiaries, engages in integrated energy and chemicals operations worldwide. The company operates in two segments, Upstream and Downstream. The Upstream segment is involved in the exploration, development, production, and transportation of crude oil and natural gas; processing, liquefaction, transportation, and regasification associated with liquefied natural gas; transportation of crude oil through pipelines; and transportation, storage, and marketing of natural gas, as well as operates a gas-to-liquids plant. The Downstream segment engages in refining crude oil into petroleum products; marketing crude oil, refined products, and lubricants; manufacturing and marketing of renewable fuels; transporting crude oil and refined products by pipeline, marine vessel, motor equipment, and rail car; and manufacturing and marketing of commodity petrochemicals, plastics for industrial uses, and fuel and lubricant additives. It is also involved in the cash management and debt financing activities; insurance operations; real estate activities; and technology businesses. The company was formerly known as ChevronTexaco Corporation and changed its name to Chevron Corporation in 2005. Chevron Corporation was founded in 1879 and is based in San Ramon, California.","CviLux Corporation manufactures and sells connectors, flat flexible cables (FFC), and wire harnesses in Taiwan and internationally. The company's connectors include board to board, CCFL, coaxial, combo D-sub, DVI, FFC/FPC, IEEE, LVDS, memory card, mini-DIN, power, serial ATA, telephone/modular jack, USB, wire to board crimp style, wire to board insulation displacement, and ribbon cable connectors, as well as application tooling and IC sockets. It also offers cable assemblies; PCBA turnkey solutions; LVDS cables; and fiber optics connectors and cables. The company's products are used in consumer electronics, computers, communication, and electro-optical industries. The company was founded in 1990 and is headquartered in New Taipei City, Taiwan.","Adams Natural Resources Fund, Inc. is a publicly owned investment manager. The firm invests in the public equity markets across the globe. It invests in stocks of companies of all market capitalizations operating in the energy and natural resources sector including oil companies, exploration and production, utilities, services, and basic materials sectors. The firm employs a fundamental analysis with a bottom-up stock picking approach while focusing on earnings growth prospects, defendable market position, market competition, macroeconomic backdrop, cash flow generation, valuation, capital allocation, return on capital, mileposts and catalysts, and \"point in cycle\" identification to make its investments. It benchmarks the performance of its portfolios against a composite index of 80% Dow Jones Oil and Gas Index and 20% Dow Jones Basic Materials Index. The firm was formerly known as Petroleum &amp; Resources Corporation. Adams Natural Resources Fund, Inc. was founded in January 1929 and is based in Baltimore, Maryland with an additional office in Boston, Massachusetts.","Tapestry, Inc. provides luxury accessories and branded lifestyle products in the United States, Japan, Greater China, and internationally. The company operates in three segments: Coach, Kate Spade, and Stuart Weitzman. It offers women's accessories, including handbags, such as wallets, money pieces, wristlets, and cosmetic cases; novelty accessories comprising address books, time management and travel accessories, sketchbooks, and portfolios; and key rings and charms. The company also provides bag collections, including business cases, computer bags, messenger-style bags, backpacks, and totes; small leather goods, such as wallets, card cases, travel organizers, and belts; and footwear, watches, fragrances, sunglasses, novelty accessories, and ready-to-wear for men. In addition, it offers women's footwear; sunglasses; bracelets, necklaces, rings, and earrings; fragrances and watches; women's seasonal lifestyle apparel collections, including outerwear and ready-to-wear, and cold weather accessories, which comprise gloves, scarves, and hats. Further, the company provides footwear items; and housewares and home accessories for kids, such as fashion bedding and tableware; and stationery and gifts. Additionally, it licenses rights to market and distribute its tech and soft accessories, jewelry, watches, eyewear, and fragrances under the Coach brand; and tableware and housewares, fashion beddings, tech accessories, watches, sleepwear, eyewear, stationery and gifts, and fragrances under the Kate Spade brand. As of July 2, 2022, the company operated through a network of 945 Coach stores, 398 Kate Spade stores, and 100 Stuart Weitzman stores. It sells its products through e-commerce sites and concession shop-in-shops, and wholesale customers, as well as through independent third-party distributors. The company was formerly known as Coach, Inc. and changed its name to Tapestry, Inc. in October 2017. Tapestry, Inc. was founded in 1941 and is headquartered in New York, New York.","Miyoshi Oil &amp; Fat Co., Ltd. manufactures and sells food and oil products in Japan. The company's food products include margarine, shortening, lard, powdered fat and oil, whipped cream, and other edible processed fat and oil. It also offers fatty acids, glycerin, industrial soaps, other industrial oils and fats, textile treatment agents, antifoaming agents, raw materials for cosmetics, heavy metal scavengers and fixing agents, and other surfactants and oils. The company was founded in 1921 and is headquartered in Tokyo, Japan.","Ve Wong Corporation produces and distributes foods, drinks, and seasonings in Taiwan, Thailand, and Vietnam. The company offers instant noodles and soups, monosodium glutamate (MSG), IG-enriched MSG, soup base seasonings, spice powder mixes, soy sauces, canned fried glutens, and canned mixed porridge-Chinese style. It also provides canned drinks of asparagus, lemon tea, peach, guava, orange, mixed fruits and vegetables, winter melon, honey herbal jelly, paochong tea, barley, etc.; pre-cooked fast foods-Chinese style; and mineral water. In addition, the company imports canola cooking oil, Japanese spirits, and Alaskan pure glacier water. In addition, the company engages in the residential, and building and industrial plant development, as well as leasing and selling activities; investment and construction of public construction works; and imports tobacco, alcohol, and beverages. It offers its products under the Ve Wong, A-One, Vihuongto, Champion, Prince, Kung-Fu, Kim Ve Wong, Rarity, and Hot of Hots brand names. Ve Wong Corporation was incorporated in 1959 and is based in Taipei, Taiwan.","Multiconsult ASA provides engineering design, consultancy, and architecture services in the Norway and internationally. It offers multidisciplinary consultancy, design, planning, project supervision and management, geotechnical site survey, verification and control, analysis and due diligence, environmental and HSE, hydrometry and hydrological field work, river basin management, green bond, and lenders advisory services. The company serves building and properties, cities and society, industry, oil and gas, renewable energy, rail and other transportation, and water and environment sectors. Multiconsult ASA was founded in 1908 and is headquartered in Oslo, Norway.","Urbana Corporation is an investment fund launched and managed by Caldwell Investment Management Ltd. For its equity investment the fund primarily invests in public equity markets of United States and Canada. The fund primarily focuses on U.S. financial companies and Canadian resource companies for equity investments. The fund also focuses on private equity investments. It was formerly known as Macho River Gold Mines Limited. Urbana Corporation is domiciled in Canada.","Greatek Electronics Inc. engages in the packaging and testing of various integrated circuits (IC) in Taiwan, the United States, Europe, Asia, and Africa. The company offers packaging products, such as traditional lead frame, quad flat no-lead, ball grid array, flip chip, 8 wafer level chip scale, bumping technology, backend integration for wafer level chip scale, flash memory, BGA/LGA production, FC/CSP, automotive packages, and security IC assembly. It also offers wafer and final testing services, including testing program development, platform conversion, devices correlation, engineering, test peripheral equipment, and spare parts development service for logic, mix mode, and analog devices; IC semiconductor package assembly services; and package design services for electrical and thermal characterization. In addition, the company provides leadframe base packages, including P-DIP, transistor outline/small outline transistor/thin small outline transistor packages, small-outline packages (SOP), mini-SOP, shrink SOP, thin shrink SOP, small outline J-leaded and plastic leaded chip carrier packages, quad flat package (QFP), low profile QFP, and thin QFP. The company was formerly known as He Teh Integrated Circuit Co. Ltd. Greatek Electronics Inc. was founded in 1972 and is headquartered in Miaoli, Taiwan.","C.I.TAKIRON Corporation engages in the construction materials, environmental materials, high functional materials, and specialty films businesses in Japan. The company's products include polycarbonate building materials, housing materials, flooring materials, decorative materials, flood protection products, agricultural and infrastructure materials, plastic plates, and micro motors. It also offers heat shrinkable films for bottled beverages, food, spices, cosmetics, toiletry goods, and medical items; and zipper tapes and bags for food, pharmaceutical, and miscellaneous products applications. The company was formerly known as Takiron Co., Ltd. and changed its name to C.I.TAKIRON Corporation in April 2017. The company was founded in 1919 and is headquartered in Osaka, Japan. C.I.TAKIRON Corporation is a subsidiary of ITOCHU Corporation.","MONETA Money Bank, a.s., together with its subsidiaries, provides banking and financial products and services to retail customers, small and medium-sized enterprises, corporate clients, and financial and public sector institutions in the Czech Republic. The company operates through Commercial Clients, Retail Clients, and Treasury/Other segments. It offers various deposit products, including current and savings accounts, term deposits, and transactional banking products. The company also provides secured lending products, such as mortgages and finance leases; unsecured lending products comprising consumer and auto loans, credit cards, personal overdrafts, building savings loans, and bridging loans; and commercial lending products that consist of working capital, investment loans, finance and operating leases, auto loans, inventory financing, financing of small businesses and entrepreneurs through guarantees, letters of credits, and foreign exchange transactions. In addition, it intermediates additional payment protection insurance, which covers the customer's monthly loan payment in the event of unemployment, accident, or sickness; and acts as the intermediary to provide its customers with other insurance and investment products. Further, the company engages in the foreign exchange transactions, interest rate swaps, investment in debt securities, equity investments, other non\u0096interest bearing assets, and other operations, as well as provision of debit and credit cards. As of December 31, 2021, it operated a network of 154 branches and 560 ATMs. The company was formerly known as GE Money Bank, a.s. and changed its name to MONETA Money Bank, a.s. in May 2016. MONETA Money Bank, a.s. was incorporated in 1998 and is headquartered in Prague, the Czech Republic.","Cadence Design Systems, Inc. provides software, hardware, services, and reusable integrated circuit (IC) design blocks worldwide. The company offers functional verification services, including emulation and prototyping hardware. Its functional verification offering consists of JasperGold, a formal verification platform; Xcelium, a parallel logic simulation platform; Palladium, an enterprise emulation platform; and Protium, a prototyping platform for chip verification. The company also provides digital IC design and sign off products, including Genus logic synthesis and Joules RTL power solutions, as well as Modus software solution to reduce systems-on-chip design-for-test time; physical implementation tools, such as place and route, optimization, and multiple patterning preparation; and signoff products to signoff the design as ready for silicon manufacturing. In addition, it offers custom IC design and simulation products to create schematic and physical representations of circuits down to the transistor level for analog, mixed-signal, custom digital, memory, and radio frequency designs; and system design and analysis products to develop printed circuit boards and IC packages, as well as to analyze electromagnetic, electro-thermal, and other multi-physics effects. Further, the company provides intellectual property (IP) products comprising pre-verified and customizable functional blocks to integrate into customer's ICs; and verification IP and memory models to emulate and model the expected behavior and interaction of standard industry system interface protocols. Additionally, it offers services related to methodology, education, and hosted design solutions, as well as technical support and maintenance services. The company serves 5G communications, aerospace and defense, automotive, industrial and healthcare, mobile, consumer, and hyperscale computing markets. Cadence Design Systems, Inc. was incorporated in 1987 and is headquartered in San Jose, California.","Visa Inc. operates as a payments technology company worldwide. The company operates VisaNet, a transaction processing network that enables authorization, clearing, and settlement of payment transactions. It also offers credit, debit, and prepaid card products; tap to pay, tokenization, click to pay; Visa Direct, a real-time payments network; Visa B2B Connect, a multilateral B2B cross-border payments network; Visa Treasury as a Service, a cross-border consumer payments business; and Visa DPS that provides a range of value added services, including fraud mitigation, dispute management, data analytics, campaign management, a suite of digital solutions, and contact center services. Further, the; company provides Cybersource, a payment management platform; and risk and identity solutions, such as Visa Advanced Authorization, Visa Secure, Visa Advanced Identity Score, and Visa Consumer Authentication Service; and Visa Consulting and Analytics, a payments consulting advisory services. It provides its services under the Visa, Visa Electron, Interlink, VPAY, and PLUS brands. The company serves consumers, merchants, financial institutions, and government entities. Visa Inc. was founded in 1958 and is headquartered in San Francisco, California.","Compal Electronics, Inc., together with its subsidiaries, engages in the manufacture and sale of notebook personal computers (PC), monitors, LCD TVs, mobile phones, and various components and peripherals in Taiwan, the United States, China, the Netherlands, and internationally. The company operates through Information Technology Product and Strategy Integrated Product Segments. It designs, develops, manufactures, sells, and services tablet PCs, digital products, network switches, wireless AP, automobile electronic products, and touch panels. The company also provides information technology and mobile communication products, networking products, communication devices, electronic computers, and smart watches, as well as cable modems, digital set up boxes, and household digital electronic products. In addition, it is involved in manufacturing of electric appliance, lighting products, and audiovisual electric products; international trading; manufacture, wholesale, and retail of medical equipment and precision instruments; technical support and sale of wireless network products; real estate development, management, rental, and leasing business; marketing of monitors and notebook PCs; investment activities; construction and investment in infrastructures; manufacture and sale of aluminum and magnesium alloy products; and retail and wholesale of animal medication products. Further, it provides management consulting, biotechnology, and related technical services; maintenance and warranty services for notebook PCs and mobile phones; and training and education, business information consulting, financial and tax consulting, investment consulting, and investment management services. Additionally, it engages in wholesale and retail of computer software and electronic materials; provision of software design and data processing; and medical care IOT business. The company was incorporated in 1984 and is headquartered in Taipei City, Taiwan.","Blackstone Inc. is an alternative asset management firm specializing in real estate, private equity, hedge fund solutions, credit, secondary funds of funds, public debt and equity and multi-asset class strategies. The firm typically invests in early-stage companies. It also provide capital markets services. The real estate segment specializes in opportunistic, core+ investments as well as debt investment opportunities collateralized by commercial real estate, and stabilized income-oriented commercial real estate across North America, Europe and Asia. The firm's corporate private equity business pursues transactions throughout the world across a variety of transaction types, including large buyouts,special situations, distressed mortgage loans, mid-cap buyouts, buy and build platforms, which involves multiple acquisitions behind a single management team and platform, and growth equity/development projects involving significant majority stakes in portfolio companies and minority investments in operating companies, shipping, real estate, corporate or consumer loans, and alternative energy greenfield development projects in energy and power, property, dislocated markets, shipping opportunities, financial institution breakups, re-insurance, and improving freight mobility, financial services, healthcare, life sciences, infrastructure, enterprise tech and consumer, as well as consumer technologies. The firm considers investment in Asia and Latin America. It has a three year investment period. Its hedge fund business manages a broad range of commingled and customized fund solutions and its credit business focuses on loans, and securities of non-investment grade companies spread across the capital structure including senior debt, subordinated debt, preferred stock and common equity. Blackstone Inc. was founded in 1985 and is headquartered in New York, New York with additional offices across Asia, Europe and North America.","Transmissora Alian\u00e7a de Energia El\u00e9trica S.A. implements, operates, and maintains electric power transmission assets in Brazil. It operates 14,014 kilometers (km) of transmission lines, which include 11,685 km of transmission lines in operation and 2,329 km of lines under construction; and 100 substations with voltage ranging from 230 to 525kV. The company was founded in 2000 is headquartered in Rio de Janeiro, Brazil.","Canadian General Investments, Limited is a close ended equity mutual fund launched and managed by Morgan Meighen &amp; Associates Limited. It invests in the public equity markets of Canada. The fund seeks to invest in stocks of companies operating across diversified sectors. It invests in stocks of companies across all market capitalization. The fund employs fundamental analysis with a bottom-up stock picking approach focusing on timely recognition of capital gains and appropriate income generating instruments to create its portfolio. It benchmarks the performance of its portfolio against the S&amp;P/TSX Composite Index. Canadian General Investments, Limited was formed on January 15, 1930 and is domiciled in Ontario, Canada.","ServiceNow, Inc. provides enterprise cloud computing solutions that defines, structures, consolidates, manages, and automates services for enterprises worldwide. It operates the Now platform for workflow automation, artificial intelligence, machine learning, robotic process automation, performance analytics, electronic service catalogs and portals, configuration management systems, data benchmarking, encryption, and collaboration and development tools. The company also provides information technology (IT) service management applications; IT service management product suite for enterprise's employees, customers, and partners; IT business management product suite; IT operations management product that connects a customer's physical and cloud-based IT infrastructure; IT Asset Management to automate IT asset lifecycles; and security operations that connects with internal and third party. In addition, it offers governance, risk, and compliance product to manage risk and resilience; human resources, legal, and workplace service delivery products; safe workplace applications; customer service management product; and field service management applications. Further, it provides App Engine product; IntegrationHub enables application to extend workflows; and professional, industry solutions, and customer support services. It serves government, financial services, healthcare, telecommunications, manufacturing, IT services, technology, oil and gas, education, and consumer products through direct sales team and resale partners. It has a strategic partnership with Celonis to help customers identify and prioritize processes that are suitable for automation. The company was formerly known as Service-now.com and changed its name to ServiceNow, Inc. in May 2012. The company was founded in 2004 and is headquartered in Santa Clara, California.","Mastercard Incorporated, a technology company, provides transaction processing and other payment-related products and services in the United States and internationally. It facilitates the processing of payment transactions, including authorization, clearing, and settlement, as well as delivers other payment-related products and services. The company offers integrated products and value-added services for account holders, merchants, financial institutions, businesses, governments, and other organizations, such as programs that enable issuers to provide consumers with credits to defer payments; prepaid programs and management services; commercial credit and debit payment products and solutions; and payment products and solutions that allow its customers to access funds in deposit and other accounts. It also provides value-added products and services comprising cyber and intelligence solutions for parties to transact, as well as proprietary insights, drawing on principled use of consumer, and merchant data services. In addition, the company offers analytics, test and learn, consulting, managed services, loyalty, processing, and payment gateway solutions for e-commerce merchants. Further, it provides open banking and digital identity platforms services. The company offers payment solutions and services under the MasterCard, Maestro, and Cirrus. Mastercard Incorporated was founded in 1966 and is headquartered in Purchase, New York.","GrainCorp Limited operates as an agribusiness and processing company in Australasia, Asia, North America, Europe, the Middle East, North Africa, and internationally. It operates through two segments, Agribusiness and Processing. The company handles, markets, and trades in wheat, barley, sorghum, corn, oilseeds, pulses, organics, canola, chickpeas, and specialty commodities; handles, processes, stores, and transports grains and oilseeds; refines, bleaches, deodorizes, and blends edible fats and oil products; and crushes, processes, manufactures, and distributes edible oils. It also manufactures and supplies molasses-based feed supplements and vegetable oil to enhance farm productivity in beef cattle, sheep, dairy cattle, and other domestic livestock; and crude degummed canola oils, refined bleached canola oils, and canola meal. In addition, the company provides blended and single oils, infant nutrition, bakery margarines, spreads, and shortening; crushes oilseed products are used in cooking oils, spreads and shortenings, prepared foods, meal for dairy, poultry and livestock, cosmetics and lubricants, fuels, and other industrial applications; and operates seven bulk port terminals. Further it is involved in the procurement, shipping, accreditation, and value-added supply of tallow and used cooking oil, which are used for renewable energy feedstock and industrial applications, as well as vegetable oils; and the provision of logistics services. GrainCorp Limited was founded in 1916 and is headquartered in Sydney, Australia.","AVer Information Inc. develops and manufactures education technology and video collaboration solutions in Taiwan and internationally. The company offers on-premise and USB video conferencing products; charge and sync carts; visualizers; medical cameras, auto tracking and livestreaming PTZ cameras, and Pro AV accessories; interactive flat panel and control boxes; touch panels; wireless presentation systems; and distance learning cameras, as well as classroom software products. AVer Information Inc. was founded in 2008 and is headquartered in New Taipei City, Taiwan.","Orange County Bancorp, Inc., through its subsidiaries, provides commercial and consumer banking products and services, and trust and wealth management services to small businesses, middle-market enterprises, local municipal governments, and affluent individuals. It accepts various deposit products, including interest-bearing and noninterest-bearing demand accounts, money market deposit accounts, savings accounts, and certificates of deposit. The company also offers commercial real estate loans, commercial and industrial loans, commercial real estate construction loans, residential real estate loans, home equity loans, and consumer loans. In addition, it provides traditional trust and administration, asset management, financial planning, and wealth management services. The company operates 14 full-service branches and one loan production office in Orange, Westchester, Rockland, and Bronx counties in New York. Orange County Bancorp, Inc. was founded in 1892 and is headquartered in Middletown, New York.","Hill &amp; Smith Holdings PLC manufactures and supplies infrastructure products in the United Kingdom, rest of Europe, North America, the Middle East, rest of Asia, and internationally. It operates through Roads &amp; Security; Utilities; and Galvanizing Services segments. The Roads &amp; Security segment designs, manufactures, and installs temporary and permanent safety products for the roads market, as well as provides range of security products to protect people, buildings, and infrastructure from attacks, including hostile vehicle mitigation solutions, high security fencing, and automated gate solutions. This segment also offers permanent road safety barriers, renewable energy lighting and power solutions, temporary work zone protection products, perimeter security, pedestrian protection products, intelligent traffic solutions, street lighting columns, and car park and bridge parapets. The Utilities segment supplies engineered steel and composite solutions for a range of infrastructure markets, including energy generation and distribution, marine, rail, and housing sectors; and supplies engineered pipe supports for the water, power, and liquid natural gas markets, as well as offers seismic protection solutions. This segment also produces steel products for construction industries, such as residential construction and data centers. The Galvanizing Services segment provides corrosion protection services in the form of hot-dip zinc galvanizing and other coatings for steel products, which includes steel works, lighting columns, bridges, agricultural equipment, and other products for the industrial and infrastructure markets. Hill &amp; Smith Holdings PLC was founded in 1824 and is headquartered in Solihull, the United Kingdom.","AMETEK, Inc. manufactures and sells electronic instruments and electromechanical devices worldwide. It operates in two segments, Electronic Instruments (EIG) and Electromechanical (EMG). The company's EIG segment offers advanced instruments for the process, aerospace, power, and industrial markets; process and analytical instruments for the oil and gas, petrochemical, pharmaceutical, semiconductor, automation, and food and beverage industries; and instruments to the laboratory equipment, ultra-precision manufacturing, medical, and test and measurement markets. This segment also provides power quality monitoring and metering devices, uninterruptible power supplies, programmable power equipment, electromagnetic compatibility test equipment, gas turbines, and environmental health and safety market sensors, dashboard instruments for heavy trucks and other vehicles, and instrumentation and controls for the food and beverage industries; and aircraft and engine sensors, monitoring systems, power supplies, fuel and fluid measurement systems, and data acquisition systems for the aerospace industry. Its EMG segment offers engineered electrical connectors and electronics packaging to protect sensitive devices and mission-critical electronics; precision motion control products for data storage, medical devices, business equipment, automation, and other applications; high-purity powdered metals, strips and foils, specialty clad metals, and metal matrix composites; motor-blower systems and heat exchangers for use in thermal management, military, commercial aircraft, and military ground vehicles; and motors for use in commercial appliances, fitness equipment, food and beverage machines, hydraulic pumps, and industrial blowers. This segment also operates a network of aviation maintenance, repair, and overhaul facilities. In addition, the company offers clinical and educational communication solutions. AMETEK, Inc. was founded in 1930 and is headquartered in Berwyn, Pennsylvania.","Shikoku Chemicals Corporation engages in the research and development, manufacture, and sale of chemical products and housing materials in Japan and internationally. It offers inorganic chemicals, such as insoluble sulfur, carbon disulfide, and sodium sulfate and carbonate; and organic chemicals, including chlorinated isocyanurates, automatic chlorine feeder, differential pressure type automatic chlorine feeder, bacteria enzymes, and urinary calculus removers. The company also provides fine chemicals comprising imidazole type and adduct type latent curing agent for epoxy resin; cross-linkers for thermosetting and UV curable resin; benzoxazine; adhesion improver; low volatile cross-linking agents; THEIC; imidazole and other heterocycles; organic solderability preservative; chemical adhesion process; and microetching solutions. In addition, it offers housing materials consisting of interior, exterior finishes, and paving materials; and exterior products, including gates, fences, carports, decks, and terraces. Further, the company is involved in the design, production, development, and installation of shutters and other retail outlet fixtures, as well as provides technical services; development and sale of computer software; management of computer systems; operation of the Mosburger chain of hamburger shops; sale of giftware and daily use products; design, installation, and maintenance management of water treatment for sewage and septic tanks; construction of drainage pipe connection; inspection and cleaning of water storage tanks; collection and transportation of general and industrial waste materials; provision of information services; damage-insurance and life-insurance agency; packaging and transportation; and housing renovation and solar photovoltaic generation activities. Additionally, it offers environmental measurement authentication, and quality testing of drinking water services. The company was incorporated in 1947 and is headquartered in Marugame, Japan.","The Westaim Corporation is a private equity firm specializing in direct and indirect investments through acquisitions, joint ventures, secondary investments both direct and indirect, fund of fund investments, and other arrangements. For direct investments, the firm invests in early venture, mid venture, late venture, middle market, later stage, mature, emerging growth, PIPEs, and buyout transactions. For fund of fund investments, it seeks to invest in private equity funds, venture capital funds, and hedge funds. The firm seeks to provide long term capital to businesses operating in the global financial services industry. It typically acquires controlling interests in businesses. The firm seeks to acquire debt, equity, or derivative securities of both public and private companies. It invests with the objective of providing its shareholders with capital appreciation and real wealth preservation. The firm seeks to provide its portfolio companies with advisory services including, but not limited to, advice on capital allocation, financing strategy, performance measurement and merger and acquisition support. It also seeks to partner with like-minded providers of third party capital to help supplement the firm's own capital, when completing acquisitions. The firm generally seeks to hold its investments for seven to 15 years. The Westaim Corporation was founded in 1996 and is based in Toronto, Canada.","Nakayama Steel Works, Ltd. engages in the steel, engineering, building materials, and real estate businesses in Japan. It offers steel coil products, including hot, pickling, plated, slit, and striped /pattern coils; and steel sheet products, such as thick steel and NP steel plates, leveler sheets, and checkered steel and pattern steel plates, as well as hot rolled steel products. The company also provides bars and wire rod products comprising steel bars, burn-in- coils, and wire rods, as well as lightweight C-shaped steel products, steel pipes, steel sheets, secondary wire rod products, and by-products. In addition, it offers steel fish, breeding, and seaweed reefs; and casting machine engineering products, including rolls, valves, and casting and processing equipment. Further, the company plans, designs, and constructs factories, warehouses, offices, etc. Additionally, it engages in manufacturing and processing of lightweight shaped steel products, electro sewn steel pipes, construction-related products, etc.; buying, leasing, brokerage, and sale of real estate properties; and port transportation and freight vehicle transportation businesses. The company provides general shipping and shipping brokerage services; and environmental services. Nakayama Steel Works, Ltd. was incorporated in 1923 and is headquartered in Osaka, Japan.","Texas Pacific Land Corporation engages in the land and resource management, and water services and operations businesses. The company's Land and Resource Management segment manages approximately 880,000 acres of land. This segment also holds own a 1/128th nonparticipating perpetual oil and gas royalty interest (NPRI) under approximately 85,000 acres of land; a 1/16th NPRI under approximately 371,000 acres of land; and approximately 4,000 additional net royalty acres located in the western part of Texas. In addition, this segment engages in easements and commercial leases activities, such as oil, gas and related hydrocarbons, power line and utility easements, and subsurface wellbore easements. Further, this segment leases its land for processing, storage, and compression facilities and roads; and is involved in sale of materials, such as caliche. Its Water Services and Operations segment provides full-service water offerings, including water sourcing, produced-water gathering/treatment, infrastructure development, disposal solutions, water tracking, analytics, and well testing services to operators in the Permian Basin. This segment also holds royalties for water sourced from its land. Texas Pacific Land Corporation was founded in 1888 and is headquartered in Dallas, Texas.","Hulic Co., Ltd. engages in the development, rental, sale, and brokerage of real estate properties in Japan. The company operates through three segments: Real Estate, Insurance, and Hotels and Inns. Its property portfolio includes office buildings, commercial buildings, residential rental buildings, hotels, and other properties. As of December 31, 2021, the company had a portfolio of approximately 265 lease properties. It also engages in the asset management and insurance agency businesses; and management of hotels and inns. Hulic Co., Ltd. was founded in 1931 and is headquartered in Tokyo, Japan.","Controladora Vuela Compa\u00f1\u00eda de Aviaci\u00f3n, S.A.B. de C.V., through its subsidiaries, Concesionaria Vuela Compa\u00f1\u00eda de Aviaci\u00f3n, S.A.P.I. de C.V., provides air transportation services for passengers, cargo, and mail in Mexico and internationally. The company operates approximately 410 daily flights on routes connecting 43 cities in Mexico, 22 cities in the United States, and 3 cities in Central America. As of December 31, 2020, it operated through a fleet of 86 aircraft. The company also offers merchandising, recruitment and payroll, travel agency, and loyalty program services. Controladora Vuela Compa\u00f1\u00eda de Aviaci\u00f3n, S.A.B. de C.V. was incorporated in 2005 and is headquartered in Mexico City, Mexico.","Sun Life Financial Inc., a financial services company, provides insurance, wealth, and asset management solutions to individuals and corporate clients worldwide. It offers term and permanent life, as well as personal health, dental, critical illness, long-term care, and disability insurance products. The company also provides reinsurance products; investment counselling and portfolio management services; mutual funds and segregated funds; trust and banking services; real estate property brokerage and appraisal services; and merchant banking services. It distributes its products through direct sales agents, managing and independent general agents, financial intermediaries, broker-dealers, banks, pension and benefits consultants, and other third-party marketing organizations. The company was founded in 1871 and is headquartered in Toronto, Canada.","TE Connectivity Ltd., together with its subsidiaries, manufactures and sells connectivity and sensor solutions in Europe, the Middle East, Africa, the Asia\u0096Pacific, and the Americas. The company operates through three segments: Transportation Solutions, Industrial Solutions, and Communications Solutions. The Transportation Solutions segment provides terminals and connector systems and components, sensors, relays, antennas, heat shrink tubing, and application tooling products for use in the automotive, commercial transportation, and sensor markets. The Industrial Solutions segment offers terminals and connector systems and components; and heat shrink tubing, interventional medical components, relays, and wires and cables for aerospace, defense, oil and gas, industrial equipment, medical, and energy markets. The Communications Solutions segment supplies electronic components, such as terminals and connector systems and components, relays, heat shrink tubing, and antennas for the data and devices, and appliances markets. TE Connectivity Ltd. sells its products to approximately 140 countries primarily through direct sales to manufacturers, as well as through third-party distributors. The company was formerly known as Tyco Electronics Ltd. and changed its name to TE Connectivity Ltd. in March 2011. TE Connectivity Ltd. was incorporated in 2000 and is based in Schaffhausen, Switzerland.","Capital A Berhad, an investment holding company, provides air transportation services in Malaysia, Indonesia, the Philippines, and internationally under the AirAsia brand. It also offers engineering, tour operating, aircraft leasing, shared and outsourcing, event ticketing, and consultancy services. The company provides facilitates business transactions for AirAsia Group with non-resident goods and service providers; and trades in multimedia content and equipment. In addition, it provides inflight meal products; manages customer loyalty points; wholesales meat, fish, fruits, vegetables, flowers, and plants; offers online retail sales, inflight shop, aviation and commercial, airport related, food and beverages, as well as supporting services to air transport; and operates AirAsia Superapp. Further, the company is involved in the marketing and development of loyalty programs; development of software for cybersecurity and IT; trades in multimedia content and equipment, e-hailing, online food ordering, delivery, investment management, and cargo services, as well as provides logistic and payment services for cross border e-commerce marketing. The company was formerly known as AirAsia Group Berhad and changed its name to Capital A Berhad in January 2022. Capital A Berhad was founded in 2001 and is headquartered in Kuala Lumpur, Malaysia.","Union Pacific Corporation, through its subsidiary, Union Pacific Railroad Company, operates in the railroad business in the United States. The company offers transportation services for grain and grain products, fertilizers, food and refrigerated products, and coal and renewables to grain processors, animal feeders, ethanol producers, and other agricultural users; petroleum, and liquid petroleum gases; and construction products, industrial chemicals, plastics, forest products, specialized products, metals and ores, soda ash, and sand, as well as finished automobiles, automotive parts, and merchandise in intermodal containers. As of December 31, 2021, its rail network included 32,452 route miles connecting Pacific Coast and Gulf Coast ports with the Midwest and Eastern United States gateways. The company was founded in 1862 and is headquartered in Omaha, Nebraska.","Future Generation Global Investment Company Limited is a closed-ended equity fund of funds launched by Wilson Asset Management (International) Pty Limited. The fund is co-managed by Antipodes Partners, Avenir Capital Pty Ltd, Cooper Investors Pty Limited, Eastspring Investments (Singapore) Limited, Ellerston Capital Pty Limited, Hunter Hall Investment Management Limited, Insync Funds Management Pty Limited, IronBridge Capital Management, L.P., Magellan Asset Management Limited, Manikay Partners, Morphic Asset Management Pty Limited, Neuberger Berman Australia Pty Limited, Nikko Asset Management Australia Limited, Optimal Fund Management Pty Limited, Paradice Investment Management Pty Ltd., Tribeca Investment Partners Pty Ltd., and VGI Partners Pty Limited. It invests in funds which invest in public equity markets across the globe. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in other mutual funds which in turn invest in stocks of companies across all market capitalizations. The fund employs both quantitative and fundamental analysis with a combination of bottom-up and top-down stock selection approaches to create its portfolio. Future Generation Global Investment Company Limited was formed on July 10, 2015 and is domiciled in Australia.","PR TIMES, Inc. operates PR TIMES platform that connects companies, media, and consumer with news in Japan. It also offers Jooto, a task and project management tool; Tayori, a cloud information organization tool; Web clipping services that can extract and analyze articles containing specified keywords from domestic news media; PR TIMES LIVE, which offers online coverage of press events; PR TIMES TV, a video PR service; and PR calendar for covering anniversary and seasonal events of companies. The company operates media, such as BRIDGE, isuta, U-NOTE, Techable, STRAIGHT PRESS, IGNITE, PR EDGE, and PR TIMES magazine to deliver information of actors. Further, it offers PR strategy/planning to material creation, and media and SNS relations. The company was incorporated in 2005 and is based in Tokyo, Japan.","S&amp;P Global Inc., together with its subsidiaries, provides credit ratings, benchmarks, analytics, and workflow solutions in the global capital, commodity, and automotive markets. It operates in six divisions: S&amp;P Global Ratings, S&amp;P Dow Jones Indices, S&amp;P Global Commodity Insights, S&amp;P Global Market Intelligence, S&amp;P Global Mobility, and S&amp;P Global Engineering Solutions. The S&amp;P Global Ratings division operates as an independent provider of credit ratings, research, and analytics, offering investors and other market participants information, ratings, and benchmarks. The S&amp;P Dow Jones Indices division is an index provider that maintains various valuation and index benchmarks for investment advisors, wealth managers, and institutional investors. The S&amp;P Global Commodity Insights division offers data and insights for global energy and commodity markets and enable its customers to make decisions. The S&amp;P Global Market Intelligence division delivers data and technology solutions for customers to provide insights for making decisions. It offers data and services that bring end-to-end workflow solutions, including capital formation, data and distribution, ESG and sustainability, leveraged loans, private markets, sector coverage, supply chain, and issuer solutions, as well as credit, risk, and regulatory solutions. The S&amp;P Global Mobility division provides insights derived from unmatched automotive data, enabling its customers to anticipate change and make decisions. The S&amp;P Global Engineering Solutions division offers engineering expertise and solutions in industries, such as aerospace and defense, energy, architecture, construction, and transportation. Its solutions empower business and technical leaders to transform workflows and make decisions. S&amp;P Global Inc. was founded in 1860 and is headquartered in New York, New York.","S&amp;P Global Inc., together with its subsidiaries, provides credit ratings, benchmarks, analytics, and workflow solutions in the global capital, commodity, and automotive markets. It operates in six divisions: S&amp;P Global Ratings, S&amp;P Dow Jones Indices, S&amp;P Global Commodity Insights, S&amp;P Global Market Intelligence, S&amp;P Global Mobility, and S&amp;P Global Engineering Solutions. The S&amp;P Global Ratings division operates as an independent provider of credit ratings, research, and analytics, offering investors and other market participants information, ratings, and benchmarks. The S&amp;P Dow Jones Indices division is an index provider that maintains various valuation and index benchmarks for investment advisors, wealth managers, and institutional investors. The S&amp;P Global Commodity Insights division offers data and insights for global energy and commodity markets and enable its customers to make decisions. The S&amp;P Global Market Intelligence division delivers data and technology solutions for customers to provide insights for making decisions. It offers data and services that bring end-to-end workflow solutions, including capital formation, data and distribution, ESG and sustainability, leveraged loans, private markets, sector coverage, supply chain, and issuer solutions, as well as credit, risk, and regulatory solutions. The S&amp;P Global Mobility division provides insights derived from unmatched automotive data, enabling its customers to anticipate change and make decisions. The S&amp;P Global Engineering Solutions division offers engineering expertise and solutions in industries, such as aerospace and defense, energy, architecture, construction, and transportation. Its solutions empower business and technical leaders to transform workflows and make decisions. S&amp;P Global Inc. was founded in 1860 and is headquartered in New York, New York.","Helios Techno Holding Co., Ltd. engages in the lamp and manufacturing equipment businesses in Japan. It offers lamps for projectors, halogen lamps for general lighting, and LED lamps; equipment, such as orientation film printing devices and specialized printers; and industrial equipment, as well as testing and measuring equipment. The company was formerly known as PHOENIX Electric Co., Ltd and changed its name to Helios Techno Holding Co., Ltd. in April 2009. Helios Techno Holding Co., Ltd. was founded in 1976 and is headquartered in Himeji, Japan.","Pioneer Floating Rate Fund, Inc. is closed ended fixed income mutual fund launched and managed by Pioneer Investment Management, Inc. It invests in the fixed income markets of the United States. The fund primarily invests in senior secured floating-rate loans. It benchmarks the performance of its portfolio against the Barclays U.S. High Yield Loans Index. Pioneer Floating Rate Fund, Inc. was formed on October 6, 2004 and is domiciled in the United States.","SCSK Corporation provides information technology (IT) services in Japan and internationally. The company's Manufacturing &amp; Telecommunication Systems Business segment offers IT solutions comprising core systems, manufacturing and information management systems, supply chain management (SCM), and customer relationship management (CRM) systems for manufacturing, communication, and energy industries. Its Distribution &amp; Media Systems Business segment offers IT solutions, such as core and information systems, SCM, CRM, and e-commerce systems for distribution, service, and media industries. The company's Global System Solutions &amp; Innovation Business segment provides IT solutions for trading companies. Its Financial IT Business segment develops, maintains, and operates systems for banks and trust banks, as well as insurance, securities, lease, and credit companies. The company's IT Business Solutions segment provides contact center services; and application management outsourcing services that covers development, installation, maintenance, and operation of enterprise resource planning and CRM products, such as ProActive, SAP, Oracle, and Salesforce, as well as business process outsourcing services. Its IT Platform Solutions segment provides services and products in the fields of IT infrastructure and manufacturing, including computer-aided design and engineering. The company's IT Management Service segment develops solutions-oriented netXDC data centers to provide outsourcing services; and provides cloud infrastructure, on-site SE support management services. Its Mobility System segment offers software development and assessments, middleware, and process improvement measures for automobile electronic control units. The company was formerly known as Sumisho Computer Systems Corporation and changed its name to SCSK Corporation in October 2011. The company was incorporated in 1969 and is headquartered in Tokyo, Japan. SCSK Corporation is a subsidiary of Sumitomo Corporation.","Cleanaway Company Limited operates as an intermediate treatment solidification company within the waste disposal process in Taiwan. It operates through six segments: Solidification and Excavation, Landfill, Clean-up and Transport, China Operation, Investment, and Paper Manufacturing. The company offers intermediate treatment for hazardous industrial waste, and contaminated and illegal dump sites cleanup; landfill for hazardous waste and industrial waste; and waste removal services. It also manufactures and sells paper products, such as kraft paper, electronic carrier paper, pipe paper, etc. The company was formerly known as Cleanaway Kang Lien Co Ltd. and changed its name to Cleanaway Company Limited in May 2009. Cleanaway Company Limited was incorporated in 1999 and is based in Kaohsiung City, Taiwan.","Dr\u00e4gerwerk AG &amp; Co. KGaA operates as a medical and safety technology company in Europe, the Americas, Africa, Asia, and Australia. The company develops, produces, and markets system solutions, equipment, and services for acute point of care, including emergency care, perioperative care, critical care, and perinatal care. It also develops, produces, and markets products, system solutions, and services for personal protection, gas detection technology, and integrated hazard management to customers in industry and mining sectors, as well as public sectors, such as fire departments, police, and disaster protection. The company's products portfolio includes anesthesia devices and ventilators, thermoregulation equipment, consumables and accessories, supply units, lights, gas management systems, patient monitoring, software applications, system products, and other services. Its product portfolio also comprises stationary and mobile gas detection systems, personal protective equipment, and alcohol and drug testing devices. In addition, the company offers various training and services, as well as fire training facilities for firefighters. Dr\u00e4gerwerk AG &amp; Co. KGaA was founded in 1889 and is headquartered in L\u00fcbeck, Germany.","1st Source Corporation operates as the bank holding company for 1st Source Bank that provides commercial and consumer banking services, trust and wealth advisory services, and insurance products to individual and business clients. Its consumer banking services include checking and savings accounts; certificates of deposit; individual retirement accounts; online and mobile banking products; consumer loans, real estate mortgage loans, and home equity lines of credit; and financial planning, financial literacy, and other consultative services, as well as debit and credit cards. The company also offers commercial, small business, agricultural, and real estate loans for general corporate purposes, including financing for industrial and commercial properties, equipment, inventories, accounts receivables, and renewable energy and acquisition financing; and commercial leasing, treasury management, and retirement planning services. In addition, it provides trust, investment, agency, and custodial services comprising administrat
