 management and risk analytics, as well as trading and post-trade settlement services with integrated compliance and managed data. In addition, the company offers investment management strategies and products, such as core and enhanced indexing, multi-asset strategies, active quantitative and fundamental active capabilities, and alternative investment strategies. Further, it provides services and solutions, including environmental, social, and governance investing; defined benefit and defined contribution; and global fiduciary solutions, as well as exchange-traded fund under the SPDR ETF brand. The company provides its products and services to mutual funds, collective investment funds and other investment pools, corporate and public retirement plans, insurance companies, foundations, endowments, and investment managers. State Street Corporation was founded in 1792 and is headquartered in Boston, Massachusetts.","Hagerty, Inc. provides insurance agency services worldwide. It offers automobile and boat insurance products; and reinsurance products. The company also provides Hagerty Media, which publishes contents through the HDC Magazine, video content, YouTube channel; HDC that offers subscription based products and services, including HDC Magazine, automotive enthusiast events, proprietary vehicle valuation tools, emergency roadside services, and special vehicle-related discounts; HVT, a valuation tool used by the customer to access current and historic pricing data of collector car, truck, SUV, and motorcycle models; and Hagerty Events, an eclectic mix of small and large events. In addition, it offers DriveShare, a peer-to-peer rental platform for collector and cool vehicles; Motorsport Reg, a motorsport membership, licensing, and event online management system that automates event listings, registration, and payment processing for various motorsport events; and Hagerty Garage + Social, a platform that provides clubhouses and car storage facilities. The company is headquartered in Traverse City, Michigan.","D-Market Elektronik Hizmetler ve Ticaret A.S. operates e-commerce platforms in Turkey. The company operates www.hepsiburada.com, a retail website that provides its retail customers a range of merchandise, including electronics and non-electronics, such as books, sports, toys, kids and baby products, cosmetics, furniture, etc. It also offers HepsiExpress, an app-in-app initiative and on-demand delivery service that delivers groceries, water, and flowers; HepsiJet that provides last- mile delivery services; HepsiLojistik, which offers storage and fulfillment services; HepsiMat, a pick-up and drop-off point; HepsiAd that provides advertising service and data driven insights; HepsiGlobal for discovering and purchasing products from international merchants online; Hepsipay, which offers an e-money and payment services; and HepsiFly for buying airline tickets online. The company was incorporated in 2000 and is headquartered in Istanbul, Turkey.","Sealed Air Corporation provides food safety and security, and product protection solutions and equipment in North America, South America, Europe, the Middle East, Africa, and the Asia Pacific. It operates through two segments, Food and Protective. The Food segment offers integrated packaging materials and automation equipment solutions to provide food safety and shelf life extension, reduce food waste, automate processes, and optimize total cost for food processors in the fresh red meat, smoked and processed meats, poultry, seafood, plant-based, and dairy markets under the CRYOVAC, CRYOVAC Grip &amp; Tear, CRYOVAC Darfresh, Simple Steps, and Optidure brands. This segment sells its solutions directly to customers through its sales, marketing, and customer service personnel. The Protective segment provides foam, inflatable, suspension and retention, temperature assurance packaging solutions to protect goods to e-commerce, consumer goods, pharmaceutical and medical devices, and industrial manufacturing markets under the SEALED AIR, BUBBLE WRAP, AUTOBAG, SEALED AIR, AUTOBAG, Instapak, Korrvu, Kevothermal, and TempGuard brands. This segment sells its solutions through supply distributors, as well as directly to fabricators, original equipment manufacturers, contract manufacturers, logistics partners, and e-commerce/fulfillment operations. Sealed Air Corporation was incorporated in 1960 and is headquartered in Charlotte, North Carolina.","Winix Inc. manufactures and sells home appliances in South Korea and internationally. The company's products include air purifiers, dehumidifiers, humidifiers, fan heaters, water purifiers, and filter/accessories. It also offers refrigerator coolers, air conditioner parts, heat exchangers, cold and hot water heaters, condensers, and hot air machines. In addition, the company engages in the real estate rental business. Winix Inc. was founded in 1973 and is headquartered in Siheung, South Korea.","Zoom Video Communications, Inc. provides unified communications platform in the Americas, the Asia Pacific, Europe, the Middle East, and Africa. The company offers Zoom Meetings that offers HD video, voice, chat, and content sharing through mobile devices, desktops, laptops, telephones, and conference room systems; Zoom Phone, an enterprise cloud phone system; and Zoom Chat enables users to share messages, images, audio files, and content in desktop, laptop, tablet, and mobile devices. It also provides Zoom Rooms, a software-based conference room system; Zoom Hardware-as-a-Service allows users to access video communication technology from third party equipment; Zoom Conference Room Connector, a gateway for SIP/H.323 endpoints to join Zoom meetings; Zoom Events, which enables users to manage and host internal and external virtual events; OnZoom, a prosumer-focused virtual event platform and marketplace for Zoom users to create, host, and monetize online events; and Zoom Webinars to provide video presentations to large audiences from many devices. In addition, the company offers Zoom Developer Platform that enables developers, platform integrators, service providers, and customers to build apps and integrations using Zoom's video-based communications solutions, as well as integrate Zoom's technology into their products and services; Zoom App Marketplace, which helps developers to publish their apps, as well as third-party integrations of Zoom; and Zoom Contact Center, an omnichannel contact center solution. It serves individuals; and education, entertainment/media, enterprise infrastructure, finance, government, healthcare, manufacturing, non-profit/not for profit and social impact, retail/consumer products, and software/Internet industries. The company was formerly known as Zoom Communications, Inc. and changed its name to Zoom Video Communications, Inc. in May 2012. The company was incorporated in 2011 and is headquartered in San Jose, California.","Lassila &amp; Tikanoja Oyj operates as a service company in Finland, Sweden, and Russia. It operates through four segments: Environmental Services, Industrial Services, Facility Services Finland, and Facility Services Sweden. The company offers waste management and recycling services; sells receptacles, and related maintenance and circular economy solutions; and provides wood-based and recycled fuels, and wood raw materials, as well as forest services to forest owners. It also provides solutions for industrial material flows and their utilization, as well as industrial process cleaning solutions; and engages in the collection and disposal of hazardous waste and sewer system maintenance and repair solutions. In addition, the company offers support services and services for cleaning, property maintenance, and real estate management, as well as repair and renovation services; and building automation, refrigeration technology, and energy management services. Further, it provides support services and services for cleaning and technical services. Lassila &amp; Tikanoja Oyj was founded in 1905 and is headquartered in Helsinki, Finland.","Air Products and Chemicals, Inc. provides atmospheric gases, process and specialty gases, equipment, and services worldwide. The company produces atmospheric gases, including oxygen, nitrogen, and argon; process gases, such as hydrogen, helium, carbon dioxide, carbon monoxide, syngas; specialty gases; and equipment for the production or processing of gases comprising air separation units and non-cryogenic generators for customers in various industries, including refining, chemical, gasification, metals, manufacturing, food and beverage, electronics, magnetic resonance imaging, energy production and refining, and metals. It also designs and manufactures equipment for air separation, hydrocarbon recovery and purification, natural gas liquefaction, and liquid helium and liquid hydrogen transport and storage. Air Products and Chemicals, Inc. has a strategic collaboration with Baker Hughes Company to develop hydrogen compression systems. The company was founded in 1940 and is headquartered in Allentown, Pennsylvania.","Akamai Technologies, Inc. provides cloud services for securing, delivering, and optimizing content and business applications over the internet in the United States and internationally. The company offers cloud solutions to keep infrastructure, websites, applications, application programming interfaces, and users safe from various cyberattacks and online threats while enhancing performance. It also provides web and mobile performance solutions to enable dynamic websites and applications; media delivery solutions, including video streaming and video player services, game and software delivery, broadcast operations, authoritative domain name system, resolution, and data and analytics; and edge compute solutions to enable developers to deploy and distribute code at the edge. In addition, the company offers carrier offerings, including cybersecurity protection, parental controls, DNS infrastructure and content delivery solutions; and an array of service and support to assist customers with integrating, configuring, optimizing, and managing its offerings. It sells its solutions through direct sales and service organizations, as well as through various channel partners. Akamai Technologies, Inc. was incorporated in 1998 and is headquartered in Cambridge, Massachusetts.","Atara Biotherapeutics, Inc., an off-the-shelf T-cell immunotherapy company, develops treatments for patients with cancer, autoimmune, and viral diseases in the United States. It is developing tabelecleucel, a T-cell immunotherapy that is Phase 3 clinical trials for the treatment of epstein-barr virus (EBV) driven post-transplant lymphoproliferative disease, as well as hematologic and solid tumors, including nasopharyngeal carcinoma. The company is also developing next-generation CAR T immunotherapies for patients with hematologic malignancies and solid tumors, including ATA2271 and ATA3271 for mesothelin; and ATA2431 and ATA3219 for B-cell malignancies, as well as ATA188 for the treatment of multiple sclerosis. In addition, it develops ATA368 program for patients with human papillomavirus associated cancers. Atara Biotherapeutics, Inc. has a license agreement with Memorial Sloan Kettering Cancer Center; license, and research and development collaboration agreement with QIMR Berghofer Medical Research Institute; and strategic collaboration with H. Lee Moffitt Cancer Center, as well as Bayer AG for mesothelin-targeted CAR T-cell therapies for solid tumors. The company was incorporated in 2012 and is headquartered in South San Francisco, California.","Berry Global Group, Inc. manufactures and supplies non-woven, flexible, and rigid products in consumer and industrial end markets. The company operates through Consumer Packaging International; Consumer Packaging North America; Engineered Materials; and Health, Hygiene &amp; Specialties segments. The Consumer Packaging International segment offers closures and dispensing systems, pharmaceutical devices and packaging, bottles and canisters, containers, and technical components. The Consumer Packaging North America segment provides containers and pails, foodservice products, closures and overcaps, bottles and prescription vials, and tubes. The Engineered Materials segment offers stretch and shrink, converter, food and consumer, and agriculture films, as well as institutional can liners and retail bags. The Health, Hygiene &amp; Specialties segment provides healthcare, hygiene, specialties, and tapes. Berry Global Group, Inc. sells its products through direct sales force of professionals and distributors in the United States, Canada, Europe, and internationally. The company was formerly known as Berry Plastics Group, Inc. and changed its name to Berry Global Group, Inc. in April 2017. Berry Global Group, Inc. was founded in 1967 and is based in Evansville, Indiana.","C.H. Robinson Worldwide, Inc., together with its subsidiaries, provides freight transportation services and logistics solutions to companies in various industries worldwide. The company operates in two segments, North American Surface Transportation and Global Forwarding. It offers transportation and logistics services, such as truckload; less than truckload transportation brokerage services, which include the shipment of single or multiple pallets of freight; intermodal transportation that comprise the shipment service of freight in containers or trailers by a combination of truck and rail; and non-vessel ocean common carrier and freight forwarding services, as well as organizes air shipments and provides door-to-door services. The company also offers customs broker services; and other logistics services, such as fee-based managed, warehousing, small parcel, and other services. It has contractual relationships with approximately 85,000 transportation companies, including motor carriers, railroads, and air and ocean carriers. In addition, the company is involved in buying, selling, and/or marketing of fresh produce, including fresh fruits, vegetables, and other value-added perishable items under the Robinson Fresh name. Further, it provides transportation management services or managed TMS; and other surface transportation services. The company offers its fresh produce to grocery retailers, restaurants, produce wholesalers, and foodservice distributors through a network of independent produce growers and suppliers. C.H. Robinson Worldwide, Inc. was founded in 1905 and is headquartered in Eden Prairie, Minnesota.","Expeditors International of Washington, Inc. provides logistics services in the Americas, North Asia, South Asia, Europe, the Middle East, Africa, and India. The company offers airfreight services, such as air freight consolidation and forwarding; ocean freight and ocean services, including ocean freight consolidation, direct ocean forwarding, and order management; customs brokerage, intra-continental ground transportation and delivery, and warehousing and distribution services; and customs clearance, purchase order management, vendor consolidation, time-definite transportation services, temperature-controlled transit, cargo insurance, specialized cargo monitoring and tracking, and other supply chain solutions. It also provides optimization, trade compliance, consulting, cargo security, and solutions. In addition, it acts as a freight consolidator or as an agent for the airline, which carries the shipment. Further, the company provides ancillary services that include preparation of shipping and customs documentation, packing, crating, insurance services, negotiation of letters of credit, and the preparation of documentation to comply with local export laws. Its customers include retailing and wholesaling, electronics, technology, and industrial and manufacturing companies. Expeditors International of Washington, Inc. was incorporated in 1979 and is headquartered in Seattle, Washington.","Fortinet, Inc. provides broad, integrated, and automated cybersecurity solutions in the Americas, Europe, the Middle East, Africa, and the Asia Pacific. It offers FortiGate hardware and software licenses that provide various security and networking functions, including firewall, intrusion prevention, anti-malware, virtual private network, application control, web filtering, anti-spam, and wide area network acceleration. The company also provides FortiSwitch product family that offers secure switching solutions for connecting customers their end devices; FortiAP product family, which provides secure wireless networking solutions; FortiExtender, a hardware appliance; FortiAnalyzer product family, which offers centralized network logging, analyzing, and reporting solutions; and FortiManager product family that provides central and scalable management solution for its FortiGate products. It offers FortiWeb product family provides web application firewall solutions; FortiMail product family that secure email gateway solutions; FortiSandbox technology that delivers proactive detection and mitigation services; FortiClient that provides endpoint protection with pattern-based anti-malware, behavior-based exploit protection, web-filtering, and an application firewall; FortiToken and FortiAuthenticator product families for multi-factor authentication to safeguard systems, assets, and data; and FortiEDR/XDR, an endpoint protection solution that provides both comprehensive machine-learning anti-malware execution and real-time post-infection protection. It provides security subscription, technical support, professional, and training services. It sells its security solutions to channel partners and directly to various customers in telecommunications, technology, government, financial services, education, retail, manufacturing, and healthcare industries. It has strategic alliance with Linksys. Fortinet, Inc. was incorporated in 2000 and is headquartered in Sunnyvale, California.","Incyte Corporation, a biopharmaceutical company, focuses on the discovery, development, and commercialization of proprietary therapeutics in the United States and internationally. The company offers JAKAFI, a drug for the treatment of myelofibrosis and polycythemia vera; PEMAZYRE, a fibroblast growth factor receptor kinase inhibitor that act as oncogenic drivers in various liquid and solid tumor types; and ICLUSIG, a kinase inhibitor to treat chronic myeloid leukemia and philadelphia-chromosome positive acute lymphoblastic leukemia. Its clinical stage products include ruxolitinib, a steroid-refractory chronic graft-versus-host-diseases (GVHD); itacitinib, which is in Phase II/III clinical trial to treat na\u00efve chronic GVHD; and pemigatinib for treating bladder cancer, cholangiocarcinoma, myeloproliferative syndrome, and tumor agnostic. In addition, the company engages in developing Parsaclisib, which is in Phase II clinical trial for follicular lymphoma, marginal zone lymphoma, and mantel cell lymphoma. Additionally, it develops Retifanlimab that is in Phase II clinical trials for MSI-high endometrial cancer, merkel cell carcinoma, and anal cancer, as well as in Phase II clinical trials for patients with non-small cell lung cancer. It has collaboration agreements with Novartis International Pharmaceutical Ltd.; Eli Lilly and Company; Agenus Inc.; Calithera Biosciences, Inc; MacroGenics, Inc.; Merus N.V.; Syros Pharmaceuticals, Inc.; Innovent Biologics, Inc.; Zai Lab Limited; Cellenkos, Inc.; and Nimble Therapeutics, as well as clinical collaborations with MorphoSys AG and Xencor, Inc. to investigate the combination of tafasitamab, plamotamab, and lenalidomide in patients with relapsed or refractory diffuse large B-cell lymphoma, and relapsed or refractory follicular lymphoma. The company was incorporated in 1991 and is headquartered in Wilmington, Delaware.","Archer-Daniels-Midland Company procures, transports, stores, processes, and merchandises agricultural commodities, products, and ingredients in the United States, Switzerland, Cayman Islands, Brazil, Mexico, the United Kingdom, and internationally. The company operates through three segments: Ag Services and Oilseeds, Carbohydrate Solutions, and Nutrition. It procures, stores, cleans, and transports agricultural raw materials, such as oilseeds, corn, wheat, milo, oats, and barley. The company also engages in the agricultural commodity and feed product import, export, and distribution; and structured trade finance activities. In addition, it offers vegetable oils and protein meals; ingredients for the food, feed, energy, and industrial customers; crude vegetable oils, salad oils, margarine, shortening, and other food products; and partially refined oils to produce biodiesel and glycols for use in chemicals, paints, and other industrial products. Further, the company provides peanuts, peanut-derived ingredients, and cotton cellulose pulp; sweeteners, corn and wheat starches, syrup, glucose, wheat flour, and dextrose; alcohol and other food and animal feed ingredients; ethyl alcohol and ethanol; corn gluten feed and meal; distillers' grains; and citric acids. Additionally, the company provides natural flavors, flavor systems, natural colors, proteins, emulsifiers, soluble fiber, polyols, hydrocolloids, and natural health and nutrition products, including probiotics, prebiotics, enzymes, and botanical extracts; and other specialty food and feed ingredients; edible beans; formula feeds, and animal health and nutrition products; and contract and private label pet treats and foods. It also offers futures commission merchant; commodity brokerage services; cash margins and securities pledged to commodity exchange clearinghouses; and cash pledged as security under certain insurance arrangements. The company was founded in 1902 and is headquartered in Chicago, Illinois.","LKQ Corporation distributes replacement parts, components, and systems used in the repair and maintenance of vehicles. It operates through three segments: North America, Europe, and Specialty. The company distributes bumper covers, automotive body panels, and lights, as well as automotive glass products, such as windshields; salvage products, including mechanical and collision parts comprising engines; transmissions; door assemblies; sheet metal products, such as trunk lids, fenders, and hoods; lights and bumper assemblies; scrap metal and other materials to metals recyclers; and brake pads, discs and sensors, clutches, steering and suspension products, filters, and oil and automotive fluids, as well as electrical products, including spark plugs and batteries. In addition, the company distributes recreational vehicle appliances and air conditioners, towing hitches, truck bed covers, vehicle protection products, cargo management products, wheels, tires, and suspension products. It serves collision and mechanical repair shops, and new and used car dealerships, as well as retail customers. The company operates in the United States, Canada, the United Kingdom, Germany, Belgium, the Netherlands, Luxembourg, Italy, the Czech Republic, Austria, Poland, Slovakia, Taiwan, and other European countries. LKQ Corporation was incorporated in 1998 and is headquartered in Chicago, Illinois.","lululemon athletica inc., together with its subsidiaries, designs, distributes, and retails athletic apparel and accessories for women and men. It operates in two segments, Company-Operated Stores and Direct to Consumer. The company offers pants, shorts, tops, and jackets for healthy lifestyle and athletic activities, such as yoga, running, and training, as well as other sweaty pursuits. It also provides fitness-related accessories and footwear. The company sells its products through a chain of company-operated stores; outlets and warehouse sales; interactive workout platform; a network of wholesale accounts, such as yoga studios, health clubs, and fitness centers; temporary locations; and license and supply arrangements, as well as directly to consumer through mobile apps and lululemon.com e-commerce website. As of January 30, 2022, it operated 574 company-operated stores under the lululemon brand in the United States, Canada, the People's Republic of China, Australia, the United Kingdom, Japan, New Zealand, Germany, South Korea, Singapore, France, Malaysia, Sweden, Ireland, the Netherlands, Norway, and Switzerland. lululemon athletica inc. was founded in 1998 and is based in Vancouver, Canada.","Monster Beverage Corporation, through its subsidiaries, engages in development, marketing, sale, and distribution of energy drink beverages and concentrates in the United States and internationally. The company operates through three segments: Monster Energy Drinks, Strategic Brands, and Other. It offers carbonated energy drinks, non-carbonated, ready-to-drink iced teas, lemonades, juice cocktails, single-serve juices and fruit beverages, ready-to-drink dairy and coffee drinks, energy drinks, sports drinks and single-serve still waters, and sodas that are considered natural, sparkling juices, and flavored sparkling beverages. The company sells its products to bottlers, full-service beverage distributors, as well as sells directly to retail grocery and speciality chains, wholesalers, club stores, mass merchandisers, convenience chains, drug stores, foodservice customers, value stores, e-commerce retailers, and the military; and concentrates and/or beverage bases to authorized bottling and canning operations. It provides its products under the Monster Energy, Monster Energy Ultra, Monster Rehab, Monster Energy Nitro, Java Monster, Muscle Monster, Espresso Monster, Punch Monster, Juice Monster, Monster Hydro Energy Water, Monster Hydro Super Sport, Monster HydroSport Super Fuel, Monster Super Fuel, Monster Dragon Tea, Reign Total Body Fuel, and Reign Inferno Thermogenic Fuel, as well as NOS, Full Throttle, Burn, Mother, Nalu, Ultra Energy, Play and Power Play (stylized), Relentless, BPM, BU, Gladiator, Samurai, Live+, Predator, Fury, and True North brands. The company was formerly known as Hansen Natural Corporation and changed its name to Monster Beverage Corporation in January 2012. Monster Beverage Corporation was founded in 1985 and is headquartered in Corona, California.","ON Semiconductor Corporation provides intelligent sensing and power solutions worldwide. Its intelligent power technologies enable the electrification of the automotive industry that allows for lighter and longer-range electric vehicles, empowers fast-charging systems, and propels sustainable energy for the solar strings, industrial power, and storage systems. The company operates through three segments the Power Solutions Group, the Advanced Solutions Group, and the Intelligent Sensing Group segments. It offers analog, discrete, module, and integrated semiconductor products that perform multiple application functions, including power switching and conversion, signal conditioning, circuit protection, signal amplification, and voltage regulation functions. The company also designs and develops analog, mixed-signal, advanced logic, application specific standard product and ASICs, radio frequency, and integrated power solutions for end-users in end-markets, as well as provides foundry and design services for government customers. In addition, it develops complementary metal oxide semiconductor image sensors, image signal processors, and single photon detectors, including silicon photomultipliers and single photon avalanche diode arrays, as well as actuator drivers for autofocus and image stabilization for a broad base of end-users in various end-markets. ON Semiconductor Corporation was incorporated in 1992 and is headquartered in Phoenix, Arizona.","PPG Industries, Inc. manufactures and distributes paints, coatings, and specialty materials worldwide. The company's Performance Coatings segment offers coatings, solvents, adhesives, sealants, sundries, and software for automotive and commercial transport/fleet repair and refurbishing, light industrial coatings, and specialty coatings for signs; and coatings, sealants, transparencies, transparent armor, adhesives, engineered materials, and packaging and chemical management services for commercial, military, regional jet, and general aviation aircraft. It also provides coatings and finishes for the protection of metals and structures, such as metal fabricators, heavy duty maintenance contractors, and manufacturers of ships, bridges, and rail cars; paints, wood stains, adhesives, and purchased sundries for painting and maintenance contractors, and consumers for decoration and maintenance of residential and commercial building structures; and paints, thermoplastics, pavement marking products, and other technologies for pavement marking. The company's Industrial Coatings segment offers coatings, adhesives and sealants, and metal pretreatments, as well as services and coatings applications for appliances, agricultural and construction equipment, consumer electronics, automotive parts and accessories, building products, kitchenware, and transportation vehicles and other finished products; and on-site coatings services. It also provides coatings for metal cans, closures, plastic tubes, and promotional and specialty packaging; amorphous precipitated silica for tire, battery separator, and other end-uses; TESLIN substrates for labels, e-passports, drivers' licenses, breathable membranes, and loyalty and identification cards; and organic light emitting diode materials, displays and lighting lens materials, optical lenses, color-change products, and photochromic dyes. The company was incorporated in 1883 and is headquartered in Pittsburgh, Pennsylvania.","Regency Centers is the preeminent national owner, operator, and developer of shopping centers located in affluent and densely populated trade areas. Our portfolio includes thriving properties merchandised with highly productive grocers, restaurants, service providers, and best-in-class retailers that connect to their neighborhoods, communities, and customers. Operating as a fully integrated real estate company, Regency Centers is a qualified real estate investment trust (REIT) that is self-administered, self-managed, and an S&amp;P 500 Index member.","VeriSign, Inc., together with its subsidiaries, provides domain name registry services and internet infrastructure that enables internet navigation for various recognized domain names worldwide. It enables the security, stability, and resiliency of internet infrastructure and services, including providing root zone maintainer services, operating two of the 13 internet root servers; and offering registration services and authoritative resolution for the .com and .net domains, which support global e-commerce. The company also back-end systems for .cc, .gov, .edu, and .name domain names, as well as operates distributed servers, networking, security, and data integrity services. VeriSign, Inc. was incorporated in 1995 and is headquartered in Reston, Virginia.","United Parcel Service, Inc. provides letter and package delivery, transportation, logistics, and related services. It operates through two segments, U.S. Domestic Package and International Package. The U.S. Domestic Package segment offers time-definite delivery of letters, documents, small packages, and palletized freight through air and ground services in the United States. The International Package segment provides guaranteed day and time-definite international shipping services in Europe, the Asia Pacific, Canada and Latin America, the Indian sub-continent, the Middle East, and Africa. This segment offers guaranteed time-definite express options. The company also provides international air and ocean freight forwarding, customs brokerage, distribution and post-sales, and mail and consulting services in approximately 200 countries and territories. In addition, it offers truckload brokerage services; supply chain solutions to the healthcare and life sciences industry; shipping, visibility, and billing technologies; and financial and insurance services. The company operates a fleet of approximately 121,000 package cars, vans, tractors, and motorcycles; and owns 59,000 containers that are used to transport cargo in its aircraft. United Parcel Service, Inc. was founded in 1907 and is headquartered in Atlanta, Georgia.","Accenture plc, a professional services company, provides strategy and consulting, interactive, and technology and operations services worldwide. The company offers application services, including agile transformation, DevOps, application modernization, enterprise architecture, software and quality engineering, data management, intelligent automation comprises robotic process automation, natural language processing, and virtual agents, and liquid application management services, as well as program, project, and service management services; strategy consulting services; critical data elements, data management and governance, data platform and architecture, product-based organization and skills, business adoption, and value realization services; engineering, and research and development digitization; smart connected product design and development; product platform engineering and modernization; product as-a-service enablement; products related to production and operations; autonomous robotics systems; the digital transformation of capital projects; and digital industrial workforce solutions. It also provides data-enabled operating models; technology consulting and artificial intelligence services; services related to talent and organization/human potential; digital commerce; infrastructure services, such as hybrid cloud, network, digital workplace and collaboration, service and experience management, infrastructure as code, and managed edge and IoT devices; cyber defense, applied cybersecurity, managed security, OT security, security strategy and risk, and industry security products; services related to technology innovation; and intelligent automation services. In addition, the company offers cloud, ecosystem, marketing, supply chain management, zero-based budgeting, customer experience, finance consulting, mergers and acquisitions, and sustainability services. Accenture plc was founded in 1951 and is based in Dublin, Ireland.","WORLDEX INDUSTRY &amp; TRADING CO., Ltd. is a Korea-based company mainly engaged in the manufacturing and distribution of silicon parts used in semiconductor surface etching process. The Company's product portfolio consists of silicon parts, including silicon electrodes, silicon rings, silicon boats, silicon solar batteries and others, quartzes as well as alumina products used for semiconductor, liquid crystal display (LCD) and liquid emitting diode (LED) parts. The Company distributes its products within domestic market and to the overseas markets. It is also engaged in the manufacturing and distribution of LED lightings through its subsidiary.","Tah Hsin Industrial Corporation manufactures and trades rainwear, garments, furniture products, office equipment, and corrugated boards in Taiwan. The company offers raincoats for motorcyclists, police, children, fishing, mountaineering, sports, sailing, golf, etc.; garments, such as sports casual clothes, wardrobes, bags, winter and summer student clothes, work clothes for primary and secondary schools, and group employee uniforms, as well as suits, sports suits, windbreaker jackets, and casual wear; and rain shoe products for markets, factories, students, office workers, mountaineers, etc. It provides PP corrugated board products that are used in display boards, stationery, recycling bins, packaging containers, moisture-proof bottom panel, and epidemic prevention partition. The company also provides office equipment, including punching and binding machines, and laminators. In addition, it offers TC garments, leather goods, handbags, file folders, plastic film, and carrier bags. The company also exports its products. The company was formerly known as Tah Hsin Plastics Co., Ltd. and changed its name to Tah Hsin Industrial Corporation in 1970. Tah Hsin Industrial Corporation was incorporated in 1958 and is headquartered in Taichung, Taiwan.","Rexon Industrial Corp.,Ltd designs, manufactures, and sells bench top/stationary machinery, and consumer and commercial grade fitness products in Taiwan, the United States, Europe, the rest of Asia, and internationally. The company offers power tools, including sawing, drilling, demolishing, grinding, polishing/sanding, cutting, and planning/routing. It also provides fitness equipment, such as treadmills, as well as after-sale services. In addition, the company engages in merchandise trading activities; and the manufacture and sale of electric components and woodworking tools. The company was formerly known as KuoHsing Machinery Ltd. and changed its name to Rexon Industrial Corp.,Ltd in 1976. The company was founded in 1972 and is based in Taichung, Taiwan.","China Metal Products Co., Ltd. designs, manufactures, and retails iron casting products in Taiwan, the United States, Japan, China, Europe, South America, and internationally. The company operates through three segments: Metal Manufacturing, Real Estate Development, and Lifestyle Hospitality. The company designs, develops, manufactures, and sells vehicle and machinery parts; retails auto parts; and offers management and consulting services. It also develops and leases resident, commercial buildings, and factories; and operates hotels under the Hotel National and Splendor Hotel Taichung names, as well as amusement park under the Shangrila Paradise name. In addition, the company operates Park Lane by CMP and Park Lane by Splendor lifestyle shopping malls; and foundation for arts and culture. Further, it develops, manufactures, and sells farm and industrial wagon parts, and household appliances parts, as well as provides after sales services. China Metal Products Co., Ltd. was founded in 1972 and is based in Taipei City, Taiwan.","Airmate (Cayman) International Co Limited researches, develops, manufactures, and sells household appliances in China, Japan, South Korea, and internationally. The company offers electric fans and heaters, air purifiers, humidifiers, dehumidifiers, and fresh air systems. It also provides precision molds treatment services. The company also offers its products through online store. Airmate (Cayman) International Co Limited was founded in 1973 and is based in George Town, the Cayman Islands.","China Man-Made Fiber Corporation manufactures and sells man-made fibers, cellophane, polyamine fiber, polyester fiber, chemicals, and the raw materials primarily in Taiwan. The company offers monoethylene, diethylene, and triethylene glycol; ethylene oxide (EO), and nonyl-phenol; polyester chips, polyester partially oriented yarns, polyester spin drawn yarns, and polyester drawn textured yarns; and polyethylene glycol and alkane ether, polyethylene glycol and alkyl ether, castor oil EO addenda, polyethylene glycol propanamine, polyethylene glycol and fatty acid esters, polyethylene glycol, poly-propylene glycol and polyethylene glycol, trimethylolpropane EO additive, polyol EO, PO addenda, spinning oil agent, lubricating oil esters, plastic slip agents, cosmetic esters, cleaning agent esters, and bath softeners. It also offers machinery; leases and sells national housing and commercial buildings; distributes, sorts, and stores various products; manages supermarkets; trades in fresh foods, vegetables, fish, dried merchandise, and various seasonings; and operates gas stations. In addition, the company manufactures and sells steam, and industrial and commercial electricity by cogeneration; oxygen, liquid oxygen, nitrogen, liquid nitrogen, air argon, liquid argon, carbon dioxide, and compressed air; cosmetics and cleaning appliances; and food products. Further, it distributes and warehouses beverages; and engages in restaurant business. Additionally, the company provides short-term accommodation services; deposit, lending, foreign exchange, wealth management, corporate banking, electronic finance, trust, and investment products; insurance and general investment services; and securities brokerage services, as well as agency, distribution, and contract bidding services for installation of cogeneration and pollution control equipment. The company also exports its products. China Man-Made Fiber Corporation was founded in 1955 and is headquartered in Taipei City, Taiwan.","Maxigen Biotech Inc. engages in the development, manufacture, and marketing of biomedical and skincare products in Taiwan and internationally. The company offers Formagraft, a bone graft substitute; Formasetin, a bone void filler; and intra-articular injections under the ArtiAid, ArtiAid Plus, and ArtiBest names for use in orthopedic area. It also provides Foramic, a bone substitute granule; MaxiBone, a calcium phosphate ceramic; and GingivAid, a collagen dental grafts for use in orthopedic and dental areas. In addition, the company offers FormaAid, a collagen membrane; and E-TECH DENTISTAR II sterilizer and disinfectant for use in dental area, as well as HealiAid, a collagen wound dressing product for use in dental and wound dressing area. Further, it provides ophthalmic viscoelastic device under the ViscAid, PreviscAid, and BiVisc names; and Formaderm, a dermal filler injection for use in plastic surgery. Additionally, the company offers skincare products, including face, neck, body, limbs, and other masks; and make up remover, cleansing, exfoliating, toner, essence, men's care, sunscreen, body care, hand/foot care, and special care products. Maxigen Biotech Inc. was founded in 1998 and is based in Taoyuan City, Taiwan.","Kao Hsing Chang Iron &amp; Steel Corp. produces and sells steel pipes and plates and tin plates in Taiwan. It offers cold and hot rolled and coated steel coils. The company also engages in metal building structures, components manufacturing, leasing, parking lot management, and other wholesale business activities. The company was founded in 1966 and is based in Kaohsiung City, Taiwan.","King Slide Works Co., Ltd., together with its subsidiaries, manufactures furniture hardware in Taiwan, China, the United States, and internationally. It also designs, manufactures, and sells server rail, industrial slide, home furniture fittings, and other mechanical products. The company offers kitchen/furniture solutions, including metal and wood drawer systems, undermount slides, ball bearing slides, epoxy coating drawer slides, and hinges; consumer electronics, such as mobile phones; and ultra-thin server slide rail kits, electronic device rail kits, and cable management arm for cloud computing data centers. In addition, it provides products for special applications, such as home appliances, motorhome and RVs, office equipment, medical storage, and other applications. King Slide Works Co., Ltd. was incorporated in 1986 and is headquartered in Kaohsiung, Taiwan.","Koshidaka Holdings Co., Ltd. operates a karaoke business and a bath house business in Japan and internationally. The company has Karaoke Manekineko, a karaoke network; and One Kara, a karaoke box for people who sing alone. It also has Maneki no Yu bath houses to enjoy a natural hot spring bath, as well as enjoy outstanding food, relax, or even hold a banquet or other event. In addition, the company also provides real estate leasing and management services. Koshidaka Holdings Co., Ltd. was founded in 1967 and is headquartered in Tokyo, Japan.","Echomarketing Co.,Ltd. provides marketing services in South Korea and internationally. It offers marketing automation, performance analytics, campaign optimization, search marketing management, and customer value management solutions. The company was founded in 2003 and is headquartered in Seoul, South Korea.","STUDIO ALICE Co.,Ltd. operates children's photo studios in Japan. The company offers maternity photo, new born photo, hundred days celebration, peach/double fifth festival, half birthday, birthday photo, happy birthday Shichigosan, admission/enrollment/graduation, 1/2 coming-of-age ceremony, thirteen celebration, coming-of-age ceremony, bridal, family photo/longevity celebration, portrait photo, Disney character shooting, and business trip shooting services. It also provides print, album, photo mount, display photo, postcard, photography accessories, and other products. The company was founded in 1974 and is headquartered in Osaka, Japan.","Digital Arts Inc. develops and markets internet security software and appliances in Japan, the United States, Europe, and the Asia Pacific. It offers DigitalArts@Cloud that provides web security and email security in the cloud; i-FILTER, a web filtering software for corporations; i-FILTER Browser &amp; Cloud, a web security solution for smart devices that prevents private usage, visualizes web access with logs and reports, and prevents leaks of critical information; i-FILTER for consumers, a parental control software; D-SPA, a proxy appliance product; m-FILTER, an email filtering software for corporations; and FinalCode, a persistent password-less file security and tracking solution. The company also provides consulting services related to information security solutions; and support services, software version updates, and web filtering databases. Digital Arts Inc. was founded in 1995 and is headquartered in Tokyo, Japan.","Accton Technology Corporation researches and develops, manufactures, and sells network communication equipment in the United States, Europe, Taiwan, rest of Asia, and internationally. It offers computer network system products, including hardware, system software, network application software, and network workstations; wired and wireless land area network devices, such as switches, and wireless base stations; customer premises equipment; and optoelectronic communication subsystem that comprises optical network, optoelectronic communication module, and fiber optic repeater. The company also provides wireless local area network; wireless user's loop systems; internet of things (IoT) systems which consist of IoT gateways/controllers, multi-sensors, applications, and hybrid-cloud servers; and smart network interface card. In addition, it offers millimeter-wave AP, bridge, CPE; 5th generation cellular and enterprise small cell base station; and enterprise grade SD-WAN, virtual/universal CPE, as well as technical consulting and engineering design services. Further, the company offers information software and technology services, e-commerce apps, and advertising services; switching hubs and high-end network switches; and data center switches. Additionally, it offers carrier access solutions; software-defined wide-area network solutions; IoT integration solution; campus network solutions; and cloud data center solutions. Accton Technology Corporation was incorporated in 1988 and is headquartered in Hsinchu City, Taiwan.","RITEK Corporation manufactures and markets optical storage media products in Taiwan, the United States, rest of Asia, Europe, and internationally. The company offers storage media product lines, including optical storage media comprising CDs, DVDs, and Blu-ray discs; electronic storage media, which include flash memory cards, USB flash drives, portable hard disc drives, solid state drives, and others. It also provides solar modules comprising mono and poly-crystalline solar modules; and integrating solar systems; OLED display panels, ITO glasses, and patterned sapphire substrate solutions; metal masks; and biological detection discs. In addition, the company engages in organic light emitting diode, conductive glass, and battery manufacturing and trading; lighting equipment manufacturing; venture capital investment; property development and trading; micro bubble system manufacturing and sale; and electronic parts and components manufacturing businesses, as well as offers silicone chemicals, concrete waterproofing, DIY repairs, home cleaning/personal care products, plastic precision injection products, and management consulting services. RITEK Corporation was founded in 1957 and is headquartered in Hsinchu City, Taiwan.","Twinhead International Corp. offers rugged notebooks, rugged tablets, embedded solutions, and vehicle mount computers worldwide. The company provides mobile computers; rugged tablet PCs; semi-rugged mobile computers; mobile thin clients; medical tablet PCs; and other customized mother boards/systems. It also offers ODM, and partial or full customization services; project management services; manufacturing services, including fully rugged product and special feature validations, flexible production system, supply chain management, and purchasing models; and certification application services. The company serves government, military, health care, field sales/insurance, public safety, retail, hospitality, transportation/distribution, utilities/oil and gas, communication, agriculture, and field service industries. Twinhead International Corp. was incorporated in 1984 and is headquartered in Taipei, Taiwan.","Weltrend Semiconductor, Inc., a fabless semiconductor company, engages in planning, designing, testing, developing, and distributing integrated circuit (IC) products in Taiwan and internationally. The company offers display ICs, including advanced driver assistance system SoC, display MCU, FPD SoC, 3D active shutter glasses ICs and smart projectors; and consumer ICs, such as consumer MCUs, touch device controllers, heart rate monitors, USB HID controllers, boosted NFC card solutions, and MSR and barcode decoders. It also provides power management and analog ICs comprising USB power and charging port controllers, motor drivers, LED drivers, SPS supervisors, and OP amplifiers; and microcontrollers include 8-bit ADC type MCUs, Andes and Arm based 32-bit MCUs products, and BLDC motor control ICs. In addition, the company distributes electronic components. Weltrend Semiconductor, Inc. was founded in 1989 and is headquartered in Hsinchu City, Taiwan.","Visual Photonics Epitaxy Co., Ltd. researches, develops, manufactures, and sells optoelectronic semiconductors epitaxy and optoelectronic components products in Taiwan, the United States, and internationally. The company offers gallium arsenide (GaAs) heterojunction bipolar transistor (HBT), low turn-on voltage HBT, high voltage HBT, InP HBT and HEMT, GaAs pseudomorphic high electron mobility transistor (PHEMT) and BiHEMT, and GaN epi wafers. It also provides GaAs PD, InGaAs PD and APD, Zn diffusion ready InGaAs PD and APD, long wavelength InGaAs PD, F-P and DFB LD, and VCSEL epi wafers; and solar cell epi wafers, as well as customerized epi foundry services. The company was incorporated in 1996 and is based in Taoyuan City, Taiwan.","Cathay Real Estate Development Co.,Ltd. engages in the construction of residential and commercial buildings for leasing or selling in Taiwan. It operates in two segments, Movable Property and Real Estate Development Department; and Others. The company offers construction management, consultancy, and business management services. It is also involved in the wholesale of drugs and medical goods; general trade and investing; and service industry businesses. Cathay Real Estate Development Co.,Ltd. was founded in 1964 and is headquartered in Taipei, Taiwan.","Prince Housing &amp; Development Corp. engages in the construction business primarily in Taiwan. The company constructs, leases, and sells public housings, commercial buildings, and parking lots/parking towers, as well as tourism/recreation places, such as children's playgrounds, water parks, etc. It is also involved in the hotels and catering, plywood manufacturing, real estate management, real estate trading and leasing, apartment management, security, electricity and water pipe maintenance, and general investment activities, as well as offers security services. The company was incorporated in 1973 and is based in Taipei City, Taiwan.","Shan-Loong Transportation Co., Ltd engages in freight transportation, container trucking, truck repair and maintenance, gas station, and import and export business in Taiwan and internationally. The company provides the container, bulk, fuel, and hazardous material transportation services. It also offers container loading/unloading, warehouse management, order processing, temperature warehousing, delivery, and reverse logistics, as well as handling, picking, and processing services. In addition, the company provides customs brokerage services; sea, air, and land shipping services; and product storage management services. Further, it owns a network of 76 gas stations that offers fuels, such as diesel and octane, as well as provides car and scooter wash services. The company was formerly known as Wang Pai Transportation Co., Ltd. and changed its name to Shan-Loong Transportation Co., Ltd in 1982. Shan-Loong Transportation Co., Ltd was incorporated in 1976 and is headquartered in New Taipei City, Taiwan.","Gourmet Master Co. Ltd., an investment holding company, operates and franchises a chain of cafes in China, Taiwan, the United States, and internationally. The company operates its cafes under the 85\u00b0C name that provide coffee, cake, and bakery goods. As of December 31, 2019, it operated approximately 400 stores in Taiwan, 600 stores in China, 65 stores in the United States, 18 stores in Australia, and 8 stores in Hong Kong. It also provides birthday cakes, delicacy cakes, cake rolls, specialty cakes, toasts, Taiwanese/Japanese/European/Danish bread, sandwiches, donuts, coffee, tea, milk tea, smoothies, shakes, and juices; and others, including pineapple cakes, nougats, egg rolls, and gift boxes. Gourmet Master Co. Ltd. was founded in 2005 and is based in Taichung, Taiwan.","PAL GROUP Holdings CO., LTD. engages in the apparel, and miscellaneous goods and accessories businesses primarily in Japan. The company engages in the manufacture, wholesale, and retail of apparel products, including men's and women's clothing and accessories. It also offers miscellaneous daily goods. As of February 28, 2022, the company operated through a network of 902 stores. The company was formerly known as Pal Co., Ltd. and changed its name to PAL GROUP Holdings CO., LTD. in September 2016. PAL GROUP Holdings CO., LTD. was incorporated in 1973 and is headquartered in Osaka, Japan.","Wowprime Corp. operates restaurants and coffee/tea shops in Taiwan and Mainland China. The company engages in the retail sale of agricultural and husbandry products, food products, and groceries; and catering management, investment, management consulting, and food trading activities, as well as manufactures bakery products. It also provides catering services, including Western-style steak, Japanese-style creative cuisine, original Yakiniku, Hokkaido kombu pot, Kaiseki creative cuisine, French-style teppanyaki, Japanese pork chop curry, stone pot and shabu-shabu, vegetable dishes, etc. The company was incorporated in 1993 and is based in Taichung, Taiwan.","IEI Integration Corp. provides industrial computer products worldwide. It provides AIoT and edge computing products, DevCloud solutions, PUZZLE Dev. Kits, FLEX AIoT developer kits, TANK AIoT developer kits, AIoT edge insights solutions, embedded systems, AI training server systems, VPU, FPGA, and CPU accelerators, backplanes, and assistant robots; networking products comprising network appliances, including routers, VPN, switches, firewalls, UTMs, etc.; and storage servers, network modules, and industrial network switches. The company also offers embedded computers consisting of full size and half size single board computers; industrial motherboards and embedded boards; ETX/COM EXPRESS/Q7; PEMUX series backplanes; rackmount, embedded, and compact chassis; LCD converter boards; PCI/PCIe expansion cards; and wireless, mini-PCIe, and TPM modules. In addition, it provides embedded systems, including AI-powered box PCs, DIN-rail embedded systems, rugged box PCs, compact size embedded systems, medical box PCs, transportation embedded systems, digital signage embedded systems, and QTS gateways, as well as rackmount, embedded, and compact chassis; panel PC and monitor products, such as heavy and light industrial, RISC-based, healthcare, and transportation PCs; industrial monitors; and handheld devices. Further, the company offers power supply products, adapters, DC UPS modules, DC to DC modules, and peripherals, such as industrial compact flash cards, CPU coolers, cables and connectors, mounting kits and stands, drive bays, and e-window tool kits. Its products are used in computer-based applications, such as factory automation, computer telephony integration, networking appliances, security, and systems, as well as in various fields comprising the Internet of Things, national defense, police administration, transportation, communication base stations, and medical instruments. IEI Integration Corp. was founded in 1997 and is headquartered in New Taipei City, Taiwan.","SINBON Electronics Co., Ltd. manufactures and sells computer peripherals, connectors, wires, and other parts in Mainland China, the United States, Taiwan, and internationally. It operates through New Energy Business Unit, Industrial Application Business Unit, Medical Health Business Unit, Automotive Business Unit, and iComponent Solution Business Unit segments. The New Energy Business Unit segment develops, manufactures, and sells cable assembly and control modules for green energy industries, such as solar photovoltaic, wind power and offshore wind power. The Industrial Application Business Unit segment develops, manufactures, and sells industrial application products comprising robot arm control cable assemblies, control cabinet cable assemblies, and panel connection cables. The Medical Health Business Unit segment develops, manufactures, and sells medical equipment cables, including electrocardiographs, oximeters, and X-ray wiring harnesses. The Automotive Business Unit segment develops, manufactures, and sells electric vehicle charging guns and charging piles, automotive oxygen sensors, and parking-related equipment cables. The iComponent Solution Business Unit segment develops, manufactures, and sells communication related cables, such as smart phones, smart wearable devices and VR /AR HMD devices. The company also engages in the logistics, renewable energy investment management consulting, and new energy technology development businesses; and sale of electronic material. The company was incorporated in 1989 and is headquartered in New Taipei City, Taiwan.","Novatek Microelectronics Corp., together with its subsidiaries, engages in research and development, manufacture, and sale of integrated circuit chips for speech, communication, computer peripheral, LCD driver IC system, embedded MCU, DSP, and system applications. The company provides display driver ICs for LCD displays, televisions (TVs), notebook computers, desktop monitors, cameras, tablet PCs, automotive display screens, smart phones, and wearable products; and system on chips products for digital and smart TVs, notebook computers, desktop monitors, mobile phones, tablet PCs, camera modules, dashcam recording, IP cams, car backup camera modules, automotive safety assistance systems, and multimedia and mobile phone camera module applications. It is also involved in the trading and consulting services; offers electronic spare parts; and provision of design, development, amendment, testing, and related consulting services for multimedia VLSI software. The company has operations in Taiwan, Asia, and internationally. Novatek Microelectronics Corp. was incorporated in 1997 and is headquartered in Hsinchu, Taiwan.","Tripod Technology Corporation processes, manufactures, and sells printed circuit boards (PCBs) and other related components in Taiwan, China, Vietnam, Thailand, South Korea, Malaysia, and internationally. The company offers various PCBs for use in memory modules, TFT-LCDs, hard disk drives, notebook computers, and server/work stations, as well as handsets and automotive products; and other services. It also engages in the manufacture and wholesale of chemical materials and electronic parts; trading of PCBs and raw materials of electronic parts; manufacture of electronic cash registers; and wholesale, import, and export of electronic products. In addition, the company is also involved in the development, sale, and rental of commercial housing and own-built commercial housing; and investment activities. Further, it provides management services. Tripod Technology Corporation was founded in 1991 and is headquartered in Taoyuan, Taiwan.","Aopen Inc. provides digital signage technologies in Taiwan. It offers embedded PCs, such as digital signage media players, video wall controllers, network video recorders, industrial media players, medical box PC, and chrome boxes; touch panel PCs and chrome bases; commercial displays, including digital signage, industrial, medical, and commercial monitors. It also provides gaming, consumer, and portable monitors, as well as mini projectors, all-in-one PCs, gaming gadgets, and home entertainment products. In addition, the company offers accessories, including wall mounts, stands, panel PC peripherals, medical IT, and USB webcam. It serves QSR, smart retail, smart manufacturing, hospitality, healthcare, education, and transportation industries. Aopen Inc. was founded in 1996 and is based in Taipei, Taiwan.","Channel Well Technology Co.,Ltd. engages in the processing, manufacturing, and trading of power supply and electrical appliances worldwide. It offers PC and IPC power supply, industrial power supply, wireless charging transmitter and receiver, LED lighting driver/power, enclosed switching power, and open frame power products, as well as telecom power systems, wireless chargers/power banks, adapters, USB chargers, electric vehicle chargers, power cables/electronic wires, magnetic components, and heat sinks. The company was incorporated in 1993 and is headquartered in Taoyuan City, Taiwan.","DOUTOR NICHIRES Holdings Co., Ltd. manages restaurants and cafes in Japan. It manufactures and sells bread and pastry products; roasts and sells coffee; and imports, exports, purchases, and sells food products. The company also engages in the manufacture and wholesale of confectionary products; operation of bakery shops; wholesale of coffee machines, etc.; wholesale of fruits and vegetables; processing and wholesale of meat; manufacture of hams, sausages, and bacons; manufacture and wholesale of dressing products; and import of coffee beans and tea. In addition, it designs, constructs, maintains, and cleans stores; and operates natural food stores. DOUTOR NICHIRES Holdings Co., Ltd. was founded in 2007 and is headquartered in Tokyo, Japan.","Davicom Semiconductor, Inc. engages in the research, development, manufacture, and sale of communication network integrated circuits in Taiwan and internationally. The company offers ethernet, ethernet switch controller, industrial embedded transceiver, ethernet converter, dongle, and video decoder with safety monitoring. It also provides local area network chipsets for use in computer communications application on the network cards, hubs, and switches, as well as for use in local network resources to transfer and share; wide area network chipsets that are used as a remote access for data and video transmission; and video decoder chipsets, which are used for camera image signal decoding in closed-circuit television security monitoring systems, or DVR/NVR systems. In addition, the company offers electronic paper display products for low-power applications and equipment, such as financial smart cards, electronic shelf labels, wearing equipment, etc.; and microcontroller units for use in motor control, analogy digital signal, RFID, financial smart cards, electronic shelf labels, wearable equipment, etc. Further, it also provides wireless communication machinery and equipment. The company was founded in 1996 and is headquartered in Hsinchu, Taiwan.","Champion Microelectronic Corporation designs, manufactures, and sells integrated power management ICs in Asia, the United States, and Europe. The company offers PFC/PWM controllers, high performance resonant controllers, high power density/high efficiency solutions, special chips, Ture No Standby solutions, gate drivers, and PFC diodes. Its products are primarily used for desktop computers, cloud servers, LED displays, and others. The company was founded in 1998 and is headquartered in Hsinchu City, Taiwan.","The Investment Corporation was listed on the Tokyo Stock Exchange real estate investment trust market on February 7, 2014 with the support of all stakeholders, including unitholders, and gradually expanded its asset size. I've come. The Investment Corporation is investing heavily in \u0093Tokyo Commercial Property,\u0094 whose sponsor Hulic Co., Ltd. has a wealth of investment track record and know-how, and is expected to generate stable demand in the future and secure stable earnings over the long term. , By investing in \u0093next-generation asset plus,\u0094 which the Investment Corporation considers to contribute to maximizing the unitholder value in the medium to long term, secure and improve profits in the medium to long term and increase the size and value of assets under management. We aim to achieve growth. We will continue to utilize the sponsor support provided by the Hulic Group for both external and internal growth with the aim of contributing to the interests of our stakeholders, including investors, and to maximize the maximum value of unitholder value over the medium to long term. We are aiming to achieve this. We would like to ask all of you for your continued support.","Niko Semiconductor Co., Ltd. engages in the research, design, development, and sale of analog IC products in Taiwan, China, and internationally. It offers Power MOSFET, linear regulator, switching regulator and control ICs, low Vf diodes, SiC diodes, and power ICs. The company also develops, manufactures, and sells metal oxide semiconductors; provides product quality monitoring and testing services; and sells self-produced products. Its products are used in main-boards, VGA cards, LCD TVs and monitors, power adapters, laptop computers, telecom and network equipment, etc. The company was formerly known as Super Gem and changed its name to Niko Semiconductor Co., Ltd. in April 2001. Niko Semiconductor Co., Ltd. was incorporated in 1998 and is headquartered in New Taipei City, Taiwan.","Nomura Real Estate Master Fund,Inc. is a real estate investment trust (REIT) company. It aims to achieve sustainable growth in asset and stable earnings from mid-term to long-term perspectives. The Fund mainly invests in commercial buildings and logistic facilities located in the Tokyo area, Kinki area and other regions. The Fund manager is Nomura Real Estate Asset Management Co., Ltd.","AZoom co., Ltd. engages in buying and selling, mediation, management, and leasing of real estate. It is also involved in business development through Internet; Internet media development and operation; and management of parking lots. The company was founded in 2009 and is based in Tokyo, Japan.","Koei Tecmo Holdings Co., Ltd., together with its subsidiaries, operates as an entertainment company in Japan, North America, Europe, rest of Asia, and internationally. The company operates through Entertainment, Amusement, and Real Estate segments. The Entertainment segment develops and sells entertainment contents. It offers software for personal computers and gaming consoles. The Amusement segment develops commercial amusements; and manages amusement arcades. The Real Estate segment engages in the operation, management, and lease of real estate properties. It is also involved in the venture capital and other activities. The company was founded in 2009 and is headquartered in Yokohama, Japan. Koei Tecmo Holdings Co., Ltd. is a subsidiary of Koyu Holdings Co., Ltd.","FIC Global, Inc. invests in the EMS, information technology, and system integration businesses. The company was founded in 1993 and is based in Taipei, Taiwan.","System Integrator Corp. plans, develops, and sells packaging software and cloud services in Japan. It offers ERP, EC, omni channel, project management, database development and design support, application design, and e-learning tools. The company's products include AISIA, a design recognition solution; TOPSIC, an online and in real time cloud solution to evaluate a range of engineers' programming skills from beginner to advanced; SI Object Browser, a database development support tool; SI Object Browser ER, a data modeling tool; and SI Object Browser Designer, an AI design document preparation tool. Its products also comprise SI Object Browser PM, an integrated project management tool; SI Web Shopping, an EC site construction package software; and GRANDIT, a Web-based ERP. In addition, the company offers consulting services. System Integrator Corp. was founded in 1995 and is headquartered in Saitama, Japan.","PCI Holdings, Inc. engages in the information service business. It develops embedded control software for automobiles, heavy machinery, construction machinery, etc.; and equipment for telecommunications field, including mobile communication, as well as other information home appliances, various industrial equipment, semiconductor manufacturing equipment, etc. The company also develops software, middleware, and application that control various devices; firmware, such as shooting control for digital cameras; and software for control semiconductor inspection equipment. In addition, it develops information software for finance, manufacturing, distribution, and other companies; and social infrastructure software for transportation and broadcasting, and IT systems. Further, the company constructs and sells solutions utilizing packaged software products; operates and maintains system; and purchases and sells other hardware, etc. Additionally, it develops Internet of Things/Internet of everything solutions; and remote monitoring systems for the power generation industry, as well as provides operation and maintenance support services for renewable energy generation facilities. The company also offers services for semiconductor development, including LSI design, test design, evaluation, and others. PCI Holdings, Inc. was incorporated in 2005 and is headquartered in Tokyo, Japan.","Qualys, Inc. provides cloud-based information technology (IT), security, and compliance solutions in the United States and internationally. The company offers Qualys Cloud Apps, which includes Vulnerability Management; Vulnerability Management, Detection and Response; Threat Protection; Continuous Monitoring; Patch Management; Multi-Vector Endpoint Detection and Response; Certificate Assessment; SaaS Detection and Response; Secure Enterprise Mobility; Policy Compliance; Security Configuration Assessment; PCI Compliance; File Integrity Monitoring; Security Assessment Questionnaire; Out of-Band Configuration Assessment; Web Application Scanning; Web Application Firewall; Global Asset Inventory; Cybersecurity Asset Management; Certificate Inventory; Cloud Inventory; Cloud Security Assessment; and Container Security. Its integrated suite of IT, security, and compliance solutions delivered on its Qualys Cloud Platform enables customers to identify and manage IT assets, collect and analyze IT security data, discover and prioritize vulnerabilities, recommend and implement remediation actions, and verify the implementation of such actions. The company also provides asset tagging and management, reporting and dashboards, questionnaires and collaboration, remediation and workflow, big data correlation and analytics engine, and alerts and notifications, which enable integrated workflows, management and real-time analysis, and reporting across IT, security, and compliance solutions. The company offers its solutions through its sales teams, as well as through its network of channel partners, such as security consulting organizations, managed service providers, resellers, and consulting firms. It serves enterprises, government entities, and small and medium-sized businesses in various industries, including education, financial services, government, healthcare, insurance, manufacturing, media, retail, technology, and utilities. The company was incorporated in 1999 and is headquartered in Foster City, California.","T&amp;S inc. provides system development and related services in Japan. The company offers contract development, operation, and maintenance solutions for various corporate clients; and IT infrastructure operation and maintenance services, as well as the IT help desk services. It also provides various technology categories comprising artificial intelligence, image analysis/recognition, machine learning, automated driving, hardware control, software acceleration, etc. T&amp;S inc. was incorporated in 2016 and is headquartered in Yokohama, Japan.","Visional, Inc. provides human resources platform solutions in Japan. It operates through two segments, HR Tech and Incubation. The HR Tech segment provides BizReach, a professional recruiting platform; HRMOS, a cloud based HCM platform; CareerTrek, a recruiting platform for young professional talents; BizReach, a campus network for alumni visits; and BINAR, a recruiting platform for high-skilled engineers. The Incubation segment offers BizReach Succeed, an online M&amp;A matching platform; Trabox, an online logistics matching platform; BizHint, an B-to-B lead generation
