port system, human resources for the real estate industry, and Internet advertising services. It provides a service for real estate and housing companies to match companies and consumers on the Web. The company's platform offers real estate sales, house and renovation, rental management, real estate personnel, business information, and real estate review services. Living Technologies Inc. was founded in 2004 and is headquartered in Tokyo, Japan.","World Known MFG (Cayman) Limited produces and sells commercial vehicle parts in the United States, the United Kingdom, Sweden, Denmark, and Japan. The company offers exhaust manifolds, disc brakes, gearbox and pump housing products, and knuckles; and diesel engine and air disc brake components. It serves customers in commercial vehicle, green energy, construction machinery, agricultural machinery, and other industrial equipment industries. The company was founded in 2015 and is based in Grand Cayman, the Cayman Islands.","OBIC Co.,Ltd., together with its subsidiaries, provides system integration, system support, office automation, and package software services. It offers system integration services, including developing ERP software products to provide integrated administrative systems comprising personnel, payroll, working condition management, marketing, and production systems, as well as related training courses. The company also provides system support services, including system operation support and maintenance, and hardware maintenance. In addition, it offers office automation services, such as sale of package software, and peripheral equipment and supplies, as well as processing of printed materials. The company was incorporated in 1968 and is headquartered in Tokyo, Japan.","Future Corporation provides IT consulting and services primarily in Japan. The company offers its services in digital marketing, IT education, e-commerce, and various other fields. The company was formerly known as Future Architect, Inc. and changed its name to Future Corporation in April 2016. Future Corporation was founded in 1989 and is headquartered in Tokyo, Japan.","ITFOR Inc. provides support services for the implementation of information technology in Japan. It develops solutions comprising consulting, system configuration, customer specific solution development, operation, and management for network security. The company also offers financial solution systems, such as credit collection, loan assessment management, scoring, collecting, tele-marketing, and local governments systems; CTI systems that offer call-center productivity enhancements; consultation and installation of open platform for retail service customers; and e-commerce systems. In addition, it provides network systems, including corporate infrastructure network, backbone network consultation and design, IP services, edge solutions for telecom carriers, network security solutions, and personal information management; and professional and consultation services, as well as customer services. The company was formerly known as CJK Co. Ltd. and changed its name to ITFOR Inc. in 2000. ITFOR Inc. was founded in 1972 and is headquartered in Tokyo, Japan.","TISCO Financial Group Public Company Limited, together with its subsidiaries, provides commercial banking products and services for individuals and businesses in Thailand. It operates through Commercial Banking Business, Securities Business, and Asset Management Business segments. The company accepts deposit products, such as current accounts, savings accounts, fixed deposit accounts, and certificates of deposit, as well as cards and bill payment services. It also provides personal loans, such as home loan, new and used car loans, and loans against inheritance pension; and corporate loans, including project and long-term loans, short term loans, and guarantee products. In addition, the company offers investment services, including stock and derivative brokerage, mutual funds, private funds, and provident funds, as well as super savings fund /retirement mutual funds; and insurance services, such as life, health and critical illness, personal accident, car, and home insurance. Further, it provides investment banking services that financial advisory and underwriting for merger and acquisition, privatization advisory and implementation, project financing, debt restructuring, feasibility study, project valuation, general advisory, etc.; and private banking, and wealth and asset management services. Additionally, the company offers mobile banking, custodian, assets for sale, car auction, hire purchase, and SME lending services. As of December 31, 2021, it operated through a network of 356 branches under the Somwang brand. TISCO Financial Group Public Company Limited was founded in 1969 and is based in Bangkok, Thailand.","TISCO Financial Group Public Company Limited, together with its subsidiaries, provides commercial banking products and services for individuals and businesses in Thailand. It operates through Commercial Banking Business, Securities Business, and Asset Management Business segments. The company accepts deposit products, such as current accounts, savings accounts, fixed deposit accounts, and certificates of deposit, as well as cards and bill payment services. It also provides personal loans, such as home loan, new and used car loans, and loans against inheritance pension; and corporate loans, including project and long-term loans, short term loans, and guarantee products. In addition, the company offers investment services, including stock and derivative brokerage, mutual funds, private funds, and provident funds, as well as super savings fund /retirement mutual funds; and insurance services, such as life, health and critical illness, personal accident, car, and home insurance. Further, it provides investment banking services that financial advisory and underwriting for merger and acquisition, privatization advisory and implementation, project financing, debt restructuring, feasibility study, project valuation, general advisory, etc.; and private banking, and wealth and asset management services. Additionally, the company offers mobile banking, custodian, assets for sale, car auction, hire purchase, and SME lending services. As of December 31, 2021, it operated through a network of 356 branches under the Somwang brand. TISCO Financial Group Public Company Limited was founded in 1969 and is based in Bangkok, Thailand.","Kobayashi Pharmaceutical Co., Ltd., together with its subsidiaries, manufactures and sells consumer products in Japan and internationally. The company provides products in the areas of healthcare, skincare, body warmer, and household. It also offers Ammeltz, a topical analgesic; Inochi no Haha, a women's health medicine; Shirt Coola, a summer cooling spray for cloths; Sarasaty lingerie soap; Bluelet Decoral, a toilet bowl cleaner and freshener; Nightmin Nasal Respiration Tape; Naishitol, a Chinese medicine; Eaude Muge, a medicated lotion for preventing acne; Itoyoji, a dental floss pick; BreathCare, an oral breath freshener capsule; Eybon, an eye wash; Netsusama sheet, a cooling gel sheet for forehead; and Sawaday, a toilet air freshener. Additionally, the company manufactures and sells pharmaceuticals, quasi-drugs, cosmetics, hygiene and paper products, health foods, and processed synthetic resin products; markets nutritional supplements and skin care products through sales promotional campaigns, such as advertising and direct mail; and sells skincare products, health foods, and other items through e-commerce channels. Further, it engages in transportation, real estate management, and advertising planning and production businesses. Kobayashi Pharmaceutical Co., Ltd. was founded in 1886 and is headquartered in Osaka, Japan.","Earth Corporation engages in the manufacture, marketing, import, and export of pharmaceutical products, quasi-drug products, medical tools, and household products in Japan and internationally. It operates through Household Products Business and General Environment and Sanitation Business segments. The company offers insecticides and repellents; gardening supplies; household products, such as mouthwash, denture-related supplies, toothpaste and related products, bath salts, deodorizing air fresheners, etc.; pet products; and chemical agents for communicable disease control, agriculture, forestry, and animal husbandry; and raw materials. In addition, it provides hygiene management services. The company markets its products under the various brands, including Earth Red, Earth No-mat, Earth Jet, ZEROdeKNIGHT, Earth Mosquito Coil, Earth Mushi Yoke Net EX, Ari no Su Korori, Goki Push Pro, Gokiburi Hoi-Hoi, Goki Jet Pro, Kobae ga Hoi Hoi, Saratect, Dani Earth, Naturas, Vapona, Mamo room, Black Cap, White Cap, Mushi Konai Earth, Mushi Korori Ground, natuvo, Mondahmin, Bath Roman, Onpo, Onso, Yu Meguri, Pirepara Earth, Ulmore, Sukki-ri!, Earth Garden, Polident, Poligrip, Aquafresh, N.act, Sensodyne, Kamutect, Biotene, Tachiiri Kinshi, Ouchi no Kusa Korori, Oniwa no Mushi Korori, Weed Killer, Mihariban, Aller Block, Helper Tasuke, Raku Hapi, Sebon, and Cleverin. Earth Corporation was founded in 1892 and is headquartered in Tokyo, Japan.","Sanyo Special Steel Co., Ltd., together with its subsidiaries, manufactures and sells special steel products in Japan and internationally. The company operates through Specialty Steel, Metal Powder, Formed and Fabricated Materials, and Others segments. The Specialty Steel segment provides various special steel products, including bearing, engineering, stainless, heat resistant, and tool steel products. The Metal Powder segment manufactures and sells metal powders and powder metallurgy products. The Formed and Fabricated Materials segment offers cut rings, die-forged/rolled, forged rings, and cold-rolled ring products made from special steel bars and tubes. The Other segment provides information processing services. The company also engages in the trading of special steel products, steelmaking raw materials, and other materials; and the provision of security and facilities maintenance services, and machinery maintenance services. Its steel products are used in a range of automobiles, railroads, construction machines, electronics products, and information communication devices. The company was formerly known as Sanyo Steel Works and changed its name to Sanyo Special Steel Co., Ltd. in 1959. The company was founded in 1933 and is headquartered in Himeji, Japan. Sanyo Special Steel Co., Ltd. is a subsidiary of Nippon Steel Corporation.","Sweeten Real Estate Development Co.,Ltd. constructs, develops, leases, and sells residential, commercial, and industrial projects. It is also involved in the development, rental, and sale of office building, specific professional zones, and urban renewal; trading of construction materials; rental of hotel; and civil construction and land development activities. The company was incorporated in 1987 and is based in Taichung, Taiwan.","Zoom Video Communications, Inc. provides unified communications platform in the Americas, the Asia Pacific, Europe, the Middle East, and Africa. The company offers Zoom Meetings that offers HD video, voice, chat, and content sharing through mobile devices, desktops, laptops, telephones, and conference room systems; Zoom Phone, an enterprise cloud phone system; and Zoom Chat enables users to share messages, images, audio files, and content in desktop, laptop, tablet, and mobile devices. It also provides Zoom Rooms, a software-based conference room system; Zoom Hardware-as-a-Service allows users to access video communication technology from third party equipment; Zoom Conference Room Connector, a gateway for SIP/H.323 endpoints to join Zoom meetings; Zoom Events, which enables users to manage and host internal and external virtual events; OnZoom, a prosumer-focused virtual event platform and marketplace for Zoom users to create, host, and monetize online events; and Zoom Webinars to provide video presentations to large audiences from many devices. In addition, the company offers Zoom Developer Platform that enables developers, platform integrators, service providers, and customers to build apps and integrations using Zoom's video-based communications solutions, as well as integrate Zoom's technology into their products and services; Zoom App Marketplace, which helps developers to publish their apps, as well as third-party integrations of Zoom; and Zoom Contact Center, an omnichannel contact center solution. It serves individuals; and education, entertainment/media, enterprise infrastructure, finance, government, healthcare, manufacturing, non-profit/not for profit and social impact, retail/consumer products, and software/Internet industries. The company was formerly known as Zoom Communications, Inc. and changed its name to Zoom Video Communications, Inc. in May 2012. The company was incorporated in 2011 and is headquartered in San Jose, California.","Waffer Technology Corporation engages in the manufacture and sale of light metal products. The company is involved in the provision of light-metal solution of magnesium and aluminum alloy, mold and tooling research and development, magnesium alloy injection and die-casting, CNC, and painting and assembly of vertical integration OEM/ODM processing services. Its products include cosmetic and internal parts for notebooks; handheld scanners and mobile phone parts; camera, video cam, projector, and monitoring optical parts; and auto parts, as well as other products, such as wearable, tool, and sports products. The company also manufactures and processes automotive aluminum alloy die-cast tools, 3C product magnesium injection tools, and other light metal die-casting tools, as well as fixtures and gauges. It serves medical, industrial, telecommunications, construction, automotive, sporting goods, aeronautical, transportation, national defense, and other industries. The company was formerly known as Waffer Industrial Company, Limited and changed its name to Waffer Technology Corporation in 2000. Waffer Technology Corporation was founded in 1950 and is headquartered in Taoyuan City, Taiwan.","Lanner Electronics Inc. provides design, engineering, and manufacturing services for advanced network appliances and rugged applied computing platforms for system integrators, service providers, and application developers worldwide. The company offers network appliances, such as modules and acceleration cards, industrial security appliances, wide temperature network appliances, desktop network appliances, and rackmount network appliances, as well as Wi-Fi access points; and telecom datacenter appliances consisting of cloud storage, HybridTCA, vCPE/uCPE, and video transport platforms, as well as modules and blades, hyper-converged appliances, and open RAN platforms. It also provides intelligent edge appliances, including DIN-Rail industrial gateway, embedded platform, intelligent video platform, rackmount industrial computer, rugged wireless gateway, vehicle gateway, and vehicle/rail computer; edge AI appliances, such as deep learning accelerators, inference server, and appliances, as well as AI starter kits; and extension modules comprising POE NIC, 100G+ NIC, 10/25/40G NIC, Radio, storage NIC, acceleration, and 1G NIC modules, as well as industrial GbE PCIe cards. The company offers its products for use in various applications, such as network computing, telecommunication, transportation, power and energy, industrial automation, intelligent systems, and software-defined wide area network. Lanner Electronics Inc. was founded in 1986 and is headquartered in New Taipei City, Taiwan.","SAMCO Inc. manufactures and sells operates as a semiconductor and materials company. The company primarily offers thin film deposition, microfabrication, cleaning, and surface treatment products. Its deposition systems include anode and cathode PECVD systems, atomic layer deposition systems, and silicon carbide (SiC) chemical vapor deposition systems; and etching systems comprise reactive ion etching systems, inductively coupled plasma (ICP) etch systems for general purpose, ICP etch systems for SiC etching, ICP etch systems for batch processing, silicon deep reactive ion etching systems, and XeF2 etch systems for MEMS release. The company also provides cleaning systems consisting of plasma cleaners, remote source plasma cleaners, and UV-ozone cleaners; and basic plasma research kits. It serves MEMS, laser diode, high brightness LED, TSV, SAW device, and RF device markets. The company was formerly known as SAMCO International, Inc. and changed its name to SAMCO Inc. in December 2004. SAMCO Inc. was founded in 1979 and is headquartered in Kyoto, Japan.","Hycon Technology Corporation designs, produces, and sells mixed signal microcontroller units, and battery management and touch panel ICs in Taiwan and China. The company offers battery management ICs, such as single cell and multi-cell, and secondary protectors, as well as balance ICs and gas gauges; mixed signal microcontroller units, including microcontroller units, data converters, digital multi-function meters, AC impedance measurement, sensor signal conditioners, low-dropout voltage regulators, LCD controllers and drivers, and application specific standard parts; and capacitive touch ICs. Its products are used in no-switch electronic scale, blood pressure monitor, PIR detector, digital multi-meter, and touch panel applications. In addition, the company provides its products under the HYCON brand name. Hycon Technology Corporation was founded in 2007 and is headquartered in Taipei City, Taiwan.","Taiwan Optical Platform Co., Ltd. operates as a channel copyright distributor. It also engages in the provision of investment, shareholding, consultancy, and channel copyright agency services; production of TV shows; information maintenance Corporation manufactures and sells power products, welding machines, and industrial and clean transfer robots. The company operates through Power Products Business, Welding &amp; Mechatronics Business, Semiconductor and FPD Related Business, and Other segments. It offers transformers, power distribution equipment, distribution equipment for electric power companies, solar inverters, and others; and welding/cutting machines, such as CO2/MAG, TIG, MIG, DC/AC, plasma welding and cutting, submerged arc, and resistance welding machines, as well as welding and cutting torches, peripheral devices for welding, thermal spray machines, and welding accessories. The company also provides robots, teach pendants, sensors for robot welding, positioners and sliders, PC software, and welding power sources and welding peripherals for robots. In addition, it offers RF/MW generators and automatic matching units for plasma applications; clean transfer robots; and wireless power transfer systems. Further, the company manufactures electronic devices, luminaire stabilizers, calorifiers, switches, housing equipment, distribution and control panels, monitoring and control systems, etc.; control and telecommunications equipment, and RF generators; hot charge; fuses; ballasts for discharge lamps; and material handling equipment for semiconductor and flat panel manufacturing systems. Additionally, it is involved in the installation, repair, inspection, maintenance, and remodeling of welding machines, cutting machines, and industrial robots, as well as transformers and switchgear systems; manufacture, processing, and coating of transformer parts; dispatch of personnel; health, welfare, and pension work for employees; and metal processing and real estate leasing activities. The company was formerly known as Osaka Transformer Co., Ltd. and changed its name to DAIHEN Corporation in December 1985. DAIHEN Corporation was incorporated in 1919 and is headquartered in Osaka, Japan.","Ventec International Group Co., Ltd. designs, develops, manufactures, and sells copper clad laminates and prepreg bonding materials. The company's products include standard FR4, lead free assembly, halogen free products, tec-thermal/thermal management and insulated metal substrate, polyimide, tec-speed/signal integrity and high frequency products, flex/flex rigid products, plastic interleaver and release film consumables, drill entry and exit material, copper foils and ACF, and masslam and drill products, as well as products for special applications. Its products are used for the fabrication of various printed circuit board and associated applications. In addition, the company engages in the general investment and international trade business. Further, it operates in China, the United Kingdom, the United States, Germany, and Taiwan. Ventec International Group Co., Ltd. was founded in 2000 and is headquartered in Grand Cayman, the Cayman Islands.","Fujitsu Limited operates as an information and communication technology company in Japan and internationally. The company operates through three segments: Technology Solutions, Ubiquitous Solutions, and Device Solutions. The company offers multi cloud and hybrid IT services; assessment and consultative services; SAP landscape transformation services; new workplace; datacentre products comprising integrated systems, storage solutions, servers, network switches, and infrastructure management; workplace products including personal computers, workstations, thin clients, displays, and peripheral devices; consumption based IT services; installation and implementation services; and hardware, software, and infrastructure support services, as well as electronic devices, air conditioning products, and network solutions. It also provides cyber security solutions, including cyber security consulting, managed security servies, and security operation and advanced threat centers; internet of things, artificial intelligence platform and solutions; and software products comprising FUJITSU Software Infrastructure Manager and FUJITSU Software ServerView Suite. Further, the company offers electronic components, such as semiconductor packages and batteries. It serves automotive, manufacturing, retail, financial services, transport, telecommunications, healthcare, and energy and utilities industries; the public sectors; and services providers. Fujitsu Limited was founded in 1923 and is headquartered in Tokyo, Japan.","Panasonic Holdings Corporation, together with its subsidiaries, develops, manufactures, sells, and services various electrical and electronic products worldwide. It operates through Appliances, Life Solutions, Connected Solutions, Automotive, and Industrial Solutions segments. The Appliances segment offers air conditioners, refrigerators, washing machines, vacuum cleaners, microwave ovens, rice cookers, personal care products, TVs, digital cameras, video equipment, home audio equipment, fixed-phones, show cases, compressors, and fuel cells. The Life Solutions segment provides lighting fixtures, lamps, wiring devices, solar photovoltaic systems, spatial sterilizing/deodorizing equipment, interior and exterior furnishing materials, ventilation and air conditioning equipment, air purifiers, bicycles, and nursing care related products, as well as kitchen and bath products. The Connected Solutions segment offers aircraft in-flight entertainment systems and communications services, electronic component mounting machines, welding equipment, PCs and tablets, projectors, and professional AV systems, as well as solutions for various industries. The Automotive segment provides automotive-use infotainment systems, head-up displays, automotive audio systems, automotive switches, vehicle camera modules, advanced driver assistance systems, automotive mirrors, and cylindrical and prismatic lithium-ion batteries, as well as devices and systems for electric automobiles. The Industrial Solutions segment offers relays, switches, power supply products, industrial motors and sensors, capacitors, coils, resistors, electronic circuit board materials, semiconductors, and LCD panels, as well as small lithium\u0096ion, dry, and micro batteries. The company was formerly known as Panasonic Corporation. Panasonic Holdings Corporation was founded in 1918 and is headquartered in Kadoma, Japan.","Enplas Corporation engages in the engineering plastic, semiconductor peripherals, plastic optical businesses in Japan and internationally. It offers mechanical solutions, including gears and fluid control products; semiconductor solutions comprising general-purpose IC sockets; optical solutions, such as optical devices that include lens array for parallel communications and plastic barrels; LED solutions, including controlling LED lights; and life science products comprising microfluidic chips, endotoxin-free products, and other life science-related products. The company was founded in 1962 and is headquartered in Tokyo, Japan.","Hamamatsu Photonics K.K. manufactures and sells photomultiplier tubes, imaging devices, light sources, opto-semiconductors, and imaging and analyzing systems in Japan and internationally. The company operates through three segments: Electron Tube, Opto-Semiconductor, and Imaging and Measurement Instruments. The Electron Tube segment provides photomultiplier tubes, electron multipliers, microchannel plates, image intensifiers, X-ray products, and various light sources for use in medical, chemical analysis, measurement, industrial testing, and academic research applications. The Opto-Semiconductor segment offers silicon photodiodes, photo IC components, position sensitive and infrared detectors, image sensors for low-light-level imaging and X-ray imaging, mini-spectrometers, and light emitting devices for applications in medical imaging, high-energy physics, and scientific measurement. The Imaging and Measurement Instruments segment provides a range of cameras for scientific and industrial applications, as well as specialized instruments for use in the fields of pharmaceutical development, semiconductor manufacturing, X-ray nondestructive inspection, spectrophotometry, and optical communications. Hamamatsu Photonics K.K. is also involved in the semiconductor laser and hotel operation businesses. The company was formerly known as Hamamatsu TV Co., Ltd. Hamamatsu Photonics K.K. was founded in 1953 and is headquartered in Hamamatsu, Japan.","Mitsubishi Heavy Industries, Ltd. manufactures and sells heavy machinery worldwide. The company operates through Energy Systems; Plants &amp; Infrastructure Systems; Logistics, Thermal &amp; Drive Systems; and Aircraft, Defense &amp; Space segments. It offers thermal, renewable energy, nuclear, engine, nuclear power generation, and chemical power plants, lithium-ion battery products, and oil and gas production plants, as well as fuel cells; civil aircrafts and engines, aviation equipment, and maintenance, repair, and overhaul of aircrafts; and launch vehicles and services, rocket engines, reaction control systems, space stations, rocket launchers, rocket engine combustion test facilities, and electronic parts. The company also provides passenger and commercial ships, LNG and LPG carriers, special purpose vessels, and IT services and systems; marine machineries, boilers, turbines, engines, and structures; and intelligent transport systems products and solutions, such as electronic toll collection system, road user charging system, highway traffic management system, EV management system, and development system. In addition, it offers organic solvent exhaust gas treatment system, waste-to-energy system, sludge treatment system, air quality control system, and bio-treatment system; turbochargers, car air-conditioning and refrigeration systems, rubber and tire machinery, and testing equipment; forklift trucks; and printing, paper converting, and metals, and food &amp; packaging machinery, pumps, compressors &amp; mechanical turbines, hydraulic components. Further, the company provides gas holders, vibration control systems, water pipes, tunnel excavation machinery, and cybersecurity solutions for industrial control systems; special vehicles, naval ship &amp; maritime systems, defense aircrafts, helicopters, defense aeroengines, and guided weapon systems; and CO2 capture plants, as well as provides after-sales services. The company was founded in 1884 and is headquartered in Tokyo, Japan.","Topy Industries, Limited engages in the steel, automotive, industrial machinery components, power generation, and other businesses in Japan. The company provides section steel, such as H-section steel, channel steel, equal and unequal angle steel, unequal non-isopachous steel, flat steel, R-flat steel, bulb plate, ultra-thick wide flat, and deformed section steel products, including rims, super giant off-the-road rim wheels, track shoes, blades, forklift mast materials, segment components, HSST rails, and Z-steel products, as well as deformed bar steel products. It also offers steel wheels, aluminum wheels, and construction machinery wheels for passenger cars, trucks, buses, and small and large construction vehicles; and undercarriage components, such as tracks, rollers, cutting edges for motor graders, and city pads for hydraulic shovels, bulldozers, and other construction equipment, as well as parts. In addition, the company provides crawler robots and synthetic mica products. Topy Industries, Limited was founded in 1921 and is headquartered in Tokyo, Japan.","Suzuden Corporation engages in purchasing and selling products related to electrical and electronic components in Japan. It offers FA equipment, including RFID equipment, relay equipment, sensors, control equipment, etc.; information and communication equipment, such as CPUs, personal computers for industrial use, routers, network equipment, etc.; electronics and devices comprising connectors, switching power supplies, noise filters, etc.; and materials for electric facilities, including terminal blocks, cable accessories, boxes, etc. The company was founded in 1948 and is headquartered in Tokyo, Japan. Suzuden Corporation is a subsidiary of Yamato Corporation.","FP Corporation manufactures and markets polystyrene and compound resin disposable food containers in Japan. It offers general-purpose trays; and sashimi, sushi, prepared food, audible, and heat-resistant containers. The company also markets related packaging materials. It serves supermarkets, convenience stores, food manufacturers, and restaurants. The company was formerly known as Fukuyama Pearl Paper Manufacturing Corporation and changed its name to FP Corporation in January 1989. FP Corporation was incorporated in 1962 and is headquartered in Fukuyama, Japan.","Supreme Electronics Co., Ltd. engages in the import and export dealership of various electronic products and components in Taiwan, Hong Kong, China, the United States, and internationally. It offers electronic components, such as lithium-ion batteries, semiconductors, chips, flash memory, and DRAM; SYSTEM LSI products; mobile and display LED's; multilayer ceramic capacitors; polarizer; SiP and MCP products; high-precision analog and mixed-signal integrated circuits; USB3.0 host and device solutions; LCD products, including TN, STN, TFT-LCD, and 3D applications; DSC/DV, DVR/PVR, door phone cameras, rear car video recorders, and digital cameras; and timing controller ICs. The company also provides display interface products; audio IC and chip design solutions; automated digitization technology; and LED driver ICs. In addition, it is involved in the manufacturing of batteries; provision of biotechnology related products, and warehousing services; and manufacturing and trading of electronic products. Supreme Electronics Co., Ltd. was incorporated in 1987 and is headquartered in Taipei, Taiwan.","Formosa Advanced Technologies Co., Ltd. provides wafer probe, integrated circuit (IC) assembly and testing, module turnkey, and LED chip services in Taiwan. It provides IC package solutions for portable electronic products, cell phones, memory modules, PC cards, PDAs, disc drives, and telephone handsets; DIMM products for laptops; flash cards; and LED products comprising PLCC, EMC, and UV LED products. The company also offers assembly services; and testing services, including wafer probe, burn in, and final testing services for memory, and logical and mixed-signal semiconductors, as well as testing program verification, tester/hi-fix correlation, engineering lot support, production lot verification, and periodical report. In addition, it provides module services, such as customized products, and OEM and ODM services, as well as blank DRAM modules, including U-DIMM, SO-DIMM, R-DIMM, and FB-DIMM; and LED chip back-end services, such as grinding, dicing, probing, sorting, and PI services. The company was founded in 1990 and is headquartered in Douliou City, Taiwan.","TCI Co., Ltd., an original design manufacturer company, engages in the research, development, manufactures, and sales of functional health food, food supplements, and skin care products. It offers liquid and solid supplements; immunity products; functional probiotics; basic nutrition; detox slimming; body health; sports nutrition supplements product; laundry detergents; hand sanitizers; and functional snacks, which includes, jelly, bars, chocolates, and gummies. It also provides skin care products, such as facial, body sheet, eye, and lip masks; essences; sprays; creams; and gels, as well as turnkey services. TCI Co., Ltd. was incorporated in 1980 and is headquartered in Taipei, Taiwan..","Taliworks Corporation Berhad, an infrastructure company, engages in water treatment, supply, and distribution activities. It operates through Water, Construction, Tool Highway, Waste Management, Renewables, and Others segments. The company operates, manages, and maintains water treatment plants and water distribution systems; and supplies potable water to large parts of Selangor and Kuala Lumpur. It also owns and operates highway concession that comprises two toll plazas; and offers waste management, solid waste collection, and public cleansing services in the southern region of Peninsular Malaysia; and undertakes engineering and construction activities, such as site clearance, earthworks, construction of reinforced concrete structures, and pipe laying works. The company was formerly known as Carpets International Malaysia Berhad and changed its name to Taliworks Corporation Berhad in November 2000. Taliworks Corporation Berhad was incorporated in 1965 and is headquartered in Kuala Lumpur, Malaysia.","Premier Investment Corporation (PIC) is a J-REIT (real estate investment trust) that manages a portfolio comprised of office buildings and residential properties, investing primarily in the Tokyo Economic Bloc. PIC was the sixth J-REIT listed on the Tokyo Stock Exchange (securities code: 8956) in September 2002. Since then, PIC has steadily expanded its portfolio valued at over 200 billion yen on an acquisition price basis. PIC utilizes a hedged strategy that minimizes risk by combining the strengths of office buildings and residential properties against economic cycles, as well as employing a strategic focus on the Tokyo Economic Bloc and prudent management of debt and equity financing. This approach has enabled PIC to successfully achieve steady dividends at a high level over the past fiscal periods. PIC outsources management of its assets to Premier REIT Advisors, Co., Ltd. (PRA). Both PIC and PRA are committed to realizing stable operations over the medium to long term while working to improve the quality of the owned assets.","Seibu Holdings Inc. engages in the urban and regional transportation, hotel and leisure, real estate, construction, and other businesses in Japan. It operates through Urban Transportation and Regional, Hotel and Leisure, Real Estate, Construction, Hawaii Business, and Other Business segments. The company offers railway, bus, and transportation services; operates hotels, golf courses, ski resorts, and leisure facilities; develops Seibu Railway lines and hotel sites in city centers; leases office and residential facilities; and develops and operates stores in train stations, shopping malls, and other commercial facilities. It is also involved in the construction of railway lines, social infrastructure, hotel remodeling, private sector construction, and housing. In addition, the company produces, processes, and sells gravel, sand, and other raw materials used in civil engineering and construction projects; designs and executes landscaping projects; and maintains and operates state-run parks. Further, the company operates express ways and cruise ships; and maintains a professional baseball team. Additionally, the company offers housekeeping, child-rearing support, home, and urban development services; and insurance and pet care products, as well as builds cemeteries. Seibu Holdings Inc. was incorporated in 2006 and is headquartered in Tokyo, Japan.","Trancom Co., Ltd. provides various logistics services in Japan and internationally. It offers logistics center construction and operation services; transport matching and delivery services; and production contract and temporary staffing services. The company also provides personal delivery services; paid employment placement services; consulting services; automobile maintenance services; and freight and truck transportation services. In addition, it sells new and used cars; operates insurance agency business; and designs and develops software. The company was founded in 1955 and is headquartered in Nagoya, Japan.","Yamato Holdings Co., Ltd. provides delivery, logistics, home convenience, e-business, financial, auto works, and other related services in Japan, North America, and internationally. The company's Delivery segment offers small parcel delivery services, such as door-to-door parcel delivery and posting services. Its BIZ-Logistics segment provides intercompany logistics services to B2B supply-chain management market. The company's Home Convenience segment offers lifestyle support services, including moving and household effects delivery services. Its e-Business segment provides information services comprising ASP services and information systems development for business markets. The company's Financial segment offers settlement and collection services to customers and business customers. Its Autoworks segment provides vehicle maintenance and fuel supply services for transport companies. The company was founded in 1919 and is headquartered in Tokyo, Japan.","Japan Airlines Co., Ltd., together with its subsidiaries, provides scheduled and non-scheduled air transport services in Japan and internationally. The company operates through Air Transportation and Other segments. It offers domestic and international passenger, ground handling, and cargo air transport services. The company is also involved in the aerial work and other related business; and sale of package tours. As of March 31, 2021, it operated a fleet of 218 aircraft. The company was formerly known as Japan Airlines International Co., Ltd. and changed its name to Japan Airlines Co., Ltd. in April 2011. The company was founded in 1951 and is headquartered in Tokyo, Japan.","Nippon Television Holdings, Inc. operates as a media and content company in Japan. The company engages in the production of broadcasting programs; digital broadcasting; technical production related to studios, live broadcasting, master technology, EJ news gathering, editing, postproduction, etc.; and programming, content production, closed captioning, library, etc. It is also involved in sporting and various NTV events; the management of NTV school; art design, and lighting and sound effects; design of sets, flip charts, and TV graphics; production of pamphlets, posters, etc.; intellectual property management; management of music publishing, CD master, and merchandising rights; production CDs and DVDs; rental of recording studios; and operation of fitness clubs, insurance agencies, and museums. In addition, the company engages in the production and construction of exhibitions, sales promotion events, international sports events, theme parks, amusement facilities, national ceremonies, etc.; production of program-related merchandise goods; commercial building maintenance; race track, concerts, and events management; ICT, development of apps for business, web development, video streaming, infrastructure solutions, and advertising; shopping portal sites management; production of animation, TV programs, commercial films, graphic designs, illustrations, characters, social games, and other content; copyright management; and internet content streaming. Further, it engages in the provision of software and systems for VOD and live streaming platforms and players; news gathering, reporting, and production of information, sports programs, etc.; 3D computer graphics; services to program and technology production, clerical, and management duties; e-commerce, esports, and talent production agency businesses; contractual production of programs for broadcasters; and influencers network and production business. The company was incorporated in 1952 and is based in Tokyo, Japan.","RENOVA, Inc. operates in the renewable energy industry in Japan. It operates through Renewable Energy Power Generation Business and Renewable Energy Development and Operation Business segments. The Renewable Energy Power Generation Business segment generates and sells electricity from renewable energy power plants. The Renewable Energy Development and Operation Business segment develops and assists in the operation of renewable energy power plants. The company generates electricity through solar, biomass, wind, geothermal and hydro power plants. RENOVA, Inc. was incorporated in 2000 and is based in Tokyo, Japan.","Funai Soken Holdings Incorporated provides consulting services to manufacturing and retail businesses in Japan. The company offers logistics services, including consulting, trading, and transportation; and management consulting services for various sectors, such as housing and real estate, medical, nursing care, welfare, automotive, food and distribution, retail, and direct sales, as well as certified professional, amusement, community care, and specialist services. It also provides support services, including systems design and analysis, program creation, and systems operation and management; and training and diagnostics services. The company was formerly known as Funai Consulting Incorporated and changed its name to Funai Soken Holdings Incorporated in July 2014. Funai Soken Holdings Incorporated was incorporated in 1970 and is headquartered in Osaka, Japan.","The Great Taipei Gas Corporation supplies natural gas in Taiwan. It also manufactures and supplies gas and related equipment; sells gas appliances; and leases long-distance land cable circuits and office buildings. The company's business area covers seven districts, including Songshan, Xinyi, Daan, Wanhua, Zhongzheng, Datong, and Zhongshan, as well as two counties comprising Fuhua and Ming Sheng in the Shilin district. It serves approximately 380,000 customers. The company was founded in 1964 and is headquartered in Taipei, Taiwan.","Ascendas Real Estate Investment Trust (Ascendas Reit) is Singapore's first and largest listed business space and industrial real estate investment trust. It was listed on the Singapore Exchange Securities Trading Limited (SGX-ST) in November 2002. As at 31 December 2020, Ascendas Reit's investment properties under management stood at S$13.7 billion. The portfolio comprises 200 properties across the developed markets of Singapore, Australia, the United Kingdom and the United States. Ascendas Reit's portfolio includes business and science parks, suburban office properties, high-specifications industrial properties, light industrial properties, logistics and distribution centres, and integrated developments, amenities and retail properties. These properties house a tenant base of more than 1,450 international and local companies from a wide range of industries and activities, including research and development, life sciences, information technology, engineering, light manufacturing, logistics service providers, electronics, telecommunications, manufacturing services and back-room office support in service industries. Major tenants include Singtel, Stripe, DSO National Laboratories, Pinterest, DBS, CareFusion, Wesfarmers, Citibank and JPMorgan. Ascendas Reit is listed in several indices. These include the FTSE Straits Times Index, the Morgan Stanley Capital International, Inc (MSCI) Index, the European Public Real Estate Association/National Association of Real Estate Investment Trusts (EPRA/NAREIT) Global Real Estate Index and Global Property Research (GPR) Asia 250. Ascendas Reit has an issuer rating of \u0091A3' by Moody's Investors Service. Ascendas Reit is managed by Ascendas Funds Management (S) Limited, a wholly owned subsidiary of Singapore-listed CapitaLand Limited, one of Asia's largest diversified real estate groups.","Asset Five Group Public Company Limited engages in the development and sale of real estate properties in Thailand. It sells land, houses, and units of residential condominium. The Company was founded in 2013 and is based in Bangkok, Thailand.","African Agriculture Holdings Inc., a food security company, engages in operating a commercial-scale alfalfa farm on the African continent. The company is based in New York, New York. African Agriculture Holdings Inc. operates as a subsidiary of Global Commodities &amp; Investments Ltd.","Aarti Drugs Limited, through its subsidiaries, engages in the manufacturing and marketing of active pharmaceutical ingredients (APIs), pharmaceutical intermediates, specialty chemicals, and formulations in India and internationally. The company provides APls in various therapeutic areas, including anti-inflammatory, cardioprotectants, antidiarrhoeals, antifungals, antiarthritis/osteoporosis, antibiotics, antidiabetics, Alzheimer's treatment, sedatives, vitamins, and alcoholism treatment; and pharmaceutical intermediate products comprising tinidazole, celecoxib, ciprofloxacin, clopidogrel, diclofenac, ketoconazole, nimesulide, and raloxifene. It also offers specialty chemical products, such as benzene sulphonyl chloride, benzene sulphonic acid, benzene sulphonic acid methyl ester, sodium benzene sulfinate, para toluene sulphonyl chloride, para toluene sulphonic acid methyl ester, N,N',N'-tris-(4-toluene sulfonyl)-diethylenetriamine, sodium para toluene sulfinate, para toluene sulphonyl hydrazide, di-phenyl sulphone, formamide, ammonium sulfate, and calcium fluoride, as well as benzene sulphonic acid sodium salt, benzyl nicotinate, methyl nicotinate, ethyl para toluene sulphonate, N-methyl methane sulfonamide, benzene sulphonamide, 2-phenoxy methane sulphanilide, para toluene sulfonamides, para chloro benzene sulphonamide, para chloro benzene sulphonyl chloride, ortho para toluene sulfonamides, ortho para toluene sulfonamides acid methyl ester, and N-methyl methane sulfonamides. In addition, the company's development products portfolio comprises Itraconazole and Fluconazole for antifungal applications; Dabigatran for use as an anticoagulant; Ticagrelor for cardiovascular diseases; Sitagliptin for use as an antidiabetics; and Alpha Lipoic Acid for application as an antioxidants. Further, it provides contract manufacturing services. Aarti Drugs Limited was incorporated in 1984 and is headquartered in Mumbai, India.","Arbor Realty Trust, Inc. invests in a diversified portfolio of structured finance assets in the multifamily, single-family rental, and commercial real estate markets in the United States. The company operates in two segments, Structured Business and Agency Business. It primarily invests in bridge and mezzanine loans, including junior participating interests in first mortgages, and preferred and direct equity, as well as real estate-related joint ventures, real estate-related notes, and various mortgage-related securities. The company offers bridge financing products to borrowers who seek short-term capital to be used in an acquisition of property; financing by making preferred equity investments in entities that directly or indirectly own real property; mezzanine financing in the form of loans that are subordinate to a conventional first mortgage loan and senior to the borrower's equity in a transaction; junior participation financing in the form of a junior participating interest in the senior debt; and financing products to borrowers who are looking to acquire conventional, workforce, and affordable single-family housing. Further, it underwrites, originates, sells, and services multifamily mortgage loans through conduit/commercial mortgage-backed securities programs. The company qualifies as a real estate investment trust for federal income tax purposes. It generally would not be subject to federal corporate income taxes if it distributes at least 90% of its taxable income to its stockholders. Arbor Realty Trust, Inc. was incorporated in 2003 and is headquartered in Uniondale, New York.","ACM Research, Inc., together with its subsidiaries, develops, manufactures, and sells single-wafer wet cleaning equipment for enhancing the manufacturing process and yield for integrated chips worldwide. It offers space alternated phase shift technology for flat and patterned wafer surfaces, which employs alternating phases of megasonic waves to deliver megasonic energy in a uniform manner on a microscopic level; timely energized bubble oscillation technology for patterned wafer surfaces at advanced process nodes, which provides cleaning for 2D and 3D patterned wafers; Tahoe technology for delivering cleaning performance using less sulfuric acid and hydrogen peroxide; and electro-chemical plating technology for advanced metal plating. The company markets and sells its products under the Ultra C brand name through direct sales force and third-party representatives. ACM Research, Inc. was incorporated in 1998 and is headquartered in Fremont, California.","Accenture plc, a professional services company, provides strategy and consulting, interactive, and technology and operations services worldwide. The company offers application services, including agile transformation, DevOps, application modernization, enterprise architecture, software and quality engineering, data management, intelligent automation comprises robotic process automation, natural language processing, and virtual agents, and liquid application management services, as well as program, project, and service management services; strategy consulting services; critical data elements, data management and governance, data platform and architecture, product-based organization and skills, business adoption, and value realization services; engineering, and research and development digitization; smart connected product design and development; product platform engineering and modernization; product as-a-service enablement; products related to production and operations; autonomous robotics systems; the digital transformation of capital projects; and digital industrial workforce solutions. It also provides data-enabled operating models; technology consulting and artificial intelligence services; services related to talent and organization/human potential; digital commerce; infrastructure services, such as hybrid cloud, network, digital workplace and collaboration, service and experience management, infrastructure as code, and managed edge and IoT devices; cyber defense, applied cybersecurity, managed security, OT security, security strategy and risk, and industry security products; services related to technology innovation; and intelligent automation services. In addition, the company offers cloud, ecosystem, marketing, supply chain management, zero-based budgeting, customer experience, finance consulting, mergers and acquisitions, and sustainability services. Accenture plc was founded in 1951 and is based in Dublin, Ireland.","AAPICO Hitech Public Company Limited engages in the manufacture and distribution of automobile parts, dies, and jigs in Thailand, China, Malaysia, and Portugal. It operates in three segments: Manufacture of Auto Parts; Sales of Automobiles and Provision of Automobiles Repair Service; and Others. The company offers stamped or pressed parts, including chassis frame components, housing axles parts, pressed and stamped body parts, door check link, and brake lines, fuel lines, engine, and brazing parts; forged and machined parts, such as transmission, power train, steering and suspension systems, engine, shafts, wheel hubs, and other parts, as well as connecting rods and copper forged parts; and plastic parts and plastic fuel tanks. It also provides roof ditch mouldings, belt line mouldings, door sash products, brazed steel tubing, door checks and hinges, and parking brake lever products; assembly jigs; and stamping dies. In addition, the company is involved in the sale of automobiles; provision of automobile repair, training, technical support, and information technology consulting and advisory services; venture capital business; investment in other companies; and import and export of vehicles and parts. Further, it manufactures 3D car navigation and digital map solutions under the POWERMAP brand with voice activation software, as well as Oracle ERP systems; and operates car dealership service centers. The company was founded in 1996 and is headquartered in Phra Nakhon Si Ayutthaya, Thailand.","Auckland International Airport Limited provides airport facilities, supporting infrastructure, and aeronautical services in Auckland, New Zealand. The company operates through three segments: Aeronautical, Retail, and Property. The Aeronautical segment provides services that facilitate the movement of aircraft, passengers, and cargo, as well as utility services, which support the airport; and leases space for facilities, such as terminals. The Retail segment offers services to the retailers within the terminals; and car parking facilities for passengers, visitors, and airport staff. The Property segment leases cargo buildings, hangars, and stand-alone investment properties. The company was founded in 1966 and is based in Manukau, New Zealand.","Advanced Info Service Public Company Limited, together its subsidiaries, provides mobile network, fixed broadband, and digital services primarily in Thailand. The company operates through three segments: Mobile Phone Services, Mobile Phone and Equipment Sales, and Datanet and Broadband Services. It is involved in the operation of cellular telephone networks in the frequency of 26 GHz, 700 MHz, 900 MHz, 1800 MHz, 2100 MHz, and 2600 MHz frequencies. The company also distributes handsets, as well as cash cards; and electronic money and electronic payment services. In addition, it provides international telephone service, broadcasting network, and television broadcasting services for various channels, as well as insurance brokerage services. Further, the company offers IT system, content aggregator, and billing and collection outsourcing services; call center services; and land and building rental services, as well as related facilities. Additionally, it provides internet data center, and internet and satellite uplink-downlink services for communications; distributes internet equipment; publishes telephone directories and advertising; offers mobile contents; and provides training and online advertising services. The company was founded in 1986 and is headquartered in Bangkok, Thailand.","AKITA Drilling Ltd. is an oil and gas drilling contractor in Canada and the United States. It provides contract drilling services to the oil and gas industry. The company is involved in the drilling of oil and gas wells; other forms of drilling related to potash mining; and development of storage caverns. It specializes in pad and other purpose-built drilling rigs; and conventional drilling services. As of December 31, 2021, the company had 14 wholly owned and operated drilling rigs in Canada; and 8 XDR 500 rigs and 3 XDR 850XE rigs in the United States. The company was founded in 1964 and is headquartered in Calgary, Canada.","Algoma Central Corporation owns and operates a fleet of dry and liquid bulk carriers on the Great Lakes - St. Lawrence Waterway in Canada. The company operates in six segments: Domestic Dry-Bulk, Product Tankers, Ocean Self-Unloaders, Global Short Sea Shipping, Investment Properties, and Corporate. It operates self-unloading bulk carriers; and owns and manages tankers for the transportation of liquid petroleum products throughout the Great Lakes, the St. Lawrence waterway, and the Atlantic Canada regions. The company also owns eight ocean-going self-unloading vessels that carry coal for power generation, crushed aggregates for construction, gypsum for wallboard manufacturing, iron ore for the steel industry, and salt for winter road safety. In addition, it provides management services to third parties, as well as owns a shopping center. It serves iron and steel, aggregate, cement and building material, and salt producers; agricultural product distributors; and oil refiners, wholesale distributors, and large consumers of petroleum products. The company was formerly known as Algoma Central Railway and changed its name to Algoma Central Corporation in 1990. Algoma Central Corporation was incorporated in 1899 and is headquartered in St. Catharines, Canada.","Alkane Resources Limited operates as a gold production company in Australia. It explores for gold, copper, nickel, zinc, and silver deposits. The company holds various interests in the Tomingley Gold project that consists of four gold deposits; and the Northern Molong Porphyry Project, which covers an area of 115 square kilometers located in the Central West of New South Wales. Its exploration projects comprise Boda and Kaiser, Cudal, Peak Hill, Elsienora, Rockley, Armstrongs, Trangie, and Mt Conqueror projects. The company also invests in junior gold mining companies and projects. Alkane Resources Limited was incorporated in 1969 and is headquartered in West Perth, Australia.","Acciona, S.A., together with its subsidiaries, engages in the energy, infrastructure, and other businesses in Spain and internationally. The company develops, constructs, operates, and maintains wind, solar photovoltaic, solar thermal, hydro, and biomass plants. It also engages in designing, construction, maintenance, and management of infrastructure projects, including bridges, highways, motorways, roads, tunnels, railway, and metros and trams, as well as ports and water channels, airports, freight forwarding, data centers, substations, and transmission lines. In addition, the company offers event planning and management services, as well as designs, constructs, and operates drinking water treatment plants, reverse osmosis desalination plants, wastewater treatment plants, and tertiary treatment plants for water reuse; and constructs, operates, and manages health infrastructure, and academic institutions and student residences. Further, it provides museum and art center solutions; urban services; and shared electric motorcycles, as well as undertakes real estate projects; and projects for the urban and social regeneration of spaces. Additionally, the company facility, airport handling, waste collection and treatment, logistics, rail, and other services. It also engages in the fund management, stock broking, wine production, and other businesses. Acciona, S.A. is headquartered in Alcobendas, Spain.","AP (Thailand) Public Company Limited, together with its subsidiaries, engages in the real estate development business in Thailand. It operates through Low\u0096Rise, High\u0096Rise, and Other segments. The Low-rise segment develops single-detached houses and townhouses. The High-rise segment develops condominiums. The Other segment provides after-sales, property brokerage, and construction services. This segment also offers education and training services. The company was formerly known as Asian Property Development Public Company Limited and changed its name to AP (Thailand) Public Company Limited in May 2013. AP (Thailand) Public Company Limited was founded in 1991 and is headquartered in Bangkok, Thailand.","AP (Thailand) Public Company Limited, together with its subsidiaries, engages in the real estate development business in Thailand. It operates through Low\u0096Rise, High\u0096Rise, and Other segments. The Low-rise segment develops single-detached houses and townhouses. The High-rise segment develops condominiums. The Other segment provides after-sales, property brokerage, and construction services. This segment also offers education and training services. The company was formerly known as Asian Property Development Public Company Limited and changed its name to AP (Thailand) Public Company Limited in May 2013. AP (Thailand) Public Company Limited was founded in 1991 and is headquartered in Bangkok, Thailand.","Asian Paints Limited, together with its subsidiaries, engages in the manufacturing, selling, and distribution of paints, coatings, and products related to home decoration and bath fittings in Asia, the Middle East, Africa, and the South Pacific region. The company offers wall coverings; textures painting aids; waterproofing products; wall stickers; mechanized tools; adhesives; modular kitchens and wardrobes; bath fittings and sanitaryware; decorative lighting products; furniture, furnishings, and rugs; and unplasticized polyvinyl chloride windows and door systems, as well as personalized interior design, safe painting, and color consulting services. It also provides interior and exterior wall finishes, wood finishes, enamels, undercoats, thinners, and varnishers; and sanitizers and surface disinfectants. The company offers its products under the Asian Paints, Apco Coatings, Asian Paints Berger, Asian Paints Causeway, SCIB Paints, Taubmans, and Kadisco Asian Paints through a network of dealers and retail stores, as well as operates asianpaints.com, an online shop. Asian Paints Limited was founded in 1942 and is headquartered in Mumbai, India.","Asian Paints Limited, together with its subsidiaries, manufactures, sells, and distributes paints and coatings for decorative and industrial use in India and internationally. It operates in Paints and Home Improvement segments. The company offers decorative coatings for interior and exterior walls, metal finishes, and wood finishes; paints; wall coverings; textures painting aid; waterproofing; wall stickers; mechanised tools; adhesives; modular kitchens; wardrobes; bath fittings and sanitaryware; home d\u00e9cor products; sanitizers and surface disinfectants; furniture, furnishings; and lightings, as well as enamels and thinners. The company offers its products under the Asian Paints, Apco Coatings, Asian Paints Berger, Asian Paints Causeway, SCIB Paints, Taubmans, and Kadisco Asian Paints through a network of dealers and retail stores, as well as operates asianpaints.com, an online shop. Asian Paints Limited was founded in 1942 and is headquartered in Mumbai, India.","Asian Paints Limited, together with its subsidiaries, manufactures, sells, and distributes paints and coatings for decorative and industrial use in India and internationally. It operates in Paints and Home Improvement segments. The company offers decorative coatings for interior and exterior walls, metal finishes, and wood finishes; paints; wall coverings; textures painting aid; waterproofing; wall stickers; mechanised tools; adhesives; modular kitchens; wardrobes; bath fittings and sanitaryware; home d\u00e9cor products; sanitizers and surface disinfectants; furniture, furnishings; and lightings, as well as enamels and thinners. The company offers its products under the Asian Paints, Apco Coatings, Asian Paints Berger, Asian Paints Causeway, SCIB Paints, Taubmans, and Kadisco Asian Paints through a network of dealers and retail stores, as well as operates asianpaints.com, an online shop. Asian Paints Limited was founded in 1942 and is headquartered in Mumbai, India.","Alpha Astika Akinita S.A., together with its subsidiaries, provides various real estate services in Greece. It offers purchases/sales services, such as locating suitable real estate, evaluation of offers, negotiations, and action co-ordination for completing the purchase or sale; rents/lease services, such as locating leaseholds and lessees, evaluation of offers, rent-lease negotiations, and rent collection; and financial and technical studies, including real estate assessments, studies on exploiting real estate, and market research concerning rents and sales-purchases. The company also provides project management services consisting of the determination of the project's specifications, realization and supervision of studies, selection of the appropriate developers, drafting of contractual terms and conditions, project management during construction, and supervision and coordination of the project. In addition, it offers a range of consultative services for the public and private sector in the field of real estate; and supervision/management of real estate comprising rent collection, monitoring the observance of building regulations, the observance of contractual obligations, and real estate inspection services. The company also provides property management and development services for private owners, as well as offers technical consultant's advice. It provides its services to third-party customers consisting of corporations, private individuals, organizations, insurance funds, etc. Alpha Astika Akinita S.A. was founded in 1942 and is based in Athens, Greece. Alpha Astika Akinita S.A. operates as a subsidiary of Alpha Services and Holdings S.A.","Auction Technology Group plc operates marketplaces and a proprietary auction platform primarily in the United Kingdom, North America, and Germany. The company operates through four segments: Arts and Antiques, Industrial and Commercial, Auction Services, and Content. It offers watches, jewellery, furniture, fine art, decorative art, classic cars, collectables, and fashion products; used equipment, commercial vehicles, and machineries for used in laboratories and pharmaceuticals, warehousing, oil and gas, real estate, construction, agriculture, plastic moulding, metalworking, woodworking, and food and beverage production industries; and electronics, apparel, homeware, and furniture products. The company also operates marketplaces, such as Proxibid.com, BidSpotter.com, BidSpotter.co.uk, thesaleroom.com, lot-tissimo.com, liveauctioneers.com, and i-bidder.com. In addition, it offers Wavebid, a suite of products designed for auction house management; Auction Mobility, which provides digital auction technology for auctioneers, such as customized auction software, website design, and e-commerce solutions; Global Auction Platform, a digital marketplace for real-time audio and video broadcast; and Antiques Trade Gazette, a weekly industry trade magazine and guide to arts and antiques. It serves curated online marketplace, connecting bidders, and auctioneers to arts and antiques, industrial and commercial, and consumer surplus and returns industries. The company was founded in 1971 and is headquartered in London, the United Kingdom.","ATMA Participa\u00e7\u00f5es S.A., through its subsidiaries, provides contact center and trade marketing services. It offers industrial maintenance and facilities services; and information technology services. The company was formerly known as Liq Participa\u00e7\u00f5es S.A. and changed its name to ATMA Participa\u00e7\u00f5es S.A. in March 2020. ATMA Participa\u00e7\u00f5es S.A. was founded in 2000 and is based in S\u00e3o Paulo, Brazil.","AU Small Finance Bank Limited provides various banking and financial services in India. The company operates through Treasury, Retail Banking, Wholesale Banking, and Other Banking Operations segments. It provides saving, current, salary, fixed, recurring, and COVID shield deposit accounts, as well as debit and credit cards and locker services. In addition, the company offers car, two-wheeler, commercial vehicle, personal, tractor, home, gold, construction equipment, business, agriculture, and working capital loans. Further, it provides life, health, general, and motor insurance; mutual funds and national pension system; overdraft, cash credit, bank guarantee, and letters of credit; and internet and mobile banking, collection and receivables, and payment and other merchant payment services. Additionally, the company provides government banking services to central government, state governments, central and state public sector undertakings, boards, defense, urban local bodies, and other government departments. It operates bank branches, correspondents banking outlets, business correspondents, and ATMs. The company was formerly known as AU Financiers (India) Limited and changed its name to AU Small Finance Bank Limited in May 2017. AU Small Finance Bank Limited was incorporated in 1996 and is headquartered in Jaipur, India.","Aspira Women's Health Inc., together with its subsidiaries, engages in developing and commercializing diagnostic tests for gynecologic disease in the United States. The company provides OVA1, OVERA, and OVA1plus to detect risk of ovarian malignancy in women with adnexal masses. It also offers ASPiRA GenetiX, a genetic test for the risk of gynecologic cancer. In addition, the company operates Aspira Synergy, a testing platform and cloud service for decentralized access of protein biomarker and hereditary genetic testing; and owns and operates ASPiRA LABS, a lab that specializes in applying biomarker-based technologies to address critical needs in the management of gynecologic cancers and disease. Further, its pipeline products include OVAWatch, EndoCheck, and OVAInherit. The company serves physicians, physician office laboratories, and national and regional laboratories. It has a collaborative research agreement with Baylor Genetics; an agreement with Harvard Dana-Farber Cancer Institute, Brigham and Women's Hospital, and Medical University Lodz to evaluate the microRNA technology in combination with Aspira technologies for the development of an early detection test for ovarian cancer; and a strategic alliance with Quest Diagnostics, Incorporated. The company was formerly known as Vermillion, Inc. and changed its name to Aspira Women's Health Inc. in June 2020. Aspira Women's Health Inc. was incorporated in 1993 and is headquartered in Austin, Texas.","Baidu, Inc. offers internet search services in China. It operates through Baidu Core and iQIYI segments. The company offers Baidu App to access search, feed, and other services using mobile devices; Baidu Search to access its search and other services; Baidu Feed that provides users with personalized timeline based on their demographics and interests; and Haokan, a short video app. It also provides Baidu Knows, an online community where users can ask questions to other users; Baidu Wiki; Baidu Healthcare Wiki; Baidu Wenku; Baidu Scholar; Baidu Experience; Baidu Post; Baidu Maps, a voice-enabled mobile app that provides travel-related services; Baidu Drive; Baijiahao; and DuerOS, a smart assistant platform. In addition, it offers online marketing services, which include pay for performance, an auction-based services that allow customers to bid for priority placement of paid sponsored links and reach users who search for information related to their products or services; other marketing services that include display-based marketing services and other online marketing services based on performance criteria other than cost per click; mobile ecosystem, a portfolio of apps, including Baidu App, Haokan, and Baidu Post; various cloud services and solutions, such as platform as a service, software as a service, and infrastructure as a service; self-driving services, including maps, automated valet parking, autonomous navigation pilot, electric vehicles, and robotaxi fleets, as well as Xiaodu smart devices. Further, the company provides iQIYI, AN online entertainment service, including original and licensed content; other video content and membership; and online advertising services. Baidu, Inc. has strategic partnership with Zhejiang Geely Holding Group. The company was formerly known as Baidu.com, Inc. Baidu, Inc. was incorporated in 2000 and is headquartered in Beijing, China.","Bangkok Bank Public Company Limited provides various commercial banking products and services in Thailand and internationally. The company operates through Domestic Banking, International Banking, Investment Banking, and Others segments. It offers various personal banking products and services, including savings, current, fixed deposit, foreign currency, and other accounts; home and personal loans, as well as loans for pensioners; mutual funds; investments products and services, such as bonds and debentures, as well as agency services; life and non-life bancassurance products; payment, funds transfer, currency exchange and foreign instrument, and SMS services; debit, credit, and prepaid cards; and phone and Internet banking, mobile banking, ATMs, and other services. The company also provides business banking products and services comprising operating accounts; loans for SMEs, international trade, investment banking, and e-guarantee services; securities services, such as custodian, mutual fund supervisor, provident fund registrar, securities registrar, and debenture holders' representative services; personal loans for small businesses; payment, collection, and merchant services; digital banking services; and commercial cards. In addition, it offers trade finance, remittances, export and import, project, corporate finance, and financial advisory services, as well as liquidity, fund, and asset management services. Bangkok Bank Public Company Limited was founded in 1944 and is headquartered in Bangkok, Thailand.","BCB Bancorp, Inc. operates as a bank holding company for BCB Community Bank that provides banking products and services to businesses and individuals in the United States. The company offers deposit products, including savings and club accounts, interest and non-interest-bearing demand accounts, money market accounts, certificates of deposit, and individual retirement accounts. It also provides loans, such as commercial and multi-family real estate, one-to-four family mortgage, commercial business, small business administration, construction, home equity and lines of credit, and consumer loans, as well as residential loans secured by one-to-four family dwellings, condominiums, and cooperative units. In addition, the company offers retail and commercial banking services comprising wire transfers, money orders, safe deposit boxes, night depository services, debit cards, online and mobile banking services, fraud detection services, and automated teller services. As of December 31, 2021, it operated 29 branch offices in Bayonne, Carteret, Edison, Hoboken, Fairfield, Holmdel, Jersey City, Lyndhurst, Maplewood, Monroe Township, Newark, Parsippany, Plainsboro, River Edge, Rutherford, South Orange, Union, and Woodbridge, New Jersey, as well as three branches in Staten Island and Hicksville, New York. The company was founded in 2000 and is headquartered in Bayonne, New Jersey.","Briscoe Group Limited, together with its subsidiaries, retails homeware and sporting goods in New Zealand. The company operates in two segments, Homeware and Sporting Goods. It operates 46 stores under the Briscoes Homeware brand; 40 stores under the Rebel Sport brand; and 1 store under the Living &amp; Giving brand, as well as sells its products online. The company was founded in 1781 and is headquartered in Auckland, New Zealand. Briscoe Group Limited is a subsidiary of JB Were (NZ) Nominees Limited.","SIIC Environment Holdings Ltd., an investment holding company, engages in the wastewater treatment, water supply, sludge treatment, solid waste incineration, and other environment related businesses primarily in the People's Republic of China. It operates through three segments: Water and Sludge Treatment; Water Supply; and Waste Incineration. The Water and Sludge Treatment segment constructs, manages, and operates water and sludge related infrastructure under service concession arrangements; and manages and operates water and sludge related infrastructure under non-service concession arrangements, as well as provides financial income under service concession arrangements. The Water Supply segment engages in the construction, management, and operation of water supply related infrastructure under service concession arrangements. The Waste Incineration segment constructs, manages, and operates waste incineration related infrastructure under service concession arrangements. The company has a portfolio of approximately 250 water treatment and supply projects, 8 waste incineration projects, and 13 sludge treatment projects in 19 municipalities and provinces in China. It also provides management and consultancy services; treats and supplies potable water; and installs water meters. The company was formerly known as Asia Water Technology Ltd. and changed its name to SIIC Environment Holdings Ltd. in November 2012. SIIC Environment Holdings Ltd. was incorporated in 2002 and is headquartered in Singapore.","BHP Group Limited operates as a resources company in Australia, Europe, China, Japan, India, South Korea, the rest of Asia, North America, South America, and internationally. The company operates through Copper, Iron Ore, and Coal segments. It engages in the mining of copper, silver, zinc, molybdenum, uranium, gold, iron ore, and metallurgical and energy coal. The company is also involved in mining, smelting, and refining of nickel; and potash development activities. In addition, it provides towing, freight, marketing and trading, marketing support, finance, administrative, and other services. The company was founded in 1851 and is headquartered in Melbourne, Australia.","Bank of Ireland Group plc provides various banking and financial products and services. The company operates through Retail Ireland, Wealth and Insurance, Retail UK, and Corporate and Treasury segments. It provides current and savings accounts, and business deposits and accounts; personal, car, home improvement, graduate, and student loans, as well as overdrafts; and business and farming loans, BREXIT loans, invoice finance, hire purchase, and leasing services. The company also offers international payments and credit cards; protection overview, mortgage protection, life cover, specified illness cover, income protection, protection for individuals, and protection for families; pensions and investments, foreign exchange, and treasury deposits and services; personal products; private banking services; and leveraged acquisition and property finance. In addition, it provides home, car, travel, and life insurance products. Bank of Ireland Group plc was founded in 1783 and is headquartered in Dublin, Ireland.","Blau Farmac\u00eautica S.A., a pharmaceutical company provides private label drugs in Brazil, Argentina, Colombia, the United States, Ecuador, Peru, and Uruguay. The company's medications cover various therapeutic classes, such as immunology, hematology, oncology, nephrology, specialties, and antibiotics. It also offers biological drugs; oral and injectable drugs for treating cancer; specialized treatments for infectious diseases; and prescri
