ption and non-prescription drugs, including dermo-medicines, condoms, and others for retail and non-retail markets. In addition, the company provides blood-derived, biological, biotechnological, and antiretroviral drugs. It serves hospitals, private clinics, chemotherapy and hemodialysis centers, and public health institutions. The company was incorporated in 1987 and is headquartered in Cotia, Brazil.","Builders FirstSource, Inc., together with its subsidiaries, manufactures and supplies building materials, manufactured components, and construction services to professional homebuilders, sub-contractors, remodelers, and consumers in the United States. It offers lumber and lumber sheet goods comprising dimensional lumber, plywood, and oriented strand board products that are used in on-site house framing; manufactured products, such as wood floor and roof trusses, steel roof trusses, wall panels, stairs, and engineered wood products; and windows, and interior and exterior door units, as well as interior and exterior trims and custom products under the Synboard brand name. The company also offers gypsum, roofing, and insulation products, including wallboards, ceilings, joint treatments, and finishes; and siding, metal, and concrete products, such as vinyl, composite, and wood siding products, as well as exterior trims, other exteriors, metal studs, and cement products. In addition, it provides other building products and services, such as cabinets and hardware, as well as turn-key framing, shell construction, design assistance, and professional installation services. The company was formerly known as BSL Holdings, Inc. and changed its name to Builders FirstSource, Inc. in October 1999. Builders FirstSource, Inc. was founded in 1998 and is based in Dallas, Texas.","Blue Star Capital plc is a private equity and venture capital firm specializing in investments in seed, early stage, and late stage companies, including buy-outs. The firm provides funding for shell companies at the founder stage, upon IPO and operating businesses prior to IPO or alternative exit. It typically invests in new, disruptive technologies in the fast growing areas of esports, blockchain, and payments. The firm invests globally. The firm typically invests between \u00a3250,000 ($387,850) and \u00a32 million ($3.1 million) over the lifetime of an investment. The firm seeks to invest in quoted and unquoted companies. It invests between \u00a350,000 ($77,570) and \u00a30.5 million ($0.78 million) in the initial round and similar amounts are invested in subsequent funding rounds. The firm may take either a minority or a majority stake in its portfolio companies. In the latter case, the firm seeks to take a strategic control of investee businesses. It seeks to invest in companies with a positive cash flow and recurring revenue streams. The firm prefers to exit its investments between three to four years. Blue Star Capital plc is based in Crawley, United Kingdom.","Byggma ASA manufactures and supplies building materials in Norway, Sweden, Denmark, Finland, the United Kingdom, the Netherlands, and internationally. It offers pre-painted ceilings and wall panels under the Huntonit brand name; I-beams for use in ceilings, walls, and floors in wood-based buildings under the brand name of Masonite; and particle boards, boards, and structural panels for use in buildings, interior ceilings, and wall panels under the Forestia brand name. The company also provides home lighting products under the Scan Lamps brand name; doors and windows for new buildings, extensions, and rehabilitation under the brand name of Uldal; a range of lamp and lighting products under the Aneta brand name; and develops, manufactures, and distributes MDF panels for walls, ceilings, bathrooms, and kitchens under the brand name of Smartpanel, as well as supplies OSB plywood and building boards under the brand name of Byggform. It exports its products. Byggma ASA is headquartered in Vennesla, Norway. Byggma ASA operates as a subsidiary of Investor As.","Barnes &amp; Noble Education, Inc. operates bookstores for college and university campuses, and K-12 institutions in the United States. It operates through three segments: Retail, Wholesale, and Digital Student Solutions. The company sells and rents new and used print textbooks, digital textbooks, and publisher hosted digital courseware through physical and virtual bookstores, as well as directly to students through Textbooks.com. It also offers First Day and First Day Complete access programs; BNC OER+, a turnkey solution for colleges and universities, that offers digital content, such as videos, activities, and auto-graded practice assessments; and general merchandise, including collegiate and athletic apparel, school spirit products, lifestyle products, technology products, supplies, graduation products, and convenience items. In addition, the company sources, sells, and distributes new and used textbooks; and sells hardware and a software suite of applications that provides inventory management and point-of-sale solutions to approximately 350 college bookstores. Further, it offers direct-to-student subscription-based writing services; and bartleby, a direct-to-student subscription-based offering that includes textbook solutions, expert questions and answers, and writing and tutoring services. The company operates 805 physical college and university bookstores; 622 virtual bookstores; 8 True Spirit e-commerce websites; pop-up retail locations; 73 customized caf\u00e9s and 11 stand-alone convenience stores; and a media channel for brands targeting the college demographic. Barnes &amp; Noble Education, Inc. was founded in 1965 and is headquartered in Basking Ridge, New Jersey.","Bon Natural Life Limited, together with its subsidiaries, engages in the research and development, manufacture, and sale of functional active ingredients extracted from natural herb plants in the People's Republic of China and internationally. The company provides personal care ingredients, such as plant extracted fragrance compounds to perfume and fragrance manufacturers; natural health supplements comprising powder drinks and bioactive food ingredient products primarily used as food additives; and nutritional supplements. Its products are principally used by manufacturer customers in the functional food, personal care, cosmetic, and pharmaceutical industries. The company was founded in 2006 and is headquartered in Grand Cayman, the Cayman Islands.","bpost NV/SA, together with its subsidiaries, provides mail and parcel services to consumers, businesses, and government in Belgium, rest of Europe, the United States, and internationally. The company operates in three segments: Mail &amp; Retail; PaLo N. Am.; and PaLo Eurasia. Its mail and parcels services include collection, transport, sorting, and distribution of addressed and non-addressed mail, printed documents, newspapers, and parcels, as well as banking and financial products, e-commerce logistics, express delivery, proximity and convenience, document management, and related services. The company also offers transactional mails, advertising mails, press, domestic and international parcels, logistic solutions, and cross-border products, as well as value-added services. bpost NV/SA was incorporated in 1830 and is headquartered in Brussels, Belgium.","Buriram Sugar Public Company Limited, together with its subsidiaries, manufactures and distributes sugar and molasses in Thailand and internationally. It operates through Sugar and Molasses Business, Trading Agriculture Products, Electricity and Steam Generation and Distribution, and Others segments. The company offers refined, brown, white, cane, and raw sugar; bagasse; and filter cakes. It is also involved in trading of agricultural products; generation and distribution of electricity using biomass; and production and distribution of organic and organic chemical fertilizers using filter cakes, as well as provision of research and development services to improve the efficiency of sugarcane farming and nourishment. In addition, the company provides logistics services, which consists of land and water product transportation services, both domestic and international. Further, it is involved in the manufacture and distribution of packaging products, which are made from bagasse; and steam generation and distribution activities, as well as invests wood pellet business. The company was incorporated in 1963 and is headquartered in Buriram, Thailand. Buriram Sugar Public Company Limited operates as a subsidiary of Buriram Capital Co., Ltd.","Banco do Estado do Rio Grande do Sul S.A., a multiple-service bank, provides a range of banking products and services primarily in Brazil, Miami, and the Grand Cayman. It provides payroll deductible, payroll, consumer, overdraft, real estate, and rural loans, as well as debit and credit cards. The company also offers international and foreign exchange services; personal insurance products, property insurance, capitalization bonds, and supplementary pension plans; and financial agent services. It operates a network of 497 branches, 138 service stations, and 427 electronic stations. The company was incorporated in 1928 and is headquartered in Porto Alegre, Brazil.","Birlasoft Limited provides enterprise digital IT services in the Americas, Europe, the United Kingdom, and internationally. It offers digital transformation services, including data analytics, connected products, intelligent automation, cloud, customer experience, and blockchain services; and enterprise technologies and services in the areas of Oracle and JD Edwards, SAP, Infor, Microsoft, customer relationship management, manufacturing execution systems, product lifecycle management, supply chain management, IT transformation, applications management, testing, and infrastructure and cloud technology. The company also offers solutions, such as intelliOpen, an intelligent system for contactless screening of people, social distancing monitoring, and contact tracing; intelliAsset, a platform for asset visualization, analytics, and actions; TruView CLM, a cloud based contract lifecycle management solution; TruServ FSM, a cloud based touchless automation solution for field services; TruLens, a tool that provides insights into the existing Salesforce implementation; iLink, a solution for the integration of PLM applications and ERP systems; Supplier Risk Radar, an AI-powered preventive risk mitigation solution in the areas of supply chains; Akoya, an engineering analytics solution; and Submission Automation, an insurance broker submission solution. It serves banking, high tech, manufacturing, insurance, media and entertainment, energy and resources, life sciences and healthcare, and utility industries, as well as capital markets. The company was incorporated in 1990 and is based in Pune, India.","BTC Digital Ltd. engages in the cryptocurrency/bitcoin mining business. It also engages in mining machines resale and rental business. The company was formerly known as Meten Holding Group Ltd. and changed its name to BTC Digital Ltd. in August 2023. The company was founded in 2006 and is headquartered in Shenzhen, the People's Republic of China.","Jardine Cycle &amp; Carriage Limited, an investment holding company, engages in the automotive, financial services, heavy equipment, mining, construction and energy, agribusiness, infrastructure and logistics, information technology, and property businesses in Indonesia and internationally. The company produces, distributes, retails, and aftersales services of motor vehicles, as well as manufactures and distributes automotive components; manufactures, assembles, distributes, and owns dealership networks for Toyota, Daihatsu, Isuzu, Peugeot, and UD Trucks, as well as Honda motorcycles; and manufactures and retails BMW vehicles, and owns the Lexus cars dealership. It also offers financial services, such as financing for motorcycles, cars, heavy equipment, insurance protection for individual and commercial customers, lending products to retail consumers, and digital payment solutions. In addition, the company supplies heavy equipment and provides aftersales services for various sectors, including mining, plantation, construction, and forestry; distributes Komatsu, UD, SCANIA, Bomag, and Tadano heavy equipment; and owns and operates thermal and metallurgical coal, gold, and thermal power assets, as well as operates in the construction and renewable energy sectors. Further, it cultivates, harvests, and processes palm oil; develops and manages toll roads; provides printing and digital services solutions; and distributes FUJIFILM business products, as well as develops office and residential buildings. The company was formerly known as Cycle &amp; Carriage Ltd. and changed its name to Jardine Cycle &amp; Carriage Limited in 2004. The company was founded in 1899 and is based in Singapore. Jardine Cycle &amp; Carriage Limited is a subsidiary of Jardine Strategic Singapore Pte Ltd.","Cable One, Inc., together with its subsidiaries, provides data, video, and voice services in the United States. The company offers residential data services, a service to enhance Wi-Fi signal throughout the home. It also provides residential video services, such as local networks; local community programming that includes governmental and public access; and other channels, as well as digital video services, including national and regional cable networks, music channels, and an interactive and electronic programming guide with parental controls. In addition, the company offers premium channels that offer movies, original programming, live sporting events, and concerts and other features; and advanced video services, such as whole-home DVRs and high-definition set-top boxes, as well as TV Everywhere product, which enables its video customers to stream various channels and shows to mobile devices and computers. Further, it provides residential voice services comprising local and long-distance calling, voicemail, call waiting, three-way calling, caller ID, anonymous call rejection, and other features, as well as international calling by the minute services. Additionally, the company offers data, voice, and video products to business customers, including small to mid-markets, enterprises, and wholesale and carrier customers. As of December 31, 2021, it served approximately 1.2 million residential and business customers in 24 states through its Sparklight, Fidelity, and Clearwave brands. Cable One, Inc. was incorporated in 1980 and is headquartered in Phoenix, Arizona.","Cairo Mezz Plc holds and manages contributed bonds. The company was formerly known as Mairanus Ltd. and changed its name to Cairo Mezz Plc in September 2020. The company was founded in 2020 and is based in Nicosia, Cyprus.","CARE Ratings Limited, a credit rating agency, provides various rating and grading services in India, Mauritius, and Nepal. The company provides rating services for debt instruments, such as bonds, debentures, hybrid instruments, preference shares, fixed deposits, commercial papers and short-term debt programs, and certificate of deposits; and bank loan; financial sector rating services, which cover banks, non-banking finance companies, housing finance companies, financial institutions, etc.; structured finance ratings; insurance ratings; infrastructure sector ratings; and public finance rating services that cover ratings of state government entities and urban infrastructure projects, as well as corporate governance ratings, project finance, and MLD valuation services. It offers corporate advisory, project evaluation and monitoring, credit analytics, industry and company research, and due diligence and grading services, as well as research and analytics to corporates, financial institutions, banks, and institutional investors. It was formerly known as Credit Analysis and Research Limited and changed its name to CARE Ratings Limited in June 2017. CARE Ratings Limited was incorporated in 1993 and is headquartered in Mumbai, India.","Commercial International Bank (Egypt) S.A.E provides retail, corporate, and investment banking services in Egypt. The company operates in four segments: Corporate Banking, Investment, Retail Banking, and Others. It offers current and saving accounts, easy accounts, time deposits, and certificates of deposit; and personal/overdraft/mortgage, educational, solar, travel, car finance, and unsecured personal loans, as well as revolving overdraft salary upfront services. The company also offers global transaction and digital banking; and cash management services, as well as corporate banking services. In addition, it provides credit, debit, and prepaid cards, smart wallet, mobile, Internet, phone banking, and ATM services. Further, the company offers other credit facilities; derivative products; financial instruments trading, structured financing, corporate leasing, and merger and acquisitions advisory; and foreign currency services, as well as assets liabilities services. Additionally, the company provides structured financing, corporate leasing, merger, and acquisition services, as well as trades in financial instruments. Furthermore, the company offers investment savings products, consumer loans and mortgage services. It operates through 215 branches. The company was formerly known as Chase National Bank. Commercial International Bank (Egypt) S.A.E was founded in 1975 and is headquartered in Giza, Egypt.","Credit Corp Group Limited provides debt ledger purchase and collection, and consumer lending services in Australia and the United States. The company operates through three segments: Debt Ledger Purchasing \u0096 Australia and New Zealand; Debt Ledger Purchasing \u0096 United States; and Consumer Lending \u0096 Australia, New Zealand and the United States. The company offers debt sale, contingency and agency collection, local government debt recovery, and hardship and insolvency management services, as well as various loan products. It provides financial services under the Wallet Wizard, ClearCash, CarStart Finance, Resolvr, and Wizpay brands. The company was founded in 1992 and is headquartered in Sydney, Australia.","CDL Investments New Zealand Limited, together with its subsidiary, CDL Land New Zealand Limited engages in the investment, development, management, and sale of residential land properties in New Zealand. It holds approximately 290 hectares of land for development. CDL Investments New Zealand Limited is based in Auckland, New Zealand.","Cadre Holdings, Inc. manufactures and distributes safety and survivability equipment that provides protection to users in hazardous or life-threatening situations in the United States and internationally. The company operates in two segments, Products and Distribution. It primarily provides body armor product, such as concealable, corrections, and tactical armor under the Safariland and Protech Tactical brands; survival suits, remotely operated vehicles, specialty tools, blast sensors, accessories, and vehicle blast attenuation seats for bomb safety technicians; bomb suits; duty gear, including belts and accessories; and other protective and law enforcement equipment comprising communications gear, forensic and investigation products, firearms cleaning solutions, and crowd control products. The company also offers third-party products, such as uniforms, optics, boots, firearms, and ammunition. It serves first responders, such as state and local law enforcement, fire and rescue, explosive ordnance disposal technicians, emergency medical technicians, fishing, and wildlife enforcement and departments of corrections, as well as federal agencies including the U.S. Department of State, U.S. Department of Defense, U.S. Department of Interior, U.S. Department of Justice, U.S. Department of Homeland Security, U.S. Department of Corrections, and various foreign government agencies. The company was founded in 1964 and is headquartered in Jacksonville, Florida.","Central Depository Services (India) Limited provides depository services in India. The company offers various services, such as account opening, dematerialization, processing delivery and receipt instructions, account statement, re-materialization, pledging, nomination, transmission of securities, change in address, bank account details, and SMS services for depository participants. It also provides facilities to issuers to credit securities to a shareholder's or applicants demat accounts; KYC services in respect of investors in capital markets to capital market intermediaries; facilities for holding of insurance policies in electronic form to the holders of these policies; and facilities for holding and transacting in electronic negotiable warehouse receipts. In addition, it offers services, such as electronic access to security information, electronic access to security information and execution of secured transaction, e-voting, e-notices, e-locker, and mobile application. It serves investors through depository participants, issuer companies, capital market intermediaries, insurance companies, and warehouse service providers/warehouses. The company was incorporated in 1997 and is based in Mumbai, India.","Companhia de Eletricidade do Estado da Bahia - COELBA engages in the distribution of electricity. It distributes electricity in 415 municipalities serving 6,205 thousand consumers in State of Bahia, as well as in the municipalities of Delmiro Gouveia in the State of Alagoas, and Dian\u00e1polis in the State of Tocantins. The company was founded in 1960 and is headquartered in Salvador, Brazil. Companhia de Eletricidade do Estado da Bahia - COELBA is a subsidiary of Neoenergia S.A.","CONSOL Energy Inc. produces and exports bituminous coal in the United States. It operates through PAMC, CONSOL Marine Terminal, and Other segments. The company engages in the mining, preparation, and marketing of bituminous coal to power generators, industrial end-users, and metallurgical end-users; and provision of coal export terminal services, as well as development of the Itmann Mine and the Greenfield reserves. It owns and operates the Pennsylvania Mining Complex (PAMC), which includes the Bailey Mine, the Enlow Fork Mine, the Harvey Mine, and the Central Preparation Plant; and CONSOL Marine Terminal located in the port of Baltimore. As of December 31, 2021, the company had 612.1 million tons of proven and probable coal reserves at PAMC. It also owns approximately 1.4 billion tons of Greenfield reserves located in the Northern Appalachian, Central Appalachian, and Illinois basins. The company was founded in 1860 and is headquartered in Canonsburg, Pennsylvania.","CEZ, a. s., an electricity generation company, engages in the production, distribution, trade, and sale of electricity and heat in Western, Central, and Southeastern Europe. The company operates through four segments: Generation, Distribution, Sales, and Mining. It operates two nuclear plants, sixteen hydroelectric plants, one combined cycle gas turbine plant, and eight fossil fuel plants in the Czech Republic. The company also operates various fossil fuel, hydro, wind, solar, gas, biogas, and biomass power plants in the Czech Republic; eleven wind power plants in Germany; and two fossil fuel plants and two hydroelectric plants in Poland. In addition, it is involved in the trade and sale of natural gas; mining of coal; quarrying and processing of construction aggregates and limestones; commodity trading business; and provision of energy services. Further, the company holds interest in the lithium ore mining project in C\u00ednovec. CEZ, a. s. was incorporated in 1992 and is headquartered in Prague, the Czech Republic.","Chennai Petroleum Corporation Limited produces and supplies petroleum products in India. The company's principal products include liquefied petroleum gas, motor spirit, superior kerosene oil, aviation turbine fuel, high speed diesel, naphtha, bitumen, hexane, mineral turpentine oil, lube base stock, petrochemical feedstocks, paraffin wax, and petcoke. It also provides furnace oil, sulphur, light diesel oil, extracts, and butene, isobutylene, and high viscosity index oil. In addition, the company offers linear alkyl benzene, methyl ethyl ketone, and propylene glycol and polyols. The company was formerly known as Madras Refineries Limited and changed its name to Chennai Petroleum Corporation Limited in June 2000. Chennai Petroleum Corporation Limited was incorporated in 1965 and is based in Chennai, India. Chennai Petroleum Corporation Limited operates as a subsidiary of Indian Oil Corporation Limited.","CNH Industrial N.V. designs, produces, markets, sells, and finances agricultural and construction equipment, trucks, commercial vehicles, buses, and specialty vehicles in North America, Europe, South America, and internationally. It operates through five segments: Agriculture, Construction, Commercial and Specialty Vehicles, Powertrain, and Financial. The Agriculture segment provides farm machinery and implements that include two-and four-wheel drive tractors, crawler tractors, combines, cotton pickers, grape and sugar cane harvesters, hay and forage equipment, planting and seeding equipment, soil preparation and cultivation implements, and material handling equipment under the New Holland Agriculture, Case IH, STEYR, Miller, Kongskilde, \u00d6verum, K-Line, and JF brands. The Construction segment offers excavators, crawler dozers, graders, wheel and backhoe loaders, and skid steer and compact track loaders under the CASE Construction and New Holland Construction brands. The Commercial and Specialty Vehicles segment provides light, medium, and heavy vehicles for the transportation and distribution of goods under the IVECO brand; commuter buses and city-buses under the IVECO BUS and Heuliez Bus brands; quarry and mining equipment under the IVECO ASTRA brand; firefighting vehicles under the Magirus brand; and vehicles for civil defense and peace-keeping missions under the Iveco Defence Vehicles brand. The Powertrain segment offers engines, transmission systems, and axles for on- and off-road applications, as well as for marine and power generation under the FPT Industrial brand. The Financial Services segment provides and administers retail financing to customers for the purchase or lease of new and used industrial equipment or vehicles, and other equipment; wholesale financing, which primarily consists of floor plan financing; and trade receivables factoring services. The company was founded in 1842 and is headquartered in London, the United Kingdom.","Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. The company also offers switching portfolio encompasses campus switching as well as data center switching; enterprise routing portfolio interconnects public and private wireline and mobile networks, delivering highly secure, and reliable connectivity to campus, data center and branch networks; wireless products include wireless access points and controllers; and compute portfolio including the cisco unified computing system, hyperflex, and software management capabilities, which combine computing, networking, and storage infrastructure management and virtualization. In addition, it provides Internet for the future product consists of routed optical networking, 5G, silicon, and optics solutions; collaboration products, such as meetings, collaboration devices, calling, contact center, and communication platform as a service; end-to-end security product consists of network security, cloud security, security endpoints, unified threat management, and zero trust; and optimized application experiences products including full stack observability and network assurance. Further, the company offers a range of service and support options for its customers, including technical support and advanced services and advisory services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.","CVB Financial Corp. operates as a bank holding company for Citizens Business Bank, a state-chartered bank that provides banking and financial services to small to mid-sized businesses and individuals. It offers checking, savings, money market, and time certificates of deposit products for business and personal accounts; and serves as a federal tax depository for business customers. The company also provides commercial lending products comprising lines of credit and other working capital financing, accounts receivable lending, and letters of credit; agriculture loans to finance the operating needs of wholesale dairy farm operations, cattle feeders, livestock raisers, and farmers; lease financing services for municipal governments; commercial real estate and construction loans; and consumer financing products, including automobile leasing and financing, lines of credit, credit cards, home mortgages, and home equity loans and lines of credit. In addition, it offers various specialized services, such as treasury management systems for monitoring cash flow, merchant card processing program, armored pick-up and delivery, payroll services, remote deposit capture, electronic funds transfers, wires and automated clearinghouse, and online account access. Further, the company provides trust services through its CitizensTrust Division, such as fiduciary services, mutual funds, annuities, 401(k) plans, and individual investment accounts. As of December 31, 2021, it operated 58 banking centers located in the Inland Empire, Los Angeles County, Orange County, San Diego County, Ventura County, Santa Barbara County, and the Central Valley area of California; and three trust offices located in Ontario, Newport Beach, and Pasadena, as well as two loan production offices in California's Central Valley and the Sacramento area. The company was founded in 1974 and is headquartered in Ontario, California.","CPI Aerostructures, Inc. engages in the contract production of structural aircraft parts for fixed wing aircraft and helicopters in the commercial and defense markets. The company also offers aero systems, such as reconnaissance pod structures and fuel panel systems; and supplies parts for maintenance, repair, and overhaul (MRO), as well as kitting contracts. In addition, it operates as a subcontractor for defense contractors and commercial contractors, as well as a contractor for the United States Department of Defense. Further, the company offers engineering, program management, supply chain management, kitting, and MRO services. Additionally, it offers machine gunner window assemblies, hover infrared suppression system module assemblies, wing sets and spares kits, lock assemblies, canopy activation drive shaft assemblies, rudder island and drag chute canister assemblies, composite electronics racks, structural wing components, fixed leading edges, and engine inlet assemblies. The company was formerly known as Consortium of Precision Industries, Inc. and changed its name to CPI Aerostructures, Inc. in July 1992. CPI Aerostructures, Inc. was incorporated in 1980 and is headquartered in Edgewood, New York.","Dynasty Ceramic Public Company Limited manufactures and sells ceramic wall and floor tiles in Thailand and internationally. It offers its products under the Dynasty, Tile Top, Jaguar, Value, Mustang, Chicken, Birdie, Ducky, Swan, M, Cosmo, Rover, and Monte brands. The company was formerly known as Royal Floor Tile Co. Ltd. Dynasty Ceramic Public Company Limited was founded in 1989 and is headquartered in Bangkok, Thailand.","Delta Electronics (Thailand) Public Company Limited, together with its subsidiaries, researches and develops, manufactures, and distributes electronic products. It operates through Power Electronics, Infrastructure, and Automation segments. It offers inductors, RF inductors, transformers, networking products, EMI filters, solenoids, current sensing resistors, and power modules; switching power supplies, standard power modules, and lighting ballasts and LED drivers; DC brushless fans and blowers, motors, thermal management products, cabinet thermal solutions, and indoor air quality and automotive fans; EV/HEV powertrain solutions and power electronics components comprise of on-board chargers and DC/DC converters; and display and visualization, mobile power, industrial power, and medical power products, as well as healthcare devices. The company also provides industrial automation products and solutions, including drives and power quality products, motion control solutions, control systems, robots, software systems, and manufacturing equipment, as well as field devices that include temperature controllers, machine vision systems, power meters, and smart and vision sensors. In addition, it offers building automation products comprising building management and control system, LED lighting, intellegent surveillace, and building energy management system products; telecom power systems, networking systems, and UPS and datacenter infrastructure solutions; and EV charging and energy storage systems, renewable energy, industrial battery charging, healthcare devices, industrial equipment, energy IoT, and display and visualization products. Further, the company rents properties. It operates in the United States, China, Germany, india, Ireland, Singapore, Norway, Taiwan, the Netherlands, and internationally. The company was incorporated in 1988 and is based in Samut Prakan, Thailand.","Delta Corp Limited operates in the gaming and entertainment, and hospitality businesses in India and internationally. It operates through three segments: Casino Gaming, Online Skill Gaming, and Hospitality. The Casino Gaming segment operates offshore casinos, including Deltin Royale, Deltin JAQK, and King Casino in Goa; land based casinos, such as Deltin Suites Casino in Goa and Deltin Denzong in Sikkim; and Deltin Suites Casino in Kathmandu, Nepal. The Online Gaming segment operates Adda52.com, an online poker site; and Adda52Rummy, a rummy app. The Hospitality segment operates The Deltin, a five-star hotel, which include 176 rooms, 3 bars, and 3 gourmet restaurants located in Daman; and Deltin Suites, an all-suite hotel, which comprise 106 rooms, bar, and restaurants located in Goa. Delta Corp Limited was incorporated in 1990 and is based in Mumbai, India.","DFV Deutsche Familienversicherung AG operates as a digital insurance company in Germany. It offers property, accident, liability, legal expense, household, pet health, and electronics insurance products; and dental, outpatient and inpatient treatment, foreign travel health, sick day, supplementary long-term care, and state-aided care provision insurance products. The company was incorporated in 2006 and is based in Frankfurt, Germany.","Ditto (Thailand) Public Company Limited distributes document management solutions in Thailand. It also rents, distributes, and services photocopiers, printers, and technology products, as well as technology engineering services for various government agency projects. In addition, the company provides construction, mechanical and electrical engineering system, and information technology services. Ditto (Thailand) Public Company Limited was founded in 2013 and is headquartered in Bangkok, Thailand.","DEMIRE Deutsche Mittelstand Real Estate AG engages in the acquisition, management, and leasing of commercial real estate properties for medium-sized companies in Germany. It operates through Core Portfolio and Fair Value REIT segments. The company offers office, retail, hotel, and logistic properties. As of December 31, 2021, it had a real estate portfolio of 64 commercial properties with total lettable floor space of around 912,724  square meters. The company also engages in the real estate investment activities. The company was formerly known as MAGNAT Real Estate AG and changed its name to DEMIRE Deutsche Mittelstand Real Estate AG in June 2013. DEMIRE Deutsche Mittelstand Real Estate AG was founded in 2006 and is headquartered in Langen, Germany. DEMIRE Deutsche Mittelstand Real Estate AG operates as a subsidiary of AEPF III 15 S.\u00e0 r.l.","Doximity, Inc. operates a cloud-based digital platform for medical professionals in the United States. The company's platform provides its members with tools built for medical professionals, enabling them to collaborate with their colleagues, coordinate patient care, conduct virtual patient visits, stay up to date with the latest medical news and research, and manage their careers. It primarily serves pharmaceutical manufacturers and healthcare systems. The company was formerly known as 3MD Communications, Inc. and changed its name to Doximity, Inc. in June 2010. Doximity, Inc. was incorporated in 2010 and is headquartered in San Francisco, California.","Darden Restaurants, Inc., through its subsidiaries, owns and operates full-service restaurants in the United States and Canada. As of May 29, 2022, it owned and operated 1,867 restaurants, which included 884 under the Olive Garden brand, 546 under the LongHorn Steakhouse brand name, 172 under the Cheddar's Scratch Kitchen brand, 85 under the Yard House brand name, 62 under The Capital Grille brand, 45 under the Seasons 52 brand name, 42 under the Bahama Breeze brand, 28 under the Eddie V's Prime Seafood brand name, and 3 under the Capital Burger brand; and franchised 60 restaurants comprising 35 under the Olive Garden brand, 18 under the LongHorn Steakhouse brand name, 4 under the Cheddar's Scratch Kitchen brand, 2 under The Capital Grille brand name, and 1 under the Bahama Breeze brand.Darden Restaurants, Inc. was founded in 1968 and is based in Orlando, Florida.","Dynatrace, Inc. provides a software intelligence platform for dynamic multi-cloud environments. It operates Dynatrace, a software intelligence platform, which provides application and microservices monitoring, runtime application security, infrastructure monitoring, digital experience monitoring, business analytics, and cloud automation. Its platform allows its customers to modernize and automate IT operations, develop and release software, and enhance user experiences. The company also offers implementation, consulting, and training services. Dynatrace, Inc. markets its products through a combination of direct sales team and a network of partners, including resellers, system integrators, and managed service providers. It serves customers in various industries comprising banking, insurance, retail, manufacturing, travel, and software. The company operates in North America, Europe, the Middle East, Africa, the Asia Pacific, and Latin America. Dynatrace, Inc. was founded in 2005 and is headquartered in Waltham, Massachusetts.","Eason &amp; Co Public Company Limited manufactures and sells industrial and automotive paints primarily in Thailand. It offers packaging coatings for interior and exterior application to crown caps, ROPP, screw caps, lug caps, and other closures. The company also provides offset inks comprising metal decorating inks for 2-piece cans; and conventional and UV metal decorating inks for 3-piece cans. In addition, it offers motorcycle coatings, including poly urethane, acrylic, and air dry paints, as well as trades in industrial paints. The company was formerly known as Eason Paint Public Company Limited and changed its name to Eason &amp; Co Public Company Limited in May 2020. Eason &amp; Co Public Company Limited was incorporated in 1965 and is headquartered in Phan Thong, Thailand.","Enterprise Bancorp, Inc. operates as the holding company of Enterprise Bank and Trust Company that provides commercial banking products and services. It offers commercial and retail deposit products, including checking accounts, limited-transactional savings and money market accounts, commercial sweep products, and term certificates of deposit. The company also provides commercial real estate, commercial and industrial, commercial construction, residential, and consumer loans, as well as home equity loans and lines of credit. In addition, the company offers cash management services; wealth advisory and management services that include customized investment management and trust services to individuals, family groups, commercial businesses, trusts, foundations, non-profit organizations, and endowments; brokerage and management services to individual investors; insurance services; and voice, online, and mobile banking services. As of January 27, 2022, it had 26 full-service branches located in the Massachusetts communities of Acton, Andover, Billerica, Chelmsford, Dracut, Fitchburg, Lawrence, Leominster, Lexington, Lowell, Methuen, North Andover, Tewksbury, Tyngsborough, and Westford; and in the New Hampshire communities of Derry, Hudson, Nashua, Pelham, Salem, and Windham. The company was founded in 1989 and is headquartered in Lowell, Massachusetts.","ECS Botanics Holdings Ltd engages in the cultivation, manufacture, and sale of medicinal cannabis products. It also retails hemp wellness and food products; and engages in the agriculture business. The company is based in Launceston, Australia.","EDAG Engineering Group AG engages in the development of vehicles, derivatives, modules, and production facilities for the automotive and commercial vehicle industries worldwide. It operates through three segments: Vehicle Engineering, Production Solutions, and Electrics/Electronics. The Vehicle Engineering segment provides package and ergonomics, body assembly, surface design, and interior and exterior services; develops commercial vehicles, doors, covers, and lid systems, as well as head, rear, and small lamps; and technologies and lightweight designing services. This segment also offers vehicle integration services comprising functional integration and vehicle validation services, such as testing of individual components, modules, engines, motors, transmissions, and complete vehicles; models and vehicle solutions, including a range of styling, ideation, and design services, as well as creates test vehicles, sub-assemblies, and vehicle bodies for the physical validation of modules and systems; project management; and consulting and support services for quality-related matters. The Production Solutions segment provides body manufacturing and smart factory services, product design for manufacturability, coordinated technical building equipment and plant layout, individual production solutions, networking through smart logistics, digitalization, and networking in production; and process consulting and CAx development services, as well as consulting, conceptual, and realization services. The Electrics/Electronics segment develops electric and electronic systems comprising architecture and networks development, systems engineering, embedded systems, information technology, integration and system validation, functional safety and cyber security, and process and product data management services. The company was founded in 1969 and is based in Arbon, Switzerland. EDAG Engineering Group AG is a subsidiary of Aton Austria Holding GmbH.","Eimco Elecon (India) Limited manufactures and sells equipment for mining and construction sector in India. It offers side dump loaders, load haul dumpers, coal haulers, roof bolters, shuttle cars, continuous miner package, universal drill machines, articulated wheel loaders, foundation equipment, low profile dump trucks, rocker shovel loaders, and underground transport systems, as well as piling rigs, air motors, and chair lift man riding systems. The company also exports its products to South East Asia and Africa. Eimco Elecon (India) Limited was incorporated in 1974 and is headquartered in Vallabh Vidyanagar, India.","Entergy Mississippi, LLC generates, transmits, and distributes, and sells coal and solar power primarily to retail and wholesale customers in Mississippi. It also provides gas services to customers. Entergy Mississippi, LLC was formerly known as Entergy Mississippi Power and Light, LLC and changed its name to Entergy Mississippi, LLC on December 01, 2018. The company was incorporated in 2018 and is based in Jackson, Mississippi. Entergy Mississippi, LLC operates as a subsidiary of Entergy Utility Holding Company, LLC.","Everi Holdings Inc. provides entertainment and technology solutions for the casino and digital gaming industries in the United States, Canada, the United Kingdom, Europe, the Caribbean, Central America, and Asia. It operates in two segments, Games and FinTech. The company offers local and wide-area progressive gaming products, such as classic mechanical reel games and video reel games, as well as TournEvent, a slot tournament terminal and system machine; and sells player terminals, licenses, game content, and related equipment. It also provides financial access services, such as funds dispensed, credit card and POS debit card financial access transactions; check warranty; CashClub, a software payments platform that provides gaming establishments with a personal computer workstation software user interface and point-of-sale terminal; CashClub Wallet, a digital payments platform for gaming establishments; fully integrated kiosks that provide multiple functions to the casino floor; loyalty kiosk and related equipment; and other integrated kiosk solutions. In addition, the company offers non-funds dispensing terminals that perform authorizations for credit card financial access and POS debit card financial access transactions; and database services. Further, it provides Everi Compliance solutions to assist casino operators with meeting regulatory requirements; Central Credit, a gaming patron credit bureau service; JackpotXpress, a jackpot payout and tax form management platform; and loyalty platform, as well as support and maintenance services. The company was formerly known as Global Cash Access Holdings, Inc. and changed its name to Everi Holdings Inc. in August 2015. Everi Holdings Inc. was founded in 1998 and is headquartered in Las Vegas, Nevada.","Fanhua Inc., together with its subsidiary, distributes insurance products in China. It operates through two segments, Insurance Agency and Claims Adjusting. The Insurance Agency segment provides property and casualty insurance products that primarily include individual accident, travel, homeowner, and indemnity medical insurance products; and life insurance products, such as individual health, individual whole life, individual term life, individual endowment life, and individual annuity, as well as participating insurance products. The Claims Adjusting segment offers pre-underwriting survey, claims adjusting, residual value disposal, loading and unloading supervision, and consulting services. The company also operates baoxian.com, an online insurance platform, which allows customers to search for, and purchase a range of insurance products; Lan Zhanggui, an all-in-one insurance sales and service platform; ehuzhu.com, an online mutual aid platform; and Chetong.net, an online claims services resource aggregating platform, as well as Fanhua RONS DOP, a digital marketing platform; Fanhua RONS Guanjia, a customer service platform; and Fanhua WeCom that enables agents to directly interact with existing and potential customers. It serves customers through insurance sales and service group, and insurance agencies, as well as sales and service branches and outlets, registered independent sales agents, and in-house claims adjustors. The company was formerly known as CNinsure Inc. and changed its name to Fanhua Inc. in December 2016. Fanhua Inc. was founded in 1998 and is headquartered in Guangzhou, China.","Franklin Covey Co. provides training and consulting services in the areas of execution, sales performance, productivity, customer loyalty, and educational improvement for organizations and individuals worldwide. The company operates through three segments: Direct Offices, International Licensees, and Education Practice. It also provides a suite of individual-effectiveness and leadership-development training and products. The company was incorporated in 1983 and is headquartered in Salt Lake City, Utah.","Unifique Telecomunica\u00e7\u00f5es S.A. provides telecommunications services in Brazil. It offers fixed-line, data storage, data hosting, internet, and pay-TV equipment and services. The company provides SCM multimedia communications services; access to communication networks, portals, content, and Internet information services; and satellite pay television, cable television, microwave pay television, radio activity, data processing, application, internet hosting, and switched fixed telephony services. Unifique Telecomunica\u00e7\u00f5es S.A. was founded in 1997 and is headquartered in Timbo, Brazil.","The First of Long Island Corporation operates as the holding company for The First National Bank of Long Island that provides financial services to small and medium-sized businesses, professionals, consumers, municipalities, and other organizations. The company offers business and small business checking, personal checking, negotiable order of withdrawal, interest on lawyer, escrow service, rent security, personal and nonpersonal money market, savings, time deposit, holiday club, and individual retirement accounts. It also provides commercial and residential mortgage, commercial and industrial, small business credit scored, Small Business Administration, construction and land development, consumer, and home equity lines of credit/loans, as well as commercial and standby letters of credit; debit or credit cards; and overdraft facilities. In addition, the company offers life insurance, trust, estate and custody, retail investment, bill payment, lockbox, ACH, safe deposit box rental, wire transfer, money order, checkbook printing, check, ATM, and online and mobile banking services, as well as investment securities, management, and advisory services. It operates 40 branches, including 17 branches in Nassau, 15 in Suffolk, 5 in Queens, 2 in Brooklyn, and 1 in Manhattan. The company was founded in 1927 and is headquartered in Glen Head, New York.","Farmers National Banc Corp., a financial holding company, operates in the banking, trust, retirement consulting, insurance, and financial management industries. It offers commercial and retail banking services, including checking, savings, and time deposit accounts; commercial, mortgage and installment, and home equity loans; home equity lines of credit, night depository, safe deposit box, money order, bank check, automated teller machine, Internet banking, travel card, E bond transaction, MasterCard and Visa credit cards, brokerage, and other services. The company also provides personal and corporate trust services in the areas of estate settlement, trust administration, and employee benefit plans; retirement services; property and casualty insurance products and services; and various insurance products through licensed representatives, as well as invests in municipal securities. It operates through 47 locations in northeastern region of Ohio and one location in southwestern Pennsylvania. The company was founded in 1887 and is based in Canfield, Ohio.","FNCB Bancorp, Inc. operates as the bank holding company for FNCB Bank that provides retail and commercial banking services to individuals, businesses, local governments, and municipalities in Northeastern Pennsylvania. The company offers checking, savings, money market, and certificate of deposit products. It also provides residential mortgage loans, and home equity term loans and lines of credit; construction, land acquisition, and development loans; commercial real estate loans; commercial and industrial loans; consumer loans, such as secured and unsecured installment loans, automobile financing, lines of credit, and overdraft protection loans; state and political subdivision loans and leases; and purchased loans. In addition, the company offers debit cards; mobile and telephone banking, check imaging, and electronic statement services; remote deposit capture, merchant, treasury, and purchasing card services; and wealth management services. As of January 28, 2022, it operated 17 community offices located in Lackawanna, Luzerne, and Wayne Counties. The company was formerly known as First National Community Bancorp, Inc. and changed its name to FNCB Bancorp, Inc. in October 2016. FNCB Bancorp, Inc. was founded in 1910 and is headquartered in Dunmore, Pennsylvania.","The First Bancorp, Inc. operates as the holding company for First National Bank that provides a range of banking products and services to individuals and businesses. It offers various deposit products, including demand, NOW, savings, money market, and certificates of deposit accounts. The company also provides commercial real estate loan products, such as mortgage loans to finance investments in real property comprising multi-family residential, commercial/retail, office, industrial, hotel, educational, and other specific or mixed use properties; commercial construction loans to finance construction of owner- and non-owner occupied commercial real estate properties; and other commercial loans, which include revolving and term loan obligations to business and corporate enterprises for the purpose of financing working capital or capital investment. In addition, it offers municipal loans for capitalized expenditures, construction projects, or tax-anticipation notes; residential term loans that include amortizing home mortgages and construction loans, which include loans for owner-occupied residential construction; home equity loans and lines of credit; and consumer loans, which are amortizing loans to individuals collateralized by automobiles, pleasure crafts, and recreation vehicles, as well as unsecured short-term time notes. Further, the company provides private banking, financial planning, investment management, and trust services to individuals, businesses, non-profit organizations, and municipalities, as well as payment processing services. It operates through 18 full-service banking offices in Lincoln, Knox, Waldo, Penobscot, Hancock, and Washington counties in the Mid-Coast, Eastern, and Down East regions of Maine. The company was formerly known as First National Lincoln Corporation and changed its name to The First Bancorp, Inc. in April 2008. The First Bancorp, Inc. was founded in 1864 and is based in Damariscotta, Maine.","Forvia SE, together with its subsidiaries, manufactures and sells automotive technology solutions in France, Germany, other European countries, the Americas, Asia, and internationally. It operates through Seating, Interiors, Clean Mobility, Electronics, Lighting, and Lifecycle Solutions segments. The Seating segment designs and manufactures vehicle seats, seating frames, covers, and comfort solutions, as well as adjustment mechanisms. The Interior segment designs, manufactures, and assembles instrument panels, cockpits, and door panels and modules, as well as center consoles, and sustainable materials. The Clean Mobility segment designs and manufactures exhaust system solutions for passenger and commercial vehicles; fuel cell electric vehicles; and aftertreatment solutions for commercial vehicles, as well as zero-emissions solutions. The Electronics segment designs and manufactures display technologies, driver assistance systems, and cockpit electronics, as well as sensors and actuators, lighting/body electronics, energy management, and HMI/displays. The Lighting segment designs and manufactures lighting technologies. The Lifecycle Solutions segment provides solutions extending the vehicle lifecycle, as well as workshop equipment and special original equipment. The company was formerly known as Faurecia S.E. and changed its name to Forvia SE in June 2023. Forvia SE was incorporated in 1929 and is headquartered in Nanterre, France.","Flotek Industries, Inc. operates as a technology-driven chemistry and data company that serves customers across industrial, commercial, and consumer markets in the United States, the United Arab Emirates, and internationally. It operates in two segments, Chemistry Technologies (CT) and Data Analytics (DA). The CT segment designs, develops, manufactures, packages, distributes, delivers, and markets green specialty chemicals that enhance the profitability of hydrocarbon producers and cleans surfaces in commercial and personal settings to help reduce the spread of bacteria, viruses, and germs. This segment primarily serves integrated oil and gas, oilfield services, independent oil and gas, national and state-owned oil, geothermal energy, solar energy, and alternative energy companies. The DA segment designs, develops, produces, sells, and supports equipment and services that create and provide valuable information on the composition and properties of energy customers' hydrocarbon fluids. This segment's data platforms combine the energy industry's field-deployable, inline optical analyzer with proprietary cloud visualization and analytics. It sells its products directly through a mix of in-house sales professionals, as well as contractual agency agreements. The company was incorporated in 1985 and is headquartered in Houston, Texas.","Fleetwood Limited engages in the design, manufacture, and sale of modular accommodation units in Australia and New Zealand. It operates through three segments: RV Solutions, Building Solutions, and Community Solutions. The company also engages in the operation of accommodation villages; develops and commercialize keyless locks and energy management systems; and manufacture, installation, and distribution of recreational vehicle parts and accessories. It offers accommodation solutions for resources, education, affordable housing, mining, and corrections sectors; and provides caravan plumbing and electrical services, as well as supplies related parts. The company was formerly known as Fleetwood Corporation Limited and changed its name to Fleetwood Limited in November 2020. Fleetwood Limited was founded in 1964 and is headquartered in Subiaco, Australia.","First National Corporation operates as the bank holding company for First Bank that provides various commercial banking services to small and medium-sized businesses, individuals, estates, local governmental entities, and non-profit organizations in Virginia. The company's deposit products include checking, savings, money market, and individual retirement accounts, as well as certificates of deposit and treasury management solutions. Its loan products comprise construction loans, including residential, land acquisition, and development loans; 1-4 family residential real estate loans; and commercial real estate loans that are secured by commercial real estate, including multi-family residential buildings, office and retail buildings, hotels, industrial buildings, and religious facilities. The company's loan products also include commercial and industrial loans that are secured by business assets, such as accounts receivable, equipment, and inventory; home equity loans; and secured and unsecured consumer loans, such as lines of credit, automobile loans, deposit account loans, and installment and demand loans. In addition, it provides wealth management services, including estate planning, investment management of assets, trustee under an agreement, trustee under a will, and estate settlement. Further, the company offers title insurance and investment services; and holds other real estate owned and office sites, as well as provides internet and mobile banking, remote deposit capture, and other traditional banking services. It serves customers through 20 bank branch offices, a loan production office, and a customer service center, as well as through a network of ATMs. The company was founded in 1907 and is headquartered in Strasburg, Virginia.","Geospace Technologies Corporation designs and manufactures instruments and equipment used in the oil and gas industry to acquire seismic data in order to locate, characterize, and monitor hydrocarbon producing reservoirs. The company operates through three segments: Oil and Gas Markets, Adjacent Markets, and Emerging Markets. The Oil and Gas Markets segment offers wireless seismic data acquisition systems and reservoir characterization products and services, as well as traditional seismic exploration products, such as geophones, hydrophones, leader wires, connectors, cables, marine streamer retrieval and steering devices, and other seismic products. The Adjacent Markets segment provides industrial products, including imaging equipment, water meter products, remote shut-off valves and Internet of Things platform, and offshore cables, as well as seismic sensors for vibration monitoring and geotechnical applications, such as mine safety and earthquake detection applications; and electronic pre-press products that employ direct thermal imaging, direct-to-screen printing systems, and digital inkjet printing technologies targeted at the commercial and industrial graphics, textile, and flexographic printing industries. The Emerging Markets segment designs and sells products used for border and perimeter security surveillance, cross-border tunneling detection, and other products targeted at movement monitoring, intrusion detection, and situational awareness. This segment serves customers that include various agencies of the United States government, including the Department of Defense, Department of Energy, Department of Homeland Security, and other agencies. The company operates in Asia, Canada, Europe, the United States, and internationally. Geospace Technologies Corporation was founded in 1980 and is headquartered in Houston, Texas.","Gaming Innovation Group Inc., an iGaming technology company, together with its subsidiaries, provides solutions, products, and services to iGaming operators in Nordic countries, other European countries, and internationally. The company offers media services, such as operating various content rich websites, which empower potential players and connect them with their partners' casino or sports betting sites; and platform services, including providing gaming, betting, media, and turnkey platform solutions and services to operators and their customers, as well as specializes in taking land-based operators online through its omnichannel solution, which brings together the offline and online worlds through a shared loyalty system, wallet, and dual registration. It also provides Sportsbook, a sports betting omnichannel solution that offers a various digital content and sports events to players. In addition, the company offers managed service; omnichannel solutions; Data platform to enhance BI and make business decisions; Logic, a real-time rules engine that creates actionable business rules; marketing compliance solution; and Frontend solution. The company was founded in 2012 and is headquartered in St. Julian's, Malta.","Galilee Energy Limited, through its subsidiaries, engages in the exploration and production of oil and gas properties in Australia, the United States, and Chile. It primarily explores for coal seam gas. The company's flagship project is the Glenaras gas project located within the ATP 2019 permit, which covers an area of approximately 3,200 square kilometers in western Queensland's Galilee Basin. Galilee Energy Limited was incorporated in 1994 and is based in Brisbane, Australia.","Gorilla Technology Group Inc. provides video intelligence, Internet of Things (IoT) security, and edge content management hardware, software, and services in the Asia Pacific region. The company operates through three segments: Video IoT, Security Convergence, and Other segments. It offers intelligent video analytics AI models for various verticals, such as behavioral analytics, people/face recognition, vehicle analysis, object recognition, and business intelligence that can scan video for patterns and distinguish specific items using AI algorithms and metadata. The company also provides information technology (IT) and operational technology (OT) security convergence AI algorithms for system administrators and security engineers to detect suspicious behaviors in real time; network anomaly detection AI models; and endpoint malware and suspicious behavior detection AI models. In addition, it offers intelligent video analytics (IVA) appliances to analyze and turn unstructured video and picture data into structured data; IVAR appliance that provides insight into business and operations in a statistic dashboard; smart attendance to track employee health and safety, work hours, clock-ins/outs, and absenteeism, as well as to protect company assets and intellectual properties; event and video management system appliances to store event/object attributes in temporal-spatial big data database from Gorilla; and operation technology security appliance to monitor and control physical devices, processes, and infrastructure, as well as to protect industrial systems and networks from various threats. Further, the company provides smart retail SaaS for shopper demographics, visualized shopper behavior, and advanced data analytics, smart city and transportation SaaS for traffic management, public safety, and planning data; and endpoint security SaaS that protects endpoints against security threats. Gorilla Technology Group Inc. was incorporated in 2001 and is based in Taipei, Taiwan.","Gorilla Technology Group Inc. provides video intelligence, Internet of Things (IoT) security, and edge content management hardware, software, and services in the Asia Pacific region. The company operates through three segments: Video IoT, Security Convergence, and Other segments. It offers intelligent video analytics AI models for various verticals, such as behavioral analytics, people/face recognition, vehicle analysis, object recognition, and business intelligence that can scan video for patterns and distinguish specific items using AI algorithms and metadata. The company also provides information technology (IT) and operational technology (OT) security convergence AI algorithms for system administrators and security engineers to detect suspicious behaviors in real time; network anomaly detection AI models; and endpoint malware and suspicious behavior detection AI models. In addition, it offers intelligent video analytics (IVA) appliances to analyze and turn unstructured video and picture data into structured data; IVAR appliance that provides insight into business and operations in a statistic dashboard; smart attendance to track employee health and safety, work hours, clock-ins/outs, and absenteeism, as well as to protect company assets and intellectual properties; event and video management system appliances to store event/object attributes in temporal-spatial big data database from Gorilla; and operation technology security appliance to monitor and control physical devices, processes, and infrastructure, as well as to protect industrial systems and networks from various threats. Further, the company provides smart retail SaaS for shopper demographics, visualized shopper behavior, and advanced data analytics, smart city and transportation SaaS for traffic management, public safety, and planning data; and endpoint security SaaS that protects endpoints against security threats. Gorilla Technology Group Inc. is headquartered in London, the United Kingdom.","Happiest Minds Technologies Limited offers IT solutions and services in India, the United States, Canada, the United Kingdom, Australia, the Netherlands, Singapore, Malaysia, and the Middle East. It operates through three segments: Infrastructure Management &amp; Security Services (IMSS); Digital Business Solutions (DBS); and Product Engineering Services (PES). The IMSS segment provides security services, including cyber and infrastructure security, governance, risk and compliance, data privacy and security, identity and access management, and threat and vulnerability management; infrastructure services comprises of DC and hybrid cloud services, workspace services, service automation, database and middleware services, and software defined infrastructure services; and advisory, transformation, managed and hosted services, and secure intelligence solutions. The DBS segment offers enterprise applications and customized solutions, comprising of advisory, design and architecture, custom-app development, package implementation, and testing and on-going support services to IT initiatives. The PES segment assists software product companies in building products and services that integrates mobile, cloud, and social technologies. The company also provides Internet of Things (IoT) solutions, consisting of digital strategy creation consultation, end-to-end system integration on IoT platforms, IoT security and managed services, implementation of IoT roadmap, and derivation of insights. In addition, it offers analytics/artificial intelligence solutions, including implementation of advanced analytics using artificial intelligence, machine learning and statistical models, and engineering big data platforms; and digital process automation solutions, such as robotic process automation, intelligent business process management, and cognitive automation using AI and machine learning based models. The company was incorporated in 2011 and is headquartered in Bengaluru, India.","Companhia Habitasul de Participa\u00e7\u00f5es, together with its subsidiaries, develops real estate properties in Brazil. The company develops leisure and entertainment facilities, as well as residential condominiums. It also operates hotels and resorts under the IL Campanario Villaggio Resort, Jurer\u00ea Beach Village, Stone Slab, and Mountain Village Stone Slab names. In addition, the company manufactures and sells packaging paper and corrugated cardboard products. Companhia Habitasul de Participa\u00e7\u00f5es was founded in 1967 and is headquartered in Porto Alegre, Brazil.","Healius Limited provides specialty diagnostic services to consumer and practitioners in Australia. The company operates through four segments: Pathology, Imaging, Day Hospitals, and Others. It offers diagnostic imaging services, private medical laboratory, and pathology services. It also provides cataract surgery, colonoscopy, gastroscopy, plastic and cosmetic surgery, skin cancer removal, IVF egg collection, and gynaecological surgery services under the Laverty Pathology, Dorevitch Pathology, QML Pathology, Western Diagnostic Pathology, Genomic Diagnostic, Vetpath Laboratory, Vetnostics, QML Vetnostics, TML Vetnostics, ASAP Laboratory, Abbott Pathology, TML Pathology, IQ, Pathology, Kossard, Gastrolab, and Agilex Biolabs; Lumus Imaging; and Montserrat brands. It operates 2,105 pathology sites; 11 day hospital sites; and 134 imaging sites. The company was formerly known as Primary Health Care Limited and changed its name to Healius Limited in December 2018. Healius Limited was incorporated in 1994 and is based in Sydney, Australia.","Grupo Hotelero Santa Fe, S.A.B. de C.V. acquires, develops, and operates beach and urban hotels in Mexico. It operates in three segments: Urban Services, Resort Services, and Operator and Holding. The company operates a portfolio of 13 hotels under the Krystal Grand, Krystal Hotels &amp; Resorts, Krystal Beach, and Krystal Urban brands, as well as under licensed brands, such as Hilton, Hilton Resorts, Hilton Garden Inn, and Hampton Inn &amp; Suites. It also operates third-party hotels. Grupo Hotelero Santa Fe, S.A.B. de C.V. was incorporated in 2006 and is based in Mexico City, Mexico.","Hansen Technologies Limited develops, integrates, and supports billing systems software for the energy and utilities, and communications and media sectors. It provides Create-Deliver-Engage suite, a set of software applications; and consulting services related to billing systems, as well as sells billing applications. The company also offers various professional services in relation to customer billing systems and IT outsourced services covering facilities management, systems and operations support, network services, and business continuity support; license, support, and maintenance services; and sells hardware and software. In addition, it provides software products services, such as architecture consulting, solution delivery, systems integration, managed, software learning and training, and product support services; cloud and hosting services; and data protection and disaster recovery services. The company operates in Australia, New Zealand, Asia, North America, Central America, Latin America, Europe, the Middle East, and Africa. Hansen Technologies Limited was founded in 1971 and is headquartered in Melbourne, Australia.","Hywin Holdings Ltd., through its subsidiaries, provides wealth management, insurance brokerage, and asset management service in China. It distributes private market investment products comprising asset-backed products, such as real estate securitization products, and equity investments in real estate projects or private project companies; venture capital, private equity, and hedge funds; and supply chain financing products, cash management products, and funds managed by its subsidiaries. The company also offers public market investment products, including money market funds, such as government bonds, central bank bills, term deposits, certificates of deposits, and corporate commercial papers; government bonds, corporate bonds, convertible bonds, and other traded debt instruments; and equities and multi-strategy funds. In addition, it provides individual whole life insurance, individual term life insurance, universal life insurance, individual health insurance, and annuity insurance products, as well as critical illness insurance comprising personal accident insurance products; discretionary and advisory mandates to ultra-high-net-worth clients; and overseas property investment services for residential properties, as well as client referrals to overseas property developers. Further, the company manages and distributes a range of private funds to professional investors; and offers information technology services, including transaction process management, data analysis, and system maintenance services to asset management service and financial product providers. The company was founded in 2006 and is headquartered in Shanghai, China. Hywin Holdings Ltd. is a subsidiary of Grand Lead Group Limited.","ICL Group Ltd, together with its subsidiaries, operates as a specialty minerals and chemicals company worldwide. It operates in four segments: Industrial Products, Potash, Phosphate Solutions, and Innovative Ag Solutions (IAS). The Industrial Products segment produces bromine out of a solution that is a by-product of the potash production process, as well as bromine-based compounds; produces various grades of potash, salt, magnesium chloride, and magnesia products; and produces and markets phosphorous-based flame retardants and other phosphorus-based products. The Potash segment extracts potash from the Dead Sea; mines and produces potash and salt; produces Polysulphate; produces, markets, and sells magnesium and magnesium alloys, as well as related by-products, including chlorine and sylvinite; and sells salt. The Phosphate Solutions segment uses phosphate commodity products to produce specialty products; produces and markets phosphate-based fertilizers, as well as sulphuric acid, green phosphoric acid, and phosphate fertilizers; and manufactures thermal phosphoric acid for various industrial end markets, such as oral care, cleaning products, paints and coatings, water treatment, asphalt modification, construction, and metal treatment. It also develops and produces functional food ingredients and phosphate additives for use in the processed meat, poultry, seafood, dairy, beverage, and baked goods markets; and produces milk and whey proteins for the food ingredients industry. The IAS segment develops, manufactures, markets, and sells fertilizers based primarily on nitrogen, potash, and phosphate, including water soluble specialty, liquid, soluble, and controlled-release fertilizers. It sells its products through marketing companies, agents, and distributors. The company was formerly known as Israel Chemicals Ltd. and changed its name to ICL Group Ltd in May 2020. The company was founded in 1968 and is headquartered in Tel Aviv, Israel.","IDFC Limited, together with its subsidiaries, engages in the investment activities in India. The company operates through Financing and Asset Management segments. It is also involved in the portfolio management, mutual fund, and other alternative funds activities; and provides investment banking and brokerage services. The company was formerly known as Infrastructure Development Finance Company Limited and changed its name to IDFC Limited in July 2012. IDFC Limited was incorporated in 1997 and is based in Mumbai, India.","IDP Education Limited engages in the placement of students into education institutions in Australia, the United Kingdom, the United States, Canada, New Zealand, and Ireland. Its services include counselling, application processing, pre-departure guidance, student placement and examinations, English language teaching, client relations, online student recruitment, and shared services. The company is also involved in the distribution and administration of International English Language Testing System tests for study, work, and migration purposes. In addition, it operates English language schools; and provides digital marketing and event services. IDP Education Limited was founded in 1969 and is headquartered in Docklands, Australia.","IGO Limited operates as an exploration and mining company that engages in discovering, developing, and operating assets focused on metals to enable clean energy in Australia. It owns and operates a 100% interest in the Nova nickel-copper-cobalt operation located to the east northeast of Norseman in the Great Western Woodlands of Western Australia; a 100% interest in the Cosmos nickel operation located to the north of Leinster in Western Australia; and a 100% interest in the Forrestania nickel operation located to the east of Perth in Western Australia. The company also focuses on investing in lithium mines, as well as holds 100% interest in the downstream processing refinery at Kwinana in Western Australia to produce battery grade lithium hydroxide. In addition, it owns and operates various projects, including Fraser Range, Kimberley, Paterson, Copper Coast, Frontier, Raptor, and Western Gawler projects. The company was formerly known as Independence Group NL and changed its name to IGO Limited in January 2020. IGO Limited was incorporated in 2000 and is headquartered in Perth, Australia.","Triple i Logistics Public Company Limited, together with its subsidiaries, provides domestic and international freight forwarding and integrated logistics services. It operates through Air Freight; Sea and In-Land Freight Logistics Management; Chemical and Hazardous Goods Logistics; and Other Management Services segments. The company offers air freight services, such as wholesale ai
