r freight, forwarding, general sales agency for airlines, and airport cargo terminal services; sea freight and inland transportation services, including shipping line agency, less than container load, and inland container transport services; logistics management, and warehouse and distribution services; and chemical and specialty logistics services, such as hazardous and dangerous goods logistics integrating, and dangerous goods packaging solutions. It also provides packaging services. In addition, the company offers office rental and other management services. Triple i Logistics Public Company Limited was incorporated in 2017 and is headquartered in Bangkok, Thailand.","Iluka Resources Limited engages in the exploration, project development, mining, processing, marketing, and rehabilitation of mineral sands. The company operates through Jacinth-Ambrosia/Mid West, Cataby/South West, Sierra Rutile, and United States/Murray Basin segments. It produces zircon; titanium dioxide products of rutile and synthetic rutile; and ilmenite, as well as activated carbon and iron concentrate products. The company also engages in the exploration of rare earths elements, such as monazite and xenotime. Its products are used in technology, construction, medical, lifestyle and industrial applications. It has operations in Australia, China, rest of Asia, Europe, the Americas, and internationally. The company was formerly known as Westralian Sands Limited and changed its name to Iluka Resources Limited in May 1999. Iluka Resources Limited was incorporated in 1954 and is headquartered in Perth, Australia.","Infosys Limited, together with its subsidiaries, provides consulting, technology, outsourcing, and next-generation digital services in North America, Europe, India, and internationally. It provides application development and management, independent validation, product engineering and management, infrastructure management, enterprise application management, and support and integration services. The company's products and platforms include Finacle, a core banking solution; Edge suite of products; Infosys Nia, an artificial intelligence platform; Infosys McCamish - an insurance platform; Wingspan, a customizable learning platform; Stater mortgage servicing platform; Panaya automation suite; and Skava, an e-commerce suite. The company serves clients in the financial services and insurance, life sciences and healthcare, manufacturing, retail, consumer packaged goods and logistics, hi-tech, communications, telecom OEM, media, energy, utilities, resources, services, and other industries. It has collaboration agreements with Rolls-Royce, BP plc, Newmont Corporation, RXR Realty, Majesco Limited, and Centre for Accessibility Australia; and a strategic partnership with The Economist Group Limited to enable and enhance sustainability solutions through a business-to-business model. The company was formerly known as Infosys Technologies Limited and changed its name to Infosys Limited in June 2011. Infosys Limited was incorporated in 1981 and is headquartered in Bengaluru, India.","Intellect Design Arena Limited provides software development and related services for banking, insurance, and other financial services in India and internationally. It offers platforms and products, such as iGTB, a suite of transaction banking solutions that includes digital transaction banking, trade and supply chain finance, liquid management, payment, and virtual account management solutions; iGCB, an end-to-end contextual banking suite for retail and corporate banking solution, which consists of digital core, digital lending, quantum core, and cards; iRTM, a risk, treasury, and capital markets platform that supports straight-through processing (STP) and various asset classes over a configurable and scalable platform; Intellect SEEC, an insurance solution; and Intellect WealthQube, a solution for wealth managers, private bankers, advisory firms, and financial advisors. Intellect Design Arena Limited was incorporated in 2011 and is based in Chennai, India.","Incitec Pivot Limited manufactures and distributes industrial explosives, industrial chemicals, and fertilizers in Australia, the United States, Canada, Turkey, and France. The company manufactures and distributes fertilizers, including di/mono-ammonium phosphate, ammonia, granulated ammonium sulphate, urea, and single super phosphate, as well as imports and sells fertilizers. It also manufactures and sells industrial explosives, such as ammonium nitrate and related products and services to the mining, quarrying, and construction industries; and manufactures, imports, and sells industrial chemicals to the agriculture and specialist industries. The company was founded in 1831 and is headquartered in Southbank, Australia.","\u00cdslandsbanki hf., together with its subsidiaries, provides commercial banking products and services to the retail and corporate sectors in Iceland. The company provides personal banking services comprising online banking, online chat, personal advisory, digital and personalized services to retail customers. It also offers business banking products and services to small and medium-sized enterprises, and asset financing services under the Ergo brand. In addition, the company provides corporate and investment banking services consisting of financial and investment banking services to large companies, pension and investment funds, institutional investors, and high net worth individuals. Further, the company offers securities and foreign currency, investment advice, corporate finance, lending, and private banking services. The company was founded in 1905 and is headquartered in K\u00f3pavogur, Iceland.","Icelandic Salmon AS engages in processing, production, and sale of seafood and seafood-based products. The company is involved in the salmon farming activities. It distributes its products worldwide. The company was formerly known as Arnarlax AS and changed its name to Icelandic Salmon AS in October 2020. Icelandic Salmon AS was founded in 2009 and is headquartered in Kverva, Norway. Icelandic Salmon AS is a subsidiary of SalMar ASA.","Frasers Centrepoint Trust (\u0093FCT\u0094) is a leading developer-sponsored retail real estate investment trust (\u0093REIT\u0094) and one of the largest suburban retail mall owners in Singapore with total assets of approximately S$6.7 billion. FCT's current property portfolio comprises 11 retail malls9 and an office building located in the suburban regions of Singapore, near homes and within minutes to transportation amenities. The retail portfolio has over 2.3 million square feet of net lettable area with over 1,500 leases with a strong focus on providing for necessity spending, food &amp; beverage and essential services. The portfolio comprises Causeway Point, Northpoint City North Wing (including Yishun 10 Retail Podium), Anchorpoint, YewTee Point, Changi City Point, Waterway Point (40%-interest), Tiong Bahru Plaza, White Sands, Hougang Mall, Century Square and Tampines 1) and an office property (Central Plaza). FCT's malls enjoy stable and recurring shopper footfall supported by commuter traffic and residential population in the catchment. FCT also holds a 31.15% stake in Hektar Real Estate Investment Trust, a retail-focused REIT in Malaysia listed on the Main Market of Bursa Malaysia Securities Berhad. FCT is index constituent of several benchmark indices including the FTSE EPRA/NAREIT Global Real Estate Index Series (Global Developed Index), FTSE ST Real Estate investment Trust Index, MSCI Singapore Small Cap Index and the SGX iEdge S-REIT Leaders Index. Listed on the Main Board of the Singapore Exchange Securities Trading Limited since 5 July 2006, FCT is managed by Frasers Centrepoint Asset Management Ltd., a real estate management company and a wholly-owned subsidiary of Frasers Property Limited.","JB Hi-Fi Limited, together with its subsidiaries, retails home consumer products. The company operates through three segments: JB Hi-Fi Australia, JB Hi-Fi New Zealand, and The Good Guys. It provides computers, such as laptops, desktop PCs, iPads, tablets, eBook readers, monitors and projectors, printers and ink, storage devices, keyboards and mouse, computer accessories, as well as software, and home internet and wi-fi products; televisions; headphones, speakers, and audio devices; and smart home appliances. The company also offers mobile phones; gaming devices, such as Xbox, Nintendo, PlayStation, and PC and retro gaming devices; music and vinyl products; movies and TV shows; and collectibles and merchandise, including apparel, card and board games, and jigsaw puzzles. In addition, it provides content creator gears for vloggers and influences, game streamers, podcasters, and music producers and DJs; cameras; drones and e-scooters; and fitness, health, and wellbeing products, such as smart watches, fitness trackers, massagers, health monitors, air treatment devices, sleep solutions, smart drink bottles, as well as shavers and trimmers, and hair and oral care products. Further, the company offers home appliances consisting of washers and dryers, fridges and freezers, dishwashers, vacuuming and cleaning products, small kitchen appliances, microwaves, coffee and beverages machines and accessories, and heating, cooling, and air treatment products. Additionally, it provides information technology and consulting services. As of June 30, 2022, the company sold its products through branded retail store network comprising 199 JB Hi-Fi/JB Hi-Fi Home stores in Australia; 14 JB Hi-Fi stores in New Zealand; and 106 The Good Guys stores in Australia, as well as online. JB Hi-Fi Limited was founded in 1974 and is based in Southbank, Australia.","Kajaria Ceramics Limited manufactures and sells ceramic and vitrified tiles under the Kajaria, Kerovit, and Eternity brands in India. The company's products include ceramic wall and floor tiles, polished vitrified tiles, glazed vitrified tiles, sanitary ware and faucets, and plywood and laminates, as well as tile adhesives, epoxy and unsanded grout, and tiles cleaner. It also exports its products to approximately 35 countries. The company was incorporated in 1985 and is headquartered in New Delhi, India.","KCE Electronics Public Company Limited, together with its subsidiaries, manufactures and distributes electric printed circuit boards (PCBs) under the KCE trademark worldwide. It operates through three segments: Manufacturing and Distributing of Prepreg and Laminate, Manufacturing and Distributing of Printed Circuit Board, and Manufacturing and Distributing of Chemical. The company's PCBs are manufactured from copper clad laminate that are used in various applications, including automotive, industrial, computer, and telecom systems. It also manufactures and distributes chemicals products, and prepreg and laminate products, as well as engages in the rental of buildings. The company was formerly known as Kuang Charoen Electronics Company Limited. KCE Electronics Public Company Limited was founded in 1982 and is based in Bangkok, Thailand.","Kriti Nutrients Limited engages in the manufacture and sale of soyabean seeds under the Kriti brand in India and internationally. It offers edible oils, such as refined sunflower oil, soya bean oil, filtered groundnut oil, and mustard oil; soya lecithin; protein-based nuggets/TVP, full fat soya flour, defatted flakes/ grits/ flour toasted, defatted flakes/ grits/ flour untoasted, super HyPro SBM, and soya hulls; and acid oil and fatty acids. The company serves food, pharmaceutical, aquaculture and poultry, and dairy industries. It also exports its products. The company was founded in 1992 and is based in Indore, India. Kriti Nutrients Limited is a subsidiary of Sakam Trading Private Limited.","Founded in 1997, Gladstone Land is a publicly traded real estate investment trust that acquires and owns farmland and farm-related properties located in major agricultural markets in the U.S. and leases its properties to unrelated third-party farmers. The Company, which reports the aggregate fair value of its farmland holdings on a quarterly basis, currently owns 127 farms, comprised of approximately 94,000 acres in 13 different states, valued at approximately $1.0 billion. Gladstone Land's farms are predominantly located in regions where its tenants are able to grow fresh produce annual row crops, such as berries and vegetables, which are generally planted and harvested annually. The Company also owns farms growing permanent crops, such as almonds, apples, figs, olives, pistachios, and other orchards, as well as blueberry groves and vineyards, which are generally planted every 10 to 20-plus years and harvested annually. The Company may also acquire property related to farming, such as cooling facilities, processing buildings, packaging facilities, and distribution centers. The Company pays monthly distributions to its stockholders and has paid 93 consecutive monthly cash distributions on its common stock since its initial public offering in January 2013. The Company has increased its common distributions 20 times over the prior 23 quarters, and the current per-share distribution on its common stock is $0.0449 per month, or $0.5388 per year.","Lemonsoft Oyj designs, develops, and sells enterprise resource planning software solutions in Finland and internationally. It offers financial management module, which automates various tasks, such as accounting, invoicing, processing purchase invoices, sending orders, payroll with official notifications, filing tax returns, and preparing financial statements to automated and electronic ones; payroll and personnel administration program comprise personal register, competence profiles, events, payroll, payment of wages, reporting, travel invoices, expense voucher, recording of working time, working time stamping terminal, shift planning, production work and project management, and processing slips and holidays; and customer relationship management module provides customer knowledge, and sales and management tools. The company also provides business intelligence that supports customers in managing and acting in information, automation of reporting, strategy implementation and communication, and standard solution; LemonFiles, a cloud-based solution for data management; project management manages entire process from the tender stage to project implementation, and accounting; dynamic reporting products, and other management tools; resource management module shows the available resources; logistics module includes versatile and extensive functions for managing company's material flows, and logistics chain; production control for planning and management of different types of production methods. In addition, it offers service interfaces, such as LemonHUB that allows to send and receive online invoices, orders, and confirmations; and other software products. It serves industrial manufacturing, wholesale and retail, professional services automation, and construction and contracting industries, as well as accounting firms. Lemonsoft Oyj was incorporated in 2006 and is based in Vaasa, Finland.","Lion Group Holding Ltd., together with its subsidiaries, operates a trading platform for corporate clients, individual traders, and retail investors. Its trading platform offers a range of products and services comprising contracts for difference trading, insurance brokerage, futures and securities brokerage, total return swap trading, and asset management services. The company's trading platform allows users to trade various futures products on futures exchanges worldwide, including the Chicago Mercantile Exchange, Singapore Exchange, the Hong Kong Futures Exchange, and Eurex Exchange; stocks listed on the New York Stock Exchange, Nasdaq and Hong Kong Stock Exchange; and the People's Republic of China stocks listed on the Shanghai Stock Exchange and Shenzhen Stock Exchange that are eligible for the Shanghai-Hong Kong Stock Connect and Shenzhen-Hong Kong Stock Connect programs. It also creates, mints, and sells the MetaWords NFTs; and operates Lion NFT platform for buying and selling the MetaWords NFTs. The company has a strategic partnership with Dawa Future Graphic Technology Co., Ltd. to develop its Lion World Metaverse project. Lion Group Holding Ltd. was founded in 2015 and is headquartered in Singapore.","The LGL Group, Inc., together with its subsidiaries, engages in the design, manufacture, and marketing of frequency and spectrum control products in the United States and internationally. The company operates through two segments, Electronic Components and Electronic Instruments. The Electronic Components segment offers clock oscillators, VCXO, TCXO OCXO, and DOCXO devices; and radio frequency, microwave and millimeter wave filters, diplexers, and solid-state power amplifiers. It also provides filter devices, which includes crystal, ceramic, LC, tubular, combline, cavity, interdigital, and metal insert waveguide, as well as digital, analog and mechanical tunable filters, switched filter arrays, and RF subsystems. This segment's products are used in infrastructure equipment for the telecommunications and network equipment industries; and electronic systems for applications in defense, aerospace, earth-orbiting satellites, down-hole drilling, medical devices, instrumentation, industrial devices, and global positioning systems. The Electronic Instruments segment designs and manufactures frequency and time reference standards, distribution amplifiers, redundancy auto switches, and NTP servers for timing and synchronization in various applications. Its products are used in computer networking, satellite ground stations, electric utilities, broadcasting, and telecommunication systems. The company was formerly known as Lynch Corporation and changed its name to The LGL Group, Inc. The LGL Group, Inc. was founded in 1917 and is based in Orlando, Florida.","Land and Houses Public Company Limited engages in the property development activities in Thailand and the United States. It operates in two segments, Real Estate Business, and Rental and Service Business. The company's Real Estate Business segment develops and sells single detached houses, townhouses, and residence condominium projects. Its Rental and Service Business segment is involved in the rental of shopping malls, hotels, and apartments. The company also offers project administration and management, and investment advisory services. Land and Houses Public Company Limited was founded in 1973 and is headquartered in Bangkok, Thailand.","Linc Limited manufactures and markets writing instruments and stationery products in India and internationally. The company offers gel, ball, roller, retractable ball, and fountain pens; markers/hi-lighters; stationery, including pencils, geometry boxes, printed pencils, erasers, mechanical pencils, and files and folders; and disinfectants under the Linc brand. It also imports and distributes stationery products. The company was formerly known as Linc Pen &amp; Plastics Limited and changed its name to Linc Limited in October 2021. Linc Limited was founded in 1976 and is headquartered in Kolkata, India.","Loomis AB (publ) provides solutions for the distribution, handling, storage, and recycling of cash and other valuables in Sweden and internationally. The company offers a range of solutions for cash in transit, cash management services, physical foreign currency, ATMs, and international valuables logistics, as well as operates Loomis Pay, an end-to-end payment platform for merchants. It serves banks, retailers, and other operators. As of February 3, 2022, the company operated through a network of approximately 400 branches. Loomis AB (publ) was founded in 1852 and is headquartered in Stockholm, Sweden.","The Liberty SiriusXM Group, through its subsidiaries, engages in the entertainment business in the United States and Canada. It features music, sports, entertainment, comedy, talk, news, traffic, weather channels, podcast, and infotainment services through proprietary satellite radio systems, as well as streamed through applications for mobile and home devices, and other consumer electronic equipment. It also offers connected vehicle services; a suite of data services that include graphical weather, fuel prices, sports schedules and scores, and movie listings; and traffic information services, which provide information as to road closings, traffic flow and incident data to consumers with compatible in-vehicle navigation systems, and real-time weather services in vehicles, boats, and planes. In addition, the company operates a music, comedy, and podcast streaming platform. Further, it offers ad-supported radio services; Pandora Plus, a radio subscription service; and Pandora Premium, an on-demand subscription service. Additionally, the company distributes satellite radios through automakers and retailers, as well as through its website. As of December 31, 2021, it served approximately 34.0 million subscribers through Sirius XM and approximately 6.4 million subscribers through Pandora. The Liberty SiriusXM Group is headquartered in Englewood, Colorado. The Liberty SiriusXM Group is a subsidiary of Liberty Media Corporation.","LTIMindtree Limited, a technology consulting and digital solutions company, provides information technology services and solutions in India, North America, Europe, and internationally. The company operates through Banking, Financial Services &amp; Insurance; Hi-Tech, Media &amp; Entertainment; Manufacturing &amp; Resources; Retail, CPG &amp; Travel, Transport &amp; Hospitality; and Health &amp; Public Services. It offers cloud and infrastructure services, consulting, cyber security, data and insights, digital engineering, disruptive SaaS, enterprise application, platform operation, RPA, and testing services. The company serves various industries, such as banking and financial services, energy, utilities, healthcare, Hi-tech, insurance, life sciences, manufacturing, retail and consumer packaged goods, travel, transport, and hospitality, as well as communications, media, and entertainment industries. LTIMindtree Limited has a strategic collaboration agreement with Amazon Web Services, Inc.; a strategic partnership with eClinicalHealth Limited to enhance digital innovation in clinical trials management process for patient centric drug development; and a strategic collaboration with CAST AI to help businesses optimize their cloud investments. The company was formerly known as Larsen &amp; Toubro Infotech Limited and changed its name to LTIMindtree Limited in November 2022. The company was incorporated in 1996 and is based in Mumbai, India. LTIMindtree Limited operates as a subsidiary of Larsen &amp; Toubro Limited.","Lupatech S.A. provides products and services for the oil and gas sector in Brazil and internationally. The company operates in two segments, Products and Services. The Products Segment offers anchoring ropes for platforms in deep waters; automated and manual valves for use in application, exploration, production, transportation, and refining of petroleum and hydrocarbon chain; equipment for completion of petroleum wells, coating, and inspection of drilling and production pipes. The Service Segment provides drilling rig and workover services, well intervention and drilling, and repair services. The company was formerly known as Valmicro Ind\u00fastria e Com\u00e9rcio de V\u00e1lvulas S.A. and changed its name to Lupatech S.A. in March 1993. Lupatech S.A. was founded in 1980 and is based in S\u00e3o Paulo, Brazil.","LexinFintech Holdings Ltd., through its subsidiaries, offers online consumer finance services in the People's Republic of China. The company operates Fenqile.com, an online consumption and consumer finance platform that offers installment purchase and personal installment loans, as well as provides online direct sales with installment payment terms; and Le Hua Card, a scenario-based lending. It also provides technology-driven platform services to increase revenues, manage financial risks, enhance operating efficiency and service quality, enhance collections, and reduce overall costs; Maiya application, a location-based services shopping experience with buy-now and pay-later options; and Juzi Licai, an online investment platform. In addition, the company offers technical support and consulting, software development, financing guarantee, and financial technology services. The company was formerly known as Staging Finance Holding Ltd. and changed its name to LexinFintech Holdings Ltd. in March 2017. LexinFintech Holdings Ltd. was incorporated in 2013 and is headquartered in Shenzhen, the People's Republic of China.","Vedant Fashions Limited engages in manufacture and trading of wedding and celebration wear in India and internationally. The company's products include men's ethnic and celebration wear items, such as Indo-western, sherwanis, and kurtas; jackets and accessories; women's ethnic and celebration wear items consisting of lehengas, sarees, stitched suits, and kurtis; and lehengas, gowns, frocks, kurtas, suits and accessories for kids. It offers its products under the Manyavar, Twamev, Manthan, Mohey and Mebaz brands. It sells its products through a network of franchise-owned exclusive brand outlets, multi-brand outlets, and large format stores; and online platforms, including its website, www.manyavar.com and mobile application. The company was incorporated in 2002 and is headquartered in Kolkata, India.","Mastek Limited, together with its subsidiaries, engages in the provision of enterprise technology solutions in India, the United Kingdom, Europe, the United States, the Middle East, and internationally. The company offers digital and application engineering, including platform development, cloud development and migration, microservices/low code, IPaaS, DevOps, and API solutions. It also provides oracle cloud and enterprise apps, such as enterprise resource planning, customer relationship management, supply chain management, human capital management, and industry cloud solutions, as well as Oracle-, Salesforce-, digital-, and commerce-managed services. In addition, the company offers digital commerce and experience solutions comprising commerce, experience platform, search and intelligent recommendation, and modern UI/UX solutions. Further, it provides data, automation, and artificial intelligence solutions, such as data warehousing, reporting, datalakes, cloud data warehouse, data virtualization, analytics/machine learning, and hyper automation, as well as extract, transform and load (ETL) solutions. Additionally, the company offers cloud enhancement, software application development and maintenance, business intelligence, testing and assurance, digital commerce, agile consulting, and legacy modernization services. It serves government, public sector, healthcare, life science, retail, consumer, manufacturing and technology, financial services, and other sectors. Mastek Limited was incorporated in 1982 and is based in Mumbai, India.","MCOT Public Company Limited, together with its subsidiaries, engages in the mass media business in Thailand. It operates through Television business, Radio broadcasting business, Digital terrestrial television broadcasting business, and Digital and new businesses segments. The company provides digital terrestrial television (TV) broadcasting network services, including a high definition variety and standard definition family channels with programs comprising news and situation report, entertainment, edutainment, general knowledge, and sports; and engages in the production, marketing, and management of broadcasting various informative and entertaining radio programs through a network of 62 central and regional radio stations broadcasting in FM and AM frequencies in the areas of politics, economy, society, foreign affairs, technology, life balance, music, sports, tourism, health and recreation activities, and news reports, as well as public and local interest programs. It is also involved in the production, gathering, storage, and dissemination of news and information through various media platforms, including Modernine Television Station, 9 MCOT HD Channel 30, and radio station network, as well as electronic media comprising website, social media, cooperation, and news exchange with foreign news agencies and other media channels. In addition, the company offers satellite TV rental services; television network services; digital media services through the internet and other platforms; and operates academic and training institute that provides a range of mass media training courses. MCOT Public Company Limited was founded in 1977 and is headquartered in Bangkok, Thailand.","Mount Gibson Iron Limited, together with its subsidiaries, engages in the mining, crushing, processing, transportation, and sale of hematite iron ore in Australia. The company primarily holds interests in the Extension Hill mine and Shine mine deposit in the Mid-West region of Western Australia, as well as operates haulage of the ore through road and rail for export from the Geraldton Port. It is also involved in the mining and direct shipment of hematite iron ore at the Koolan Island mine site in the Kimberley region of Western Australia; and the treasury management activities. Mount Gibson Iron Limited was incorporated in 1938 and is headquartered in West Perth, Australia.","MCAN Mortgage Corporation operates as a loan and mortgage investment corporation in Canada. The company offers single-family residential mortgages, as well as residential construction, non-residential construction, and commercial loans, as well as engages in the real estate investments trusts and private investment activities. It also provides term deposits through a network of independent financial agents. The company was formerly known as MCAP Inc. and changed its name to MCAN Mortgage Corporation in September 2006. MCAN Mortgage Corporation was founded in 1980 and is headquartered in Toronto, Canada.","The Mosaic Company, through its subsidiaries, produces and markets concentrated phosphate and potash crop nutrients in North America and internationally. The company operates through three segments: Phosphates, Potash, and Mosaic Fertilizantes. It owns and operates mines, which produce concentrated phosphate crop nutrients, such as diammonium phosphate, monoammonium phosphate, and ammoniated phosphate products; and phosphate-based animal feed ingredients primarily under the Biofos and Nexfos brand names, as well as produces a double sulfate of potash magnesia product under K-Mag brand name. The company also produces and sells potash for use in the manufacturing of mixed crop nutrients and animal feed ingredients, and for industrial use; and for use in the de-icing and as a water softener regenerant. In addition, it provides nitrogen-based crop nutrients, animal feed ingredients, and other ancillary services; and purchases and sells phosphates, potash, and nitrogen products. The company sells its products to wholesale distributors, retail chains, farmers, cooperatives, independent retailers, and national accounts. The Mosaic Company was incorporated in 2004 and is headquartered in Tampa, Florida.","Moshi Moshi Retail Corporation Public Company Limited engages in the retail and wholesale of lifestyle products in Thailand. It sells home furnishings, bags, pens, pencils, notebooks, stickers, rulers, folders, plush toys, fashion items, t-shirts, long sleeves, shorts, pajamas, beauty accessories, hats, scarves, sunglasses, shoes, perfumes, hand creams, and body lotions. The company also offers IT equipment, bluetooth speakers, headphones, mobile phone chargers, toys, food and drink products, cloth masks, keychains, eyebrow pencils, lipsticks, candies, COVID-19 testing kits, rugs, picture frames, and artificial plants. In addition, the company sells its products online. The company was founded in 2000 and is based in Bangkok, Thailand.","Motilal Oswal Financial Services Limited offers financial services in India. It operates through Broking and Other Related Activities, Fund Based Activities, Asset Management and Advisory, Investment Banking Services, and Home Finance segments. The company offers broking and distribution services, such as equities, derivatives, commodities, currencies, mutual funds, insurance products, and other investment products; primary equity offerings; and depository, portfolio management, and asset management services. It also provides private wealth management services, such as equity, alternate, credit solutions, estate planning, will making, and property advisory services; and home loans. In addition, the company offers institutional broking services, including cash and derivatives; private equity services; and investment banking advisory and transaction solutions, including private placement of equity, mergers and acquisitions advisory, and equity capital markets transactions. It serves high net worth individuals; and mutual funds, foreign institutional investors, financial institutions, and corporate clients. Motilal Oswal Financial Services Limited was founded in 1987 and is headquartered in Mumbai, India. Motilal Oswal Financial Services Limited operates as a subsidiary of Passionate Investment Management Private Limited.","Motorcar Parts of America, Inc. manufactures, remanufactures, and distributes heavy-duty truck, industrial, marine, and agricultural application replacement parts. The company offers rotating electrical products, including alternators and starters; wheel hub assemblies and bearings; and brake-related products comprising brake calipers, brake boosters, brake rotors, brake pads, and brake master cylinders. It also offers test solutions and diagnostic equipment for electric vehicle powertrain development and manufacturing, including electric motor test systems, e-axle test systems, advanced power emulators, and charging unit test systems, as well as test systems for alternators, starters, belt starter generator, and bench-top testers, as well as turbochargers and test services for electric vehicle inverters. The company sells its products to automotive retail chain stores and warehouse distributors, as well as various automobile manufacturers for their aftermarket programs and warranty replacement programs in North America. Motorcar Parts of America, Inc. was founded in 1968 and is headquartered in Torrance, California.","Mphasis Limited operates as an information technology solutions provider that specializes in cloud and cognitive services worldwide. The company operates through Banking and Financial Service; Logistics and transportation; Technology Media and Telecom; Insurance; and Others segments. It offers application, blockchain, business process, cyber security, DevOps, AI, digital, enterprise automation, design, infrastructure, modernization, data, and product engineering, as well as governance, risk, and compliance services. The company serves banking and capital markets, asset management, corporate banking, investment banking, mortgage, retail banking, and wealth management and brokerage industries, as well as insurance, healthcare and life sciences, payments, travel and transportation, communications, energy and utilities, logistics, manufacturing, oil and gas, and public sectors. Mphasis Limited was incorporated in 1992 and is based in Bengaluru, India.","Mphasis Limited operates as an information technology solutions provider that specializes in cloud and cognitive services worldwide. The company operates through Banking and Financial Service; Logistics and transportation; Technology Media and Telecom; Insurance; and Others segments. It offers application, blockchain, business process, cognitive, cyber security, DevOps, digital, enterprise automation, design, infrastructure, modernization, data, product engineering, and cloud, as well as governance, risk, and compliance services. The company serves banking and capital markets, asset management, corporate banking, investment banking, mortgage, retail banking, and wealth management and brokerage industries, as well as insurance, healthcare and life sciences, payments, hospitality, travel and transportation, communications, energy and utilities, logistics, manufacturing, oil and gas, and public sectors. Mphasis Limited was incorporated in 1992 and is based in Bengaluru, India.","Melcor Developments Ltd. operates as a real estate development company in the United States and Canada. The company operates through Community Development, Property Development, REIT, Investment Property, and Recreational Property segments. It develops, manages, and owns mixed-use residential communities, business and industrial parks, office buildings, retail centers, and golf courses. The company purchases and develops land to be sold as residential, industrial, and commercial lots; develops, constructs, and leases retail, office, and industrial properties; and owns and leases commercial, retail, and residential properties, as well as parking lots and land. It also owns and manages three 18-hole golf courses. Melcor Developments Ltd. was founded in 1923 and is headquartered in Edmonton, Canada.","Metro Systems Corporation Public Company Limited, together with its subsidiaries, engages in trading computers and equipment, software, supplies, and office equipment, as well as provision of related services in Thailand. The company provides server, storage, and network for IT infrastructure; backup, modernized application, and IBM i solutions for infrastructure; hardware, contractual, supplies, and outsourcing printing and services solutions for digital printing; and compute, network, storage, HCI, private, hybrid, public cloud, middleware and other, database, API, and backup and DR, as well as operating systems for digital infrastructure. It also offers businesses transformation, architecture design, application development, and infrastructure and managed service for digital transformation services; workforce and unified collaboration, mobility workforce, business process automation, and IT process management for digital collaboration; and SOLIDWORKS 3D CAD, simulation, electrical design, SOLIDWORKS product data management, and technical communication for designed and engineering solutions. In addition, the company provides data integration tools, data platform, BI and data visualization, advance analytics and AI/ML, and data scientist platform for data and analysis. Further, it offers end point, network, server and data, cloud, and mobility security solutions; and training and services. Additionally, the company provides office supplies, as well as engages in the sale, and maintenance and services of computer and computer programs. Metro Systems Corporation Public Company Limited was founded in 1985 and is headquartered in Bangkok, Thailand.","MSC Industrial Direct Co., Inc., together with its subsidiaries, distributes metalworking and maintenance, repair, and operations (MRO) products and services in the United States, Canada, Mexico, and the United Kingdom. Its MRO products include cutting tools, measuring instruments, tooling components, metalworking products, fasteners, flat stock products, raw materials, abrasives, machinery hand and power tools, safety and janitorial supplies, plumbing supplies, materials handling products, power transmission components, and electrical supplies. The company offers approximately 1.9 million stock-keeping units through its catalogs and brochures; e-commerce channels, including its Website, mscdirect.com; inventory management solutions; and call-centers and branches. It operates through a distribution network of 28 branch offices, 11 customer fulfilment centers, and seven regional inventory centers. The company serves individual machine shops, Fortune 1000 manufacturing companies, and government agencies, as well as manufacturers of various sizes. MSC Industrial Direct Co., Inc. was founded in 1941 and is headquartered in Melville, New York.","Mt Monger Resources Limited, through its subsidiaries, engages in the exploration of mineral tenements in Western Australia. It explores for gold, base metals, lithium, nickel, cobalt, graphite, and rare earth elements. The company holds interests in the Mt Monger Gold project that comprises six granted exploration licenses, two pending exploration licenses, and three granted prospecting licenses covering an area of approximately 100 square kilometers; and the East Laverton Gold Project that consists of twelve exploration licenses covering an area of approximately 3,000 square kilometers located in Western Australia. It also holds interests in the Ravensthorpe project tenements comprising eleven granted exploration licenses and one exploration license application covering an area of approximately 1,500 square kilometers located within the Albany-Fraser Orogen of Western Australia. In addition, the company holds an option agreement to explore and acquire a 100% interest in the Albion gold project that comprises a total area of 4 graticular blocks located near Norseman in Western Australia. Mt Monger Resources Limited was incorporated in 2020 and is based in West Perth, Australia.","Multiplan Empreendimentos Imobili\u00e1rios S.A. engages in the planning, development, construction, and sale of real estate projects in Brazil. The company develops residential or commercial properties, including urban shopping malls. It is also involved in the purchase and sale of real estate properties, as well as acquisition and disposal of real estate rights, and its operation through leasing. In addition, the company provides management and administrative services for own or third party shopping malls; technical advisory and support services concerning real estate matters; and civil construction, construction works execution, and engineering and related services. Further, it engages in the planning, development, management, promotion, and intermediation of real estate projects; import and export of goods and services related to its activities; generation and sale of electric power; and acquisition of ownership interests and share control in other entities. The company was founded in 1974 and is based in Rio de Janeiro, Brazil.","NFC Public Company Limited, together with its subsidiaries, engages in the sale of chemical products and other chemical related services in Thailand. The company produces and sells ammonia, ammonium hydroxide, and sulfuric acid. It also offers wharf frontage, warehousing, logistics and liquid storage, yard, and port services. The company was formerly known as NFC Fertilizer Public Company Limited and changed its name to NFC Public Company Limited in June 2017. NFC Public Company Limited was incorporated in 1982 and is headquartered in Bangkok, Thailand.","NGL Energy Partners LP engages in the transportation, storage, blending, and marketing of crude oil, natural gas liquids, refined products / renewables, and water solutions. The company operates in three segments: Water Solutions, Crude Oil Logistics, and Liquids Logistics. The Water Solutions segment transports, treats, recycles, and disposes produced and flowback water generated from oil and natural gas production; aggregates and sells recovered crude oil; disposes solids, such as tank bottoms, and drilling fluid and muds, as well as performs truck and frac tank washouts; and sells produced water for reuse and recycle, and brackish non-potable water. The Crude Oil Logistics segment purchases crude oil from producers and marketers, and transports it to refineries for resale at pipeline injection stations, storage terminals, barge loading facilities, rail facilities, refineries, and other trade hubs; and provides storage, terminaling, and transportation services through pipelines. The Liquids Logistics segment supplies natural gas liquids, refined petroleum products, and biodiesel to commercial, retail, and industrial customers in the United States and Canada through its 24 terminals, third-party storage and terminal facilities, and nine common carrier pipelines, as well as through fleet of leased railcars. This segment is also involved in the marine export of butane through its facility located in Chesapeake, Virginia. NGL Energy Holdings LLC serves as the general partner of the company. The company was founded in 1940 and is headquartered in Tulsa, Oklahoma.","Noble Development Public Company Limited, together with its subsidiaries, develops and sells real estate properties in Thailand. The company offers construction, rental and service, and construction consulting services. Its properties comprise land plots, single detached houses, townhouses, and condominium units. In addition, the company provides project management and after housing delivery services. The company was founded in 1991 and is headquartered in Bangkok, Thailand.","NOV Inc. designs, constructs, manufactures, and sells systems, components, and products for oil and gas drilling and production, and industrial and renewable energy sectors worldwide. The company operates through three segments: Wellbore Technologies, Completion &amp; Production Solutions, and Rig Technologies. It also provides solids control and waste management equipment and services; portable power generation products; drill and wired pipes; drilling optimization and automation services; tubular inspection, repair, and coating services; instrumentation; measuring and monitoring services; downhole and fishing tools; steerable technologies; and drill bits. The company offers equipment and technologies for hydraulic fracture stimulation, including downhole multistage fracturing tools, pressure pumping trucks, blenders, sanders, hydration and injection units, flowline, and manifolds; coiled tubing units, and wireline units and tools; connections and liner hangers; onshore production consists of composite pipe, surface transfer and progressive cavity pumps, and artificial lift systems; and offshore production, such as floating production systems and subsea production technologies, as well as manufactures industrial pumps and mixers. It also provides substructures, derricks, and masts; cranes; jacking systems; pipe lifting, racking, rotating, and assembly systems; mud pumps; pressure control equipment; drives and generators; rig instrumentation and control systems; mooring, anchor, and deck handling machinery; equipment components for offshore wind construction vessels; and pipelay and construction systems. NOV Inc. offers spare parts, repair, and rentals as well as comprehensive remote equipment monitoring, technical support, field service, and customer training. The company was formerly known as National Oilwell Varco, Inc. and changed its name to NOV Inc. in January 2021. NOV Inc. was founded in 1862 and is based in Houston, Texas.","Nexus Minerals Limited engages in the exploration of mineral properties in Western Australia. It explores for gold and copper deposits. The company holds interests in the Wallbrook, Pinnacles, and Mt Celia gold projects located to the 22east of Kalgoorlie in the Eastern Goldfields; and Bethanga porphyry copper gold project tenements covering and area of approximately 194 square kilometers located in northeast Victoria. The company was formerly known as Hemisphere Resources Limited. Nexus Minerals Limited was incorporated in 2006 and is based in West Perth, Australia.","Nyesa Valores Corporaci\u00f3n, S.A., together with its subsidiaries, develops real estate projects in Spain and internationally. It purchases and sells plots, buildings, urban management, and lease heritage assets. The company also produces, transforms, and commercializes industrial products related to the construction sector. In addition, it operates hotel establishments and provides business consulting services. The company was formerly known as Industrias del Besos, S.A. and changed its name to Nyesa Valores Corporaci\u00f3n, S.A. in June 2010. Nyesa Valores Corporaci\u00f3n, S.A. was founded in 1950 and is headquartered in Madrid, Spain.","Oceania Healthcare Limited, together with its subsidiaries, owns and operates various retirement village and aged care centers in New Zealand. The company operates through three segments: Care Operations, Village Operations, and Other. It provides rest home, hospital, and dementia; independent living and rental properties for retirement villages; and provides support services, which includes administration, marketing, and operations. The company was formerly known as Retirement Care (NZ) Limited and changed its name to Oceania Healthcare Limited in September 2014. Oceania Healthcare Limited was incorporated in 2005 and is based in Auckland, New Zealand.","Omnicell, Inc., together with its subsidiaries, provides medication management solutions and adherence tools for healthcare systems and pharmacies the United States and internationally. The company offers point of care automation solutions to improve clinician workflows in patient care areas of the healthcare system; XT Series automated dispensing systems for medications and supplies used in nursing units and other clinical areas of the hospital, as well as specialized automated dispensing systems for operating room; Omnicell Interface Software that offers interface and integration between its medication-use products or supply products, and a healthcare facility's in-house information management systems; and robotic dispensing systems for handling the stocking and retrieval of boxed medications. It also provides central pharmacy automation solutions, including automated storage and retrieval systems, such as XR2 Automated Central Pharmacy System; IV compounding robots and workflow management systems; inventory management software; and controlled substance management systems. In addition, the company provides single-dose automation solutions that fill and label a variety of patient-specific, single-dose medication blister packaging based on incoming prescriptions; fully automated and semi-automated filling equipment for institutional pharmacies to warrant automated packaging of medications; and medication blister card packaging and packaging supplies to enhance medication adherence in non-acute care settings. Further, it offers EnlivenHealth Patient Engagement, a web-based nexus of solutions. The company was formerly known as Omnicell Technologies, Inc. and changed its name to Omnicell, Inc. in 2001. Omnicell, Inc. was incorporated in 1992 and is headquartered in Mountain View, California.","Patterson Companies, Inc. engages in distribution of dental and animal health products in the United States, the United Kingdom, and Canada. The company operates through three segments: Dental, Animal Health, and Corporate segments. The Dental segment offers consumable products, including infection control, restorative materials, and instruments; basic and advanced technology and dental equipment; practice optimization solutions, such as practice management software, e-commerce, revenue cycle management, patient engagement solutions, and clinical and patient education systems. It also provides a range of related services comprising software and design services, maintenance and repair, and equipment financing. The Animal Health segment distributes biologicals, pharmaceuticals, vaccines, parasiticides, diagnostics, prescription and non-prescription diets, nutritional's, consumable supplies, equipment, and software, as well as value-added services. This segment also provides private label portfolio of products to veterinarians, producers, and retailers under the Aspen, First Companion, and Patterson Veterinary brands. The Corporate segment offers customer financing services; and sells other miscellaneous products. It serves dentists, laboratories, institutions, other healthcare professionals, veterinarians, other animal health professionals, production animal operators, and animal health product retailers. The company was formerly known as Patterson Dental Company and changed its name to Patterson Companies, Inc. in June 2004. Patterson Companies, Inc. was founded in 1877 and is headquartered in Saint Paul, Minnesota.","Pantera Minerals Limited engages in the exploration and development of mineral properties in Australia. It explores for iron ore, copper, manganese, and polymetallic deposits. The company holds an 80% interest in the Yampi iron ore project comprising one granted exploration license and four exploration license applications covering an area of approximately 640 square kilometers (km2); and 100% interest in the Yampi copper, which comprises exploration license that covers an area of 17 km2 located in the Buccaneer Archipelago of the Kimberley Region of Western Australia. It also holds 100% interests in the Weelarrana manganese project comprising two granted exploration licenses that covers an area of approximately 242 km2 and four tenement applications that covers an area of 525 km2 located in the Ashburton region of Western Australia; 100% interest in the Frederick Polymetallic project that comprises one exploration license covering an area of approximately 88 km2 located in the Upper Gascoyne region of Western Australia; and 80% interest in the Hellcat project comprising four granted exploration licenses that covers an area of approximately 422 km2 and one exploration license application covering an area of 128 km2 located in the Mid-West region of Western Australia. The company was incorporated in 2020 and is based in West Perth, Australia.","Personal Group Holdings Plc provides short-term accident and health insurance services, SaaS products, and salary sacrifice technology products in the United Kingdom. The company operates through Affordable Insurance, Other Owned Benefits, Benefits and Platform, and Pay and Reward segments. It offers insurance products, including hospital plans, convalescence plans, and death benefit plans; and consultancy and software solutions on pay and reward services, as well as a suite of cloud-based Saas tools. The company also operates HAPI, a proprietary digital platform that allows employees to access financial, physical, mental, and social benefits; and Let's Connect, which enables employers to provide a benefit scheme that allows their employees to access consumer technology and other products from manufacturers through salary sacrifice. Personal Group Holdings Plc was founded in 1984 and is based in Milton Keynes, the United Kingdom.","Pinthong Industrial Park Public Company Limited develops and manages industrial estates and logistics parks. The company manages and develops real estate properties and factory buildings, as well as provides warehouses for rent. It serves in Japan, Thailand, China, and Taiwan. Pinthong Industrial Park Public Company Limited was founded in 1995 and is based in Chonburi, Thailand.","Planet Labs PBC designs, constructs, and launches constellations of satellites with the intent of providing high cadence geospatial data delivered to customers through an online platform worldwide. The company offers Open Geospatial Consortium, a cloud-native proprietary technology that performs critical processing and overall harmonizing of images for time series and data fusion and analysis; and space-based hardware and related software systems. It serves agriculture, mapping, forestry, and finance and insurance, as well as federal, state, and local government bodies. The company was incorporated in 2010 and is headquartered in San Francisco, California.","Plurilock Security Inc. operates an identity-centric cybersecurity company in the United States and Canada. It operates in two divisions, Technology and Solutions. The company offers Plurilock DEFEND, an enterprise continuous authentication platform that confirms user identity or alerts security teams to detected intrusions in real time; and Plurilock ADAPT, a standards-based login MFA platform, which provides added login security without relying on fingerprint scans, SMS codes, authenticator apps, hardware tokens, or other intrusive legacy MFA requirements. It also offers services and resells IT and cybersecurity industry products and technologies. The company serves financial services, healthcare, critical infrastructure, and government and military industries. Plurilock Security Inc. is headquartered in Vancouver, Canada.","Provident Financial Holdings, Inc. operates as the holding company for Provident Savings Bank, F.S.B. that provides community banking services to consumers and small to mid-sized businesses in the Inland Empire region of Southern California. Its deposit products include checking, savings, and money market accounts, as well as time deposits; and loan portfolio consists of single-family, multi-family, commercial real estate, construction, mortgage, commercial business, and consumer loans. The company also offers investment services comprising the sale of investment products, such as annuities and mutual funds; and trustee services for real estate transactions. It operates through 12 full-service banking offices in Riverside County and one full-service banking office in San Bernardino County. The company was founded in 1956 and is based in Riverside, California.","Public Storage, a member of the S&amp;P 500 and FT Global 500, is a REIT that primarily acquires, develops, owns and operates self-storage facilities. At September 30, 2020, we had: (i) interests in 2,504 self-storage facilities located in 38 states with approximately 171 million net rentable square feet in the United States, (ii) an approximate 35% common equity interest in Shurgard Self Storage SA (Euronext Brussels:SHUR) which owned 239 self-storage facilities located in seven Western European nations with approximately 13 million net rentable square feet operated under the \u0093Shurgard\u0094 brand and (iii) an approximate 42% common equity interest in PS Business Parks, Inc. (NYSE:PSB) which owned and operated approximately 28 million rentable square feet of commercial space at September 30, 2020. Our headquarters are located in Glendale, California.","Far East H-Trust is a Singapore-Focused Hotel and Serviced Residence Hospitality Trust listed on the Main Board of The Singapore Exchange Securities Trading Limited (\u0093SGX-ST\u0094). Comprising Far East Hospitality Real Estate Investment Trust (\u0093Far East H-REIT\u0094) and Far East Hospitality Business Trust (\u0093Far East H-BT\u0094), Far East H-Trust was listed on the SGX-ST on 27 August 2012 and has a portfolio of 13 properties totaling 3,143 hotel rooms and serviced residence units valued at approximately S$2.65 billion as at 31 December 2019. Managed by FEO Hospitality Asset Management Pte. Ltd. and FEO Hospitality Trust Management Pte. Ltd. (collectively, the \u0093Managers\u0094) and sponsored by members of Far East Organization Group (the \u0093Sponsor\u0094), Far East H-Trust seeks to provide Stapled Securityholders with regular, stable and growing distributions on a quarterly basis. Far East H-Trust is listed on the FTSE ST Mid Cap Index.","Quality Houses Public Company Limited, together with its subsidiaries, engages in the property development business in Thailand. It operates in four segments: Real Estate Business, Hotel Business, Rental Business, and Others. The company develops and sells land and houses, and condominium units; rents residential, hotels, and office buildings; and services residential buildings, as well as manages public utilities and real estate business of landowners. It also engages in hotel operations; lease of land; management for rental properties, including hotels, serviced apartments, rental office buildings, and rental residential projects; manufacture and sale of ready-made concrete sheets; and manufacture and distribution of precast concrete. The company was incorporated in 1983 and is headquartered in Bangkok, Thailand.","Randon S.A. Implementos e Participa\u00e7\u00f5es develops and sells transportation solutions. It operates through three segments: Vehicles and Implements, Auto Parts, and Services. The company manufactures and sells truck bodies, trailers, and semitrailers in the areas of bulk, tankers, dry cargos, tippers, silos, refrigerators, sugarcane, forestry, sider models, load everything, and vans; and hopper, gondola, tank, general cargo, platform, telescopic, and others. It also provides railroad cars, off-road trucks, backhoe loaders and other road implements, and special vehicles; sells spare parts and components; and produces and sells friction materials, suspensions, axles, brake, and coupling and rolling systems, as well as products and components for motion control and vehicle testing. In addition, the company provides financial and digital services; and develops and manages experimental research projects and technological solutions in automation and industrial robotics. It operates sales and service network in approximately 120 countries, including Brazil, Argentina, India, Uruguay, Holland, Colombia, Peru, Chile, Mexico, Canada, the United States, Africa, and Mercosur. The company was formerly known as Randon Participa\u00e7\u00f5es S.A. and changed its name to Randon S.A. Implementos e Participa\u00e7\u00f5es in November 2003. Randon S.A. Implementos e Participa\u00e7\u00f5es was founded in 1949 and is headquartered in Caxias do Sul, Brazil.","Revolution Bars Group plc operates premium bars located in towns or city center high streets across the United Kingdom. Its bars offer food and drinks. As of November 15, 2021, the company operated 67 bars, including 49 bars under the Revolution and 18 under the Revoluci\u00f3n de Cuba brand names. Revolution Bars Group plc was founded in 1991 and is headquartered in Ashton-Under-Lyne, the United Kingdom.","Resource Development Group Limited provides contracting, remedial, and construction services to the resource, infrastructure, energy, government, utilities, and defense sectors in Australia. The company offers multi-disciplinary construction and remedial services, such as civil, SMPT, E&amp;I, and non-process infrastructure building works; ancillary and protective maintenance services; EPCM, PMC, or integrated team project delivery solutions; EPC project delivery solutions; design and construct package delivery solutions; and optimizing services comprising debottlenecking existing operations. It also holds interest in the Ant Hill and Sunday Hill manganese project; the Lucky Bay Garnet project and associated power infrastructure project, including seven wind turbines; and offers construction and plant modification services. The company was incorporated in 2011 and is headquartered in Perth, Australia. Resource Development Group Limited operates as a subsidiary of Mineral Resources Limited.","Reitmans (Canada) Limited primarily engages in the retail sale of women's wear apparel in Canada. It also offers apparel for men. The company serves customers through retail and e-commerce channels. As of April 21, 2022, it operated 404 stores, including 237 Reitmans, 90 Penningtons, and 77 RW&amp;CO. The company was founded in 1926 and is headquartered in Montreal, Canada.","Realia Business, S.A., together with its subsidiaries, engages in property management and homebuilding activities in Spain and internationally. It develops, manages, operates, and leases office buildings, shopping centers, commercial premises, and industrial buildings; and provides land management services. It has a land portfolio of 6,946,216 gross square meters and 1,752,340 square meters of buildable land. The company was founded in 2000 and is headquartered in Madrid, Spain.","The RMR Group Inc., through its subsidiary, The RMR Group LLC, provides business and property management services in the United States. The company provides management services to its four publicly traded real estate investment trusts and three real estate operating companies. It also provides investment advisory services. The company was formerly known as REIT Management &amp; Research Inc. and changed its name to The RMR Group Inc. in September 2015. The RMR Group Inc. was founded in 1986 and is headquartered in Newton, Massachusetts.","Roots Corporation, together with its subsidiaries, designs, markets, and sells apparel, leather goods, footwear, and accessories under the Roots brand in Canada and internationally. The company operates through two segments, Direct-To-Consumer, and Partners and Other. The Direct-to-Consumer segment sells products through the company's corporate retail stores and e-commerce. The Partners and Other segment engages in the wholesale of Roots branded products to the company's international operating partners, licensees, and wholesale customers. As of January 29, 2022, it operated 107 corporate retail stores in Canada, two stores in the United States, and approximately 100 partner-operated stores in Asia, as well as a Taiwan-based eCommerce site, www.roots.com.tw. Roots Corporation was founded in 1973 and is headquartered in Toronto, Canada.","RESAAS Services Inc. engages in the development of web and mobile communications software for the real estate industry. The company offers a suite of tools, which integrate with the platform, including a global referral network, lead generation engine, listing management, client engagement modules, customer relationship management tools, analytics, file sharing, payment system, and advertising engine. Its solutions include RealTimeMLS, a real-time listing solution and communication platform designed for real estate associations and multiple listing services (MLSs); and BrokerOS, an online communication hub that ensures agents open, read, and respond to the emails and messages sent to them by users. It serves MLSs, franchises, and real estate brokerage and real estate agents in the real estate industry. The company was incorporated in 2009 and is based in Vancouver, Canada.","SMT Scharf AG engages in the development, manufacture, and service of transportation equipment and logistics systems for underground mining and tunnel construction. The company operates through four segments: Coal Mining, Mineral Mining, Tunnel, and Other Industries. It offers monorail and duorail systems, chairlift systems, segment cranes, lifting devices, explosive and placement devices, drilling and splitting tools, construction site cranes, battery and diesel locomotives, muckmasters, lift working platform, cable drive, mini climbers, light electric vehicles, and climbing locomotive products. The company's products are primarily used in hard coal, gold, platinum, copper, nickel, and salt mining activities. It has operations in Germany, Russia and rest of CIS states, Poland, China, Africa, the United States, and internationally. SMT Scharf AG was founded in 1941 and is headquartered in Hamm, Germany.","Sandy Spring Bancorp, Inc. operates as the bank holding company for Sandy Spring Bank that provides commercial and retail banking, mortgage, private banking, and trust services to individuals and businesses. It operates through three segments: Community Banking, Insurance, and Investment Management. The Community Banking segment offers financial products and services, including various loan and deposit products. Its loan products include commercial real estate loans, commercial construction loans, and other commercial loans; residential real estate loans; and consumer loans comprising home equity loans and lines, installment loans, and personal lines of credit. The Insurance segment provides general insurance agency services and annuities, such as commercial, personal, and medical liability lines. The Investment Management segment offers investment management and financial planning, including cash flow analysis, investment review, tax and retirement planning, insurance analysis, and estate planning to individuals, families, small businesses, and associations. It also provides personal trust and wealth management services. The company operates a network of approximately 50 locations in Maryland, Northern Virginia, and Washington D.C. Sandy Spring Bancorp, Inc. was founded in 1868 and is headquartered in Olney, Maryland.","Shriro Holdings Limited, together with its subsidiaries, manufactures and distributes kitchen appliances and consumer products in Australia and New Zealand. The company offers home appliances, watches, calculators, electronic musical instruments, audio equipment, heaters, fans, laundry products, consumer electronics, car audio, amplifiers, professional DJ, hi-fi speakers, and heating and cooling products. In addition, it provides barbeques and accessories. The company markets and distributes its products under its own brands, including Omega, Robinhood, Everdure, and Omega Altise; and third party owned brands, such as Casio, Blanco, and Pioneer. Shriro Holdings Limited was founded in 1982 and is headquartered in Chatswood, Australia.","Shriram Finance Limited, a non-banking finance company, primarily provides commercial vehicle financing services in India. It offers commercial vehicle loans for commercial goods vehicles, passenger vehicles, tractors and farm equipment, and construction equipment. The company also provides business loans; fixed and recurring deposits; and working capital loans, including tyre, tax, fuel, and toll finance, as well as vehicle insurance and repair/top-up loans. In addition, it offers challan discounting services; life and general insurance products; consumer finance services; emergency credit line guarantee schemes; stock broking services; and chit and mutual funds. As of March 31, 2022, it operated a network of 1,854 branches. The company also offers its products through 775 rural centers; and partnerships with 500 private financiers. It primarily serves first time buyers, driver-turned-owners, and small road transport operators. The company was formerly known as Shriram Transport Finance Company Limited and changed its name to Shriram Finance Limited in November 2022. Shriram Finance Limited was incorporated in 1979 and is headquartered in Mumbai, India.","Siebert Financial Corp., through its subsidiaries, engages in the retail discount brokerage and investment advisory businesses in the United States and Internationally. It offers discount brokerage services, including self-directed trading, wealth management, financial advice, market making and fixed income investment, stock borrow, equity compensation plans, securities lending, equity stock plan, and market making services; independent retail execution services; and retail customer services. The company also offers self-directed retirement accounts, as well as lends customers a portion of the market value of marginable securities held in the customer's account. In addition, the company provides data technology platform that offers various services, such as email and messaging, market data systems and third party trading systems, business productivity tools, and customer relationship management systems. Further, it offers a Robo-Advisor platform that provides clients with an automated wealth management solution; and various insurance products, such as fixed annuities, personal insurance, property and casualty insurance, natural disaster insurance, and life and disability. The company has 12 branch offices in the United States. Siebert Financial Corp. was incorporated in 1934 and is headquartered in New York, New York.","Silk Logistics Holdings Limited provides port-to-door landside logistics and supply chain services in Australia. It operates in two segments, Port Logistics and Contract Logistics. The company offers port logistics services, including wharf cartage; and contract logistics services, such as warehousing and distribution. It serves retail, fast moving consumer goods, light industrial, food, and other industries. Silk Logistics Holdings Limited was incorporated in 2013 and is headquartered in Port Melbourne, Australia.","Stars Microelectronics (Thailand) Public Company Limited, together with its subsidiaries, provides electronics manufacturing services in Thailand and the United States. The company operates through two segments, Microelectronics Module Assembly and Integrated Circuit (IC) Packaging. It is involved in the manufacture and distribution of integrated circuit boards and radio frequency identification tags; and equipment used to generate electricity from solar energy or alternative energy. The company also engages in the generation and distribution of electricity from solar energy or alternative energy; and trading business. It provides services to original equipment manufacturers, original design manufacturer, and outsourced assembly and test that offers IC packaging services. The company's services cover IC packaging and testing; print circuit board assembly and box build, which cover Internet of Things, medical devices, industrial control modules, energy management, and automotive devices; and fiber optics devices comprising data center, broadcasting, and LiDAR applications. It serves semiconductor, optics and telecommunication, industrial, automotive, and professional audio and video industries, as well as medical devices The company was founded in 1995 and is headquartered in Phra Nakhon Si Ayutthaya, Thailand.","Saunders International Limited engages in the design, fabrication, construction, and maintenance of bulk liquid storage facilities, tanks, and road and rail bridges in Australia. The company also manufactures precast concrete products for transport infrastructure projects; and provides a range of specialized services for the maintenance of commercial, industrial, and marine infrastructure and assets. In addition, it engages in the designing, engineering, procurement, and construction of fuel and chemical storage terminals, water reservoirs and pumping stations, mineral processing plants, bridge construction works, precast concrete, concrete foundation works for heavy industry, foundation systems, jetty and wharves construction, building and construction management, bridges and marine structures, and water infrastructure, as well as coal bins, hoppers, and associated steel works. Further, the company provides various asset services comprising turn key solutions, shutdowns and refurbishment, furnace and boiler maintenance, pressure welding, air heater overhauls and upgrades, general base line maintenance, refinery and industrial services, pumps and steam valve overhaul, high performance coatings and linings, abrasive blasting and protective coatings, and structural strengthening services, as well as services related to fabrication, general, structural, piping, and pressure equipment. Additionally, it provides electrical instrumentation, and automation and control services. The company offers its products and services to oil and gas, mining and mineral processing, infrastructure, aviation, defense, new energy, power, and water/wastewater industries. Saunders International Limited was founded in 1951 and is based in Rhodes, Australia.","Srinanaporn Marketing Public Company Limited produces and distributes soft drinks and snacks in Thailand. The company offers ready to drink jellies under the Jele and Jele Beautie brand names; squid snacks under the Bento brand; biscuit sticks and seaweed sticks under the Lotus brand name; and coconut juice, soy milk, tamarind, grape juice, black lemon tea, and melon drinks under the Magic Farm brand. It also provides wafers under the Chocky brand; biscuits under the Bakery House, Dorkbua, and Lotus brand names; and mineral water under the AQUAVITZ brand. The company exports its products to Laos, Cambodia, Vietnam, Indonesia, Malaysia, Myanmar, the Philippines, Singapore, China, etc. Srinanaporn Marketing Public Company Limited was founded in 1975 and is headquartered in Bangkok, Thailand.","Soitec S.A. designs and manufactures semiconductor materials worldwide. Its products are used to manufacture chips that are used in smart phones, tablets, computers, IT servers, and data centers, as well as electronic components in cars, connected devices, and industrial and medical equipment. It offers Fully Depleted Silicon-On-Insulator (FD-SOI) for automotive radar and processors, and PD-SOI and FinFET-SOI products for high-performance computing markets. The company also offers RF-SOI substrates for front-end module devices, as well as 4G LTE and new 5G sub-6 GHz/ mmWave smartphones. In addition, it offers power-SOI products that address the requirements for integrating high and low voltage functions in power IC devices for automotive and industry markets. Further, the company offers Smart photonics-SOI products for optical networking; Smart Imager-SOI products for next generation 3D image sensing; Auto Smartsic for green mobility; Connect RF-GaN for 5G infrastructure architecture and smartphone power amplifier markets; Connect-POI engineered substrates for high performance surface acoustic wave filter; and Gallium Nitride (GAN) Epitaxial wafers for energy efficient power management system. Soitec S.A. was incorporated in 1992 and is headquartered in Bernin, France.","Spark New Zealand Limited, together with its subsidiaries, provides telecommunications and digital services in New Zealand. It offers telecommunications, information technology, media, and other digital products and services, including mobile services; voice services; broadband services; internet sports streaming services; cloud, security, and service. The company also provides IT infrastructure, business cloud, business and outsourced telecommunications, software, big data analytics, data center, and international wholesale telecommunications services. In addition, it offers local, national, and international telephone and data services; finance products; group insurance products; and mobile phone repair services. Further, the company retails telecommunications products and services; and distributes equipment. It serves consumers, households, small businesses, government, and large enterprises. The company was formerly known as Telecom Corporation of New Zealand Limited and changed its name to Spark New Zealand Limited in August 2014. Spark New Zealand Limited was incorporated in 1987 and is headquartered in Auckland, New Zealand.","SpartanNash Company distributes and retails grocery products. It operates in three segments: Food Distribution, Military, and Retail. The Food Distribution segment offers approximately 65,000 stock-keeping units, such as dry groceries, produce, dairy products, meat, delicatessen items, bakery goods, frozen food, seafood, floral products, general merchandise, beverages, tobacco products, health and beauty care, and pharmacy products to independent retailers, national retailers, food service distributors, e-commerce providers, and corporate owned retail stores. This segment also offers various value-added services to retailers. The Military segment sells and distributes grocery products to 160 military commissaries and approximately 400 exchanges located in 39 states across the United States and the District of Columbia, Europe, Cuba, Puerto Rico, Honduras, Iraq, Kuwait, Bahrain, Qatar, and Djibouti. The Retail segment primarily operates 145 corporate owned retail stores and 36 fuel centers, primarily under the banners of Family Fare, Martin's Super Markets, D&amp;W Fresh Market, VG's Grocery, and Dan's Supermarket. SpartanNash Company also markets and distributes private brand items primarily under the Our Family brand name. The company was formerly known as Spartan Stores, Inc. and changed its name to SpartanNash Company in No
