vember 2013. SpartanNash Company was founded in 1917 and is headquartered in Grand Rapids, Michigan.","Strike Energy Limited explores for and develops oil and gas resources in Australia. The company primarily focuses on the Project Haber, Ocean Hill, Perth Basin Geothermal, Walyering, West, and South Erregulla projects located in the Perth Basin. Strike Energy Limited was incorporated in 1997 and is based in West Perth, Australia.","Super Retail Group Limited engages in the retail of auto, sports, and outdoor leisure products in Australia and New Zealand. It offers automotive parts and accessories, handyman items, and tools and equipment, and marine and motorbike products, including batteries, car care products, exterior accessories, hand and power tools, in-car navigation systems, in-car stereo equipment, lighting and electrical products, oils, filters and additives, outdoor equipment and accessories, seat covers and interior accessories, spare parts, paints and panels, and performance products. The company also provides footwear, fitness and sports equipment, apparel, and related accessories; fishing products, such as lures, rods and reels, tackle boxes, fishing nets, and other products; camping products, including tents, ropes, pegs, cooking equipment, and clothing and hiking gears, as well as boating products comprising fishing rod holders, bilge pumps, fish-finders, etc. In addition, it offers apparel and equipment for mountain climbers, campers, hikers, and others; and products for travel, touring, outdoor, garage, and shed, as well as vehicles for adventure activities. The company sells its products under the Supercheap Auto, rebel, BCF, and Macpac brands; and offers its products online. It operates 716 stores. Super Retail Group Limited was founded in 1972 and is based in Strathpine, Australia.","Sula Vineyards Limited manufactures, purchases, imports, distributes, and sells wine and other alcoholic beverages. It offers white, red, ros\u00e9, and sparkling wines; and spirits under the RASA, The Source, Dindori, SULA CLASSICS, and York brand names. The company also owns and operates wine tourism venues, including vineyard resorts and tasting rooms, as well as restaurants. It offers its products through distributors, corporations, licensed resellers, company depots, defense units, and other points of sale, as well as online. The company operates in India, the United States, the United Kingdom, Austria, the United Arab Emirates, Oman, New Zealand, China, France, Italy, Spain, Japan, Australia, Singapore, Belgium, Switzerland, Maldives, Sweden, Holland, Norway, Poland, South Korea, Portugal, Luxembourg, Germany, and the Czech Republic. Sula Vineyards Limited was founded in 1996 and is headquartered in Mumbai, India.","SurgePays, Inc., a financial technology and telecommunications company, provides services to the underbanked community in the United States. Its blockchain platform utilizes a suite of financial and prepaid products to convert corner stores and bodegas into tech-hubs for underbanked neighborhoods. The company offers voice and SMS text messaging services to subsidized and direct retail prepaid customers, as well as to low-income consumers. It also offers subsidized mobile broadband services to consumers in California, Colorado, Florida, Illinois, Maryland, Mississippi, Missouri, Nevada, New Jersey, Ohio, Oklahoma, Rhode Island, Tennessee, and Texas, as well as prepaid wireless plans. In addition, the company provides marketing business intelligence, plaintiff generation, and case load management solutions primarily to law firms in the mass tort industry. Further, it operates a bilingual operations center offering the Company with sales support, customer service, IT infrastructure design, graphic media, database programming, software development, revenue assurance, lead generation, and other various operational support services. The company is headquartered in Bartlett, Tennessee.","SurgePays, Inc. operates as a technology and telecommunications company. It offers mobile broadband services to consumers. The company's fintech platform utilizes a suite of financial and prepaid products to convert corner stores and bodegas into tech-hubs for underbanked neighborhoods. The company also provides ShockWave, an end-to-end cloud-based Software as a Service offering an Omnichannel customer relationship management, billing system, and carrier integrations to the telecommunication and broadband industry. In addition, the company provides Surge Blockchain software, a back-office marketplace offering wholesale consumable goods direct to convenience stores who are transacting on the SurgePays Fintech platform. Further, it offers lead generation and case management solutions primarily to law firms in the mass tort industry. The company was incorporated in 2006 and is headquartered in Bartlett, Tennessee.","SVI Public Company Limited, together with its subsidiaries, provides electronic manufacturing services worldwide. The company provides design and development services; new product introduction services; and test development and supply chain services. It also produces full box-build and system build product solutions. In addition, it engages in vertically integrated solutions, such as cable assembly, plastic injection molding, metal stamping, and sheet metal fabrication products. Further, it provides automation services, and lab services. It provides its services to communication and data technology; optical; automotive and e-mobility; medtech and healthcare; clean energy; audio video and security; and industrial and automation sectors. The company was formerly known as Semiconductor Venture International Limited. SVI Public Company Limited was founded in 1985 and is headquartered in Pathum Thani, Thailand.","Salzgitter AG, together with its subsidiaries, engages in steel and technology businesses worldwide. It operates through five segments: Strip Steel, Plate/Section Steel, Mannesmann, Trading, and Technology. The Strip Steel segment manufactures branded and special steels, such as hot-rolled strip steel and steel sheets, sections, tailored blanks, and components for the construction industry. The Plate/Section Steel segment produces various high-grade heavy plates for engineering, shipbuilding, and mechanical engineering, as well as trades in scrap. The Mannesmann segment is involved in the manufacture of line pipes, HFI-welded tubes, precision and stainless-steel tubes, and spiral-welded and longitudinal-welded large-diameter pipes; and seamless and welded tubes for the energy, automotive, and mechanical engineering sectors. The Trading segment operates a European sales network, as well as trading companies and agencies worldwide. The Technology segment engages in the provision of machinery and plants for the filling and packaging of beverages, as well as special machinery engineering for shoe manufacturing and elastomer production. The company also provides IT, facility management, logistics, automotive engineering, and research and development services, as well as supplies raw materials. Salzgitter AG was founded in 1858 and is headquartered in Salzgitter, Germany.","TransAct Technologies Incorporated designs, develops, and markets transaction-based and specialty printers and terminals in the United States and internationally. Its thermal printers and terminals to generates labels, coupons, and transaction records, such as receipts, tickets, and other documents, as well as printed logging and plotting of data. The company also provides consumable products, including POS receipt paper, inkjet cartridges, ribbons, and other printing supplies, as well as replacement parts and accessories; maintenance and repair services; and refurbished printers. In addition, it offers EPICENTRAL print system, a software solution that enables casino operators to create promotional coupons and marketing messages, and print them at the slot machine; and technical support services, as well as spare parts and accessories. Further, the company provides BOHA! terminal that combines hardware and software components in a device that includes an operating system, touchscreen, and one or two thermal print mechanisms. It markets its products under the BOHA!, AccuDate, Epic, Ithaca, EPICENTRAL, and Printrex brands for food service technology, point of sale automation, casino and gaming, lottery, and oil and gas markets, as well as government. The company sells its products to original equipment manufacturers, value-added resellers, and distributors, as well as directly to end-users through its Webstore transactsupplies.com. TransAct Technologies Incorporated was incorporated in 1996 and is headquartered in Hamden, Connecticut.","Tanla Platforms Limited, together with its subsidiaries, provides cloud communication services for mobile operators and enterprises in India and internationally. It offers SMS Campaign Manager, which helps in sending instant messages whether promotional or transactional to all your customers at one go; Two-Factor Authentication; Boomering provides international calling options; and Omni Communication, a platform enables gapless changeover between communication channels for customer journeys and an unsurpassed brand. The company also provides cloud voice services, including Hosted IVR solution that enables enterprises to design, build, and update custom IVR applications using a web interface; Voice Broadcast technology that enables enterprises to initiate and deploy personalized interactive voice broadcasts; Free Ring, a solution for engaging and interactive communications with customers and prospects; and Source Trace, which enables enterprises and agencies to track inbound calls back to the marketing source. In addition, it offers IoT platform, which enables businesses to connect, collect, and curate. Further, it provides Trubloq, a block chain enabled communication platform as a service (CPaaS) stack; and Wisely, which delivers communication services for CPaaS ecosystem. The company was formerly known as Tanla Solutions Limited and changed its name to Tanla Platforms Limited in October 2020. The company was incorporated in 1995 and is headquartered in Hyderabad, India.","Tata Elxsi Limited provides product design and engineering, and systems integration and support services in India, the United States, Europe, and internationally. The company operates through two segments, Software Development and Services; and Systems Integration and Support. It offers technology consulting, new product design, development, and testing services; and consumer insights and strategy, visual design and branding, product and packaging design, user experience design, service experience design, and transportation design, as well as content and 3D animation services. The company also provides engineering services for connected, autonomous, and shared and electric vehicles; consumer research, prototyping, and automotive exteriors and interiors styling services; body and chassis systems, driveline, and powertrain systems; automotive software engineering services; validation service; and AI-enabled smart annotation platform for automotive industry. In addition, it offers shopping, bill payment, gaming, movie watching, and video conferencing services; distribution and delivery solutions; ad monetization services; OTT/IPTV and test automation platforms; intelligent network and transformation operations; network orchestration, SDN/SD-WAN, android TV, and RDK services for communications industry; integrated design and engineering, and regulatory compliance services, as well as digital health products and solutions. Further, the company provides technology solutions and services for smart home appliances, electric off-highway vehicles, autonomous vehicles, connected systems, integrated digital rail systems, and semiconductors. Additionally, it implements and integrates systems and solutions for computing, CAD/CAM/CAE/PLM, broadcast, virtual reality, storage, and disaster recovery; and provides professional services for the maintenance and support of IT infrastructure. Tata Elxsi Limited was incorporated in 1989 and is headquartered in Bengaluru, India.","Codex DNA, Inc., a synthetic biology company, manufactures and sells synthetic biology instruments, reagents, and associated products and related services, primarily to pharmaceutical and academic laboratories worldwide. Its solutions include BioXp system that empowers researchers to go from a digital DNA sequence to endpoint-ready synthetic DNA; BioXp portal, an online portal that offers an intuitive guided workflow and design tools for building new DNA sequences and assembling them into vectors of choice; BioXp kits that contain building blocks and reagents, including its Gibson Assembly branded reagents, for specific synthetic biology workflow applications; Cloud-based scripts; Benchtop reagents that contain all the reagents necessary to proceed with a specific synthetic biology workflow on the benchtop using products generated on the BioXp system; Biofoundry Services, which enable a customer to order and receive the BioXp system endpoint-ready products, such as genes, clones, cell-free amplified DNA, and variant libraries; and short oligo ligation assembly enzymatic DNA synthesis. It also serves government institutions, contract research organizations, and synthetic biology companies. The company was formerly known as SGI-DNA, Inc. and changed its name to Codex DNA, Inc. in March 2020. Codex DNA, Inc. was incorporated in 2011 and is headquartered in San Diego, California.","Teleperformance SE, together with its subsidiaries, provides outsourced customer and citizen experience management, and related services in France and internationally. The company operates in two segments, Core Services and Digital Integrated Business Services, and Specialized Services. It offers customer and citizen care; technical support; and customer acquisition services, as well as back-office solutions and integrated services, including social media content moderation services and data labeling for automation solutions; and knowledge services in the field of analytics solutions, automated systems, and artificial intelligence. The company also manages business processes, as well as provides digital platform, consulting, and data analysis services; and business process outsourcing services for government agencies. In addition, it offers online interpreting services; visa application management and consulate services for government departments; online healthcare navigation and advocacy services; and accounts receivable credit management services. The company serves automotive, energy and utilities, insurance, public sector, technology, travel and hospitality, and banking and financial services, as well as healthcare, media, retail and e-commerce, crypto, cargo, telecom, and video games industries. Teleperformance SE was incorporated in 1910 and is headquartered in Paris, France.","TPI Polene Power Public Company Limited generates and distributes electricity in Thailand. The company operates through Energy &amp; Utilities, and Petrol and Gas Stations segments. It operates municipal solid waste fired, coal-fired, waste-to-energy, and waste-heat recovery power plants; and petrol and natural gas (NGV) service stations. The company sells its electricity to the electricity generating authority of Thailand. As of December 31, 2021, it operated 8 power plants with a total installed power generation capacity of 440 megawatt, as well as 8 petrol stations, 3 fuel and natural gas stations, and 1 gas station under the TPIPP brand. The company was incorporated in 1991 and is headquartered in Bangkok, Thailand. TPI Polene Power Public Company Limited operates as a subsidiary of TPI Polene Public Company Limited.","The Practical Solution Public Company Limited engages in the provision of solutions for information technology systems. The Company offers system integration services, including consulting, design, procurement, installation, and distribution of products and equipment for computer network infrastructure, wireless LAN, cyber and network security, unified communication, data center, and network management system solutions. It also provides system maintenance services comprising preventive and collective maintenance, and warranty services, as well as cabling services, onsite maintenance and repair services, and software system design and development services. In addition, the company is also involved in distribution third-party products by operating as a business partner with product owners comprising Cisco, NetApp, Palo Alto Networks, Symantec, VMware, Fortinet, etc. It serves telecommunications, automotive, oil and refinery, cement, hospitals, financial institutions, educational institutions, and logistics industries. The company was founded in 2004 and is headquartered in Bangkok, Thailand.","Trisul S.A. engages in the construction and development of real estate properties in Brazil. It is also involved in the subdivision of plots of land; and purchase and sale of properties. The company develops real estate projects, including with ownership interest of third parties. The company was founded in 2007 and is based in S\u00e3o Paulo, Brazil.","Thai Rung Union Car Public Company Limited engages in the car assembly and modification, and the manufacture and distribution of parts and molds primarily in Thailand. It operates through three segments: Car Assembly and Other Related Car Services; Manufacture of Equipment for Production of Car Accessories; and Sales of Cars, and Car Service Centre Business. The company offers tooling products, including dies and molds, and assembly jigs and checking fixtures; auto parts, such as metal stamping or press parts for use in producing or assembling motor vehicles, motorcycles, industrial, construction and agricultural machinery, and electrical appliances; plastic vacuum mould parts for auto accessories; and auto seats. It also provides contract assembly, vehicle modification, and vehicle painting services; and after-sales services. In addition, the company is involved in the sale of cars, car accessories, and spare parts; repairing and refitting vehicles body; and manufacture of truck bodies, such as dump-trucks, cargo vans, trailers, concrete mixer trucks, refrigerated trucks, industrial machinery, excavators, construction equipment, agricultural machinery, and tractors. Thai Rung Union Car Public Company Limited was founded in 1967 and is headquartered in Bangkok, Thailand.","Tycoons Worldwide Group (Thailand) Public Company Limited, together with its subsidiaries, manufactures and distributes steel wire rods, steel annealing wires, reinforced concrete bars, screws, and wire products in Thailand. The company offers spheroidized annealing wires, bolts, and thread rods; and engages in trading activities. It also exports its products. The company was founded in 1996 and is based in Rayong, Thailand. Tycoons Worldwide Group (Thailand) Public Company Limited is a subsidiary of Tycoons Group International Co., Ltd.","Singapore Land Group Limited, an investment holding company, engages in the development of properties for investment and trading in Singapore and internationally. The company operates through Property Investment, Property Trading, Hotel Operations, Technology Operations, and Others segments. It develops and leases commercial office, retail space, and residential properties. The company also offers property management services; invests in and operates hotels; invests in retail centers; distributes computers and related products; retails computer hardware and software; and provides information technology, systems integration, and networking infrastructure services. In addition, it invests in shares, and provides marketing management and other related services. The company was incorporated in 1963 and is based in Singapore. Singapore Land Group Limited is a subsidiary of UOL Group Limited.","UAC Global Public Company Limited, together with its subsidiaries, imports and distributes various chemicals and equipment in Thailand and internationally. The company provides consulting and advising services for the marketing of products and services; and feasibility study of various projects or works related to energy, refinery, and petrochemical industries, as well as power plants and other utilities. It also produces and distributes biogas that are used in power generation, transportation, and various other industries; and produces and distributes petroleum products, including compressed natural gas, liquefied petroleum gas, and natural gas liquids. In addition, the company generates and distributes electricity, alternative energy, and fuel briquette; produces and distributes tap water and related equipment; and manufactures and distributes chemical products for the general industry. Its products are used in various industries, such as off-shore natural gas exploration and production, oil refinery and upstream petrochemicals, engine oil lubricant manufacturing plants, polymer and plastic manufacturing plants, chemical industrial plants, power plants, and other utilities systems. The company was formerly known as Universal Adsorbents &amp; Chemicals Public Company Limited and changed its name to UAC Global Public Company Limited in April 2014. UAC Global Public Company Limited was incorporated in 1985 and is headquartered in Bangkok, Thailand.","Ultrapar Participa\u00e7\u00f5es S.A. engages in the gas distribution, fuel distribution, and storage businesses primarily in Brazil, Mexico, Uruguay, Venezuela, other Latin American countries, the United States, Canada, the Far East, Europe, and internationally. Its Gas Distribution segment distributes liquefied petroleum gas to residential, commercial, and industrial consumers primarily in the South, Southeast, and Northeast regions of Brazil. The company's Fuel Distribution segment distributes and markets gasoline, ethanol, diesel, fuel oil, kerosene, natural gas for vehicles, and lubricants; operates convenience stores; and offers lubricant-changing and automotive specialized services. The company's Storage segment operates liquid bulk terminals primarily in the Southeast and Northeast regions of Brazil. As of December 31, 2021, the company operated through 7,104 Ipiranga service stations and 1,841 AmPm convenience stores; 1,149 Jet Oil franchises; 4 distribution centers; and 7 Ultracargo terminals with storage capacity of 983 thousand cubic meters. It also operates Abastece A\u00ed, a digital payments app; and offers Km de Vantagens, a loyalty program. The company was founded in 1937 and is headquartered in S\u00e3o Paulo, Brazil.","Unisys Corporation, together with its subsidiaries, operates as an information technology services company worldwide. It operates in Digital Workplace Solutions (DWS); Cloud and Infrastructure Solutions (C&amp;I); and Enterprise Computing Solutions (ECS) segments. The DWS segment provides solutions that transform digital workplaces securely and create exceptional end-user experiences. The C&amp;I segment offers solutions that drive modern IT service platforms, cloud applications development, intelligent services, and cybersecurity services. The ECS segment provides solutions that harness secure, continuous high-intensity computing, and enable digital services through software-defined operating environments. Its solutions include Unisys InteliServe, a service solution that transforms traditional service desk into an intelligent, user-centric experience aligned with the needs of the modern digital workplace; Unisys CloudForte, a comprehensive managed service offering to help accelerate the secure move of data and applications to the cloud; PowerSuite, a packaged software tool used by enterprise IT to monitor, analyze, troubleshoot and secure collaboration, and communications multi-platform environments; Unisys ClearPath Forward, a software operating environment for high-intensity enterprise computing; and Unisys Stealth security software, which enables trusted identities to access micro-segmented critical assets and safely communicate through secure and encrypted channels. In addition, the company provides industry solutions, which help law enforcement agencies solve crime; social services case workers assist families; travel and transportation companies manage freight and distribution; and financial institutions deliver omnichannel banking. It serves customers in the government, financial services, and commercial markets through direct sales force, distributors, resellers, and alliance partners. Unisys Corporation was founded in 1886 and is based in Blue Bell, Pennsylvania.","Usha Martin Limited, together with its subsidiaries, manufactures and sells steel wires, strands, wire ropes, and cord related accessories in India and internationally. The company offers wire ropes, including oil and offshore, crane, mining, elevator, fishing, aerial, anchor mooring, locked coil, and general engineering ropes, as well as ropes for conveyor cords and structural systems. It also manufactures a range of industrial machines, including wire drawing machines, stranding machines, wire rope closing machines, steel plant equipment, cable machines, and material handling equipment; machines for manufacturing bright bars; machines for armoring and rewinding; and copper coating lines for CO2 welding wire manufacture. In addition, the company provides pre-tensioning &amp; post-tensioning solutions; pre-stressing solutions; anchorage accessories &amp; equipment, hydraulic jacks, powerpacks, and grout pumps and agitators; and pre-stressing machines &amp; accessories, as well as installation services. Further, the company offers spring, welding, cold heading quality, auto spoke, brush, needle, and cycle spoke wires; and LRPC strands, such as bright/galvanized, compacted, indented, and bonded and un-bonded polymer coated galvanized LRPC strands, as well as manufactures wire drawing and allied machines. Additionally, it provides optical fiber, aerial cables, micro ducts, hybrid category, FTTH/drop, aerial copper, duct copper, and jelly filled copper cables. The company was founded in 1960 and is based in Kolkata, India.","Puranium Energy Ltd. operates as a uranium exploration company in Canada, Australia, and the Philippines. The company has 85% interests in the seven exclusive prospecting licenses covering an area of 93,514 hectares located in Namibia, Africa. It holds a 100% interest in the Cobalt Mountain property covering an area of approximately 4,921 hectares located in the Omineca mining division of Northwest British Columbia; and has an option to purchase a 100% interest in Haines Property comprising 35 minerals claims located in Ontario, Canada. The company was formerly known as Monterey Minerals Inc. and changed its name to Puranium Energy Ltd. in March 2022. Puranium Energy Ltd. is headquartered in Vancouver, Canada.","VCI Global Limited provides consulting services in Malaysia, China, Singapore, and the United States. It offers business strategy consultancy, including listing solutions, corporate finance, legal, investors relations, and boardroom strategies consultancy. The company also technology consultancy, including software solutions that comprise artificial intelligence, analytics, and robotics, as well as a range of blockchain technology solutions. It delivers its services to small-medium enterprises and government-linked agencies, as well as to publicly traded conglomerates across various industries. The company was founded in 2013 and is based in Kuala Lumpur, Malaysia.","Vmoto Limited, together with its subsidiaries, manufactures and distributes electric two-wheel vehicles worldwide. Its electric two-wheel vehicles include electric mopeds and motorcycles. The company offers its products primarily under the Vmoto, Super Soco, and E-Max brand names. Vmoto Limited was incorporated in 2001 and is based in Perth, Australia.","Vonex Limited provides telecommunications services to business customers in Australia and the United States. The company operates through Retail Telecommunications and Wholesale Telecommunications segments. The Retail Telecommunications segment offers data, internet, billing, and other services, as well as voice services, including IP voice services. The Wholesale Telecommunications segment provides Vonex PBX and call termination services, and NBN and 4G mobile broadband at wholesale rates via a white label model. Vonex Limited is headquartered in Milton, Australia.","Vulcan Steel Limited, together with its subsidiaries, engages in the sale and distribution of steel and metal products in New Zealand and Australia. The company operates in two segments, Steel and Metals. It sells hollows; merchant products, including bars, beams, angles, channels, and unprocessed coils and plates; stainless steel products, such as hollows, bars, fittings, and sheets; and high-performance steel and metal products. The company also provides cutting, drilling, tapping, countersinking, and folding of plates, as well as sheeting and slitting services. Vulcan Steel Limited was incorporated in 1995 and is based in Auckland, New Zealand.","Wendt (India) Limited, together with its subsidiaries, manufactures and sells super abrasives, high precision grinding, honing, special purpose machines, and precision components in India and internationally. The company operates through three segments: Super Abrasives; Machines and Accessories, and Precision Products. The company offers super abrasives, including resin and metal bonds, hybrid wheels, Quantapol hybrid wheels, vitrified bonds, electroplated bonds, rotary diamond dressers, hones, stationary diamond dressers, PCD/PCBN tools and wear parts, brazed products, fine grinding wheels, and diamond segments and pellets. It also provides grinding, profiling dressing, and honing machines; precision components, such as nonferrous and ferrous products, as well as 3D printable ceramic materials; single point, natural point diamond, chisel type, cluster type, blade type, and MCD-blade type diamond dressers; and resin bond diamond wheels, electroplated diamond mounted points, electroplated files, dressing stones, and diamond lapping compounds, as well as diamond disc for grinding and hacking concrete. In addition, the company offers machine refurbishing products; floking; accessories and equipment; and finishing films. Its products are used in industries, including automobile, auto component, engineering, aerospace, defense, ceramics, glass wheels, textile, turbo charger, medical, biomedical, and cutting tool industry. The company also exports its products. Wendt (India) Limited was incorporated in 1980 and is headquartered in Hosur, India.","Wyncoast Industrial Park Public Company Limited sells and rents custom duty free zone areas for the commercial and industrial activities worldwide. The company's facilities include customs office at site, logistics solution teams, executive offices, staff accommodations, conference rooms, and food centers. Its total land area is 109,174 square meters with factory and warehouse buildings for rent of 42,754 square meters, depot area of 15,175 square meters, and a three-storey office building of 4,011 square meters. The company also operates as an auto dealer for new, old, and multipurpose cars; and other vehicles, as well as spare parts and accessories. In addition, it produces and distributes electricity from solar energy; produces and distributes water; and operates and manages properties and assets, as well as engages in the construction business. The company was formerly known as Capetronic International (Thailand) Public Company Limited and changed its name to Wyncoast Industrial Park Public Company Limited in October 2013. Wyncoast Industrial Park Public Company Limited was incorporated in 1985 and is headquartered in Bang Pakong, Thailand.","Winton Land Limited operates as a residential land developer that specializes in developing integrated and fully master planned neighbourhoods in New Zealand and Australia. It operates through Residential Development, Retirement Villages, and Commercial Portfolio segments. As of July 6, 2022, the company had a portfolio of 28 projects with a combined total of 7,300 residential lots, dwellings, apartment units, retirement village units, and commercial lots. Winton Land Limited was incorporated in 2017 and is based in Auckland, New Zealand.","VICOM Ltd, an investment holding company, provides motor vehicle inspection, non-vehicle testing, and consultancy services in Singapore. The company offers vehicle inspection services, including inspection for petrol-driven and diesel-driven vehicles, petrol-hybrid and diesel hybrid vehicles, motorcycles, electric vehicles, power assisted bicycles, and e-scooters; vehicle assessment services; and emission test laboratory services. It also provides vehicle evaluation; motor and general insurance; road tax renewal; and other services, such as vehicle inspection and type approval system, in-vehicle unit, speed limiter check, chassis dynamometer smoke test, and car buying tips and maintenance talks services. The company offers its testing, calibration, inspection, consultancy, and training services to aerospace, marine and offshore, biotechnology, oil and petrochemical, building construction, and electronics manufacturing industries. VICOM Ltd was incorporated in 1981 and is based in Singapore. VICOM Ltd is a subsidiary of ComfortDelGro Corporation Limited.","WT Financial Group Limited provides a range of financial services. It operates in two segments, Business to Business and Direct to Consumer. The company provides, licensing, risk management and compliance, education and training, and technical support services; and practice management and development services, including consumer marketing and education tools. It also offers financial planning, investment, and product sales and licensing services; and mortgage finance and brokerage, accounting, and SMSF administration services. In addition, the company provides wealth management, retirement, and investment, as well as mortgage, tax, and finance advice; and tax planning and structuring, and preparation and lodgement of tax returns. Further, it provides superannuation investments, insurance, finance, equities, and direct and SMSF residential and commercial properties to retail and wholesale clients; and home loan solutions for private wealth clients. The company was formerly known as Spring FG Limited and changed its name to WT Financial Group Limited in November 2019. WT Financial Group Limited was incorporated in 2014 and is based in Sydney, Australia.","XRF Scientific Limited manufactures and markets precious metal products, specialized chemicals, and instruments for the scientific, analytical, construction material, and mining industries in Australia, Canada, and Europe. It operates through Capital Equipment, Precious Metals, and Consumables segments. The Capital Equipment segment designs, manufactures, and services automated fusion equipment, and high temperature test and production furnaces, as well as general laboratory equipment. The Precious Metals segment manufactures products for the laboratory and platinum alloy markets. The Consumables segment manufactures chemicals and other supplies for analytical laboratories. The company was founded in 1972 and is based in Osborne Park, Australia.","Yellow Pages Limited operates as a digital media and marketing solutions company in Canada. The company provides digital and traditional marketing solutions, including online and mobile priority placement on Yellow Pages digital media properties, content syndication, search engine solutions, website fulfillment, social media campaign management, digital display advertising, video production, e-commerce, and print advertising to small and medium-sized enterprises. Its online properties include YP.ca that allows users to discover and transact within their local neighborhoods through merchant profiles, editorial content, reviews, and booking functionalities; Canada411 for personal and local business information; and 411.ca, a digital directory service. The company also operates as a directory publisher for Bell, Telus, Bell Aliant, MTS Allstream, and other telephone companies; and holds the YP, Canada411, and 411 mobile applications. Yellow Pages Limited was founded in 1908 and is headquartered in Montreal, Canada.","Clear Secure, Inc. provides a member-centric secure identity platform in the United States. The company's secure identity platform is a multi-layered infrastructure consisting of front-end, including enrollment, verification, and linking. It also offers CLEAR Plus, a consumer aviation subscription service, which enables access to predictable entry lanes in airport security checkpoints, as well as access to broader network; and CLEAR app, a consumer-facing digital product that facilitates new user enrollment and member engagement from their mobile device. In addition, the company provides Reserve powered by CLEAR, a virtual queuing technology that provides users with the choice of how they queue either at home or on the move; and Atlas Certified, an automated solution to verify professional licenses and certification data across industries by communicating with certifying organizations for on-demand, current, and trusted data. The company was founded in 2010 and is headquartered in New York, New York.","Zensar Technologies Limited, a digital solutions and technology services company, provides information technology (IT) services and solutions in the United States, Europe, Africa, India, and internationally. The company operates through Digital and Application Services and Digital Foundation Services segments. It offers experience services, include product/experience research, strategy and design, and product and experience engineering services, as well as creative, content, brand, and campaign services; advanced engineering services, such as digital engineering, cloud application transformation and operation, and cloud strategy and operating model; data engineering and analytics services, include data engineering, artificial intelligence and machine learning, automation, and visualization and analytics services. In addition, its offers application services, such as application management, quality engineering, oracle, salesforce, and SAP; and foundation services, include digital infrastructure, workplace, experience management, operations, and security. It serves manufacturing, retail, media, banking, insurance, healthcare, and utilities industries. Zensar Technologies Limited was incorporated in 1963 and is headquartered in Pune, India.","Zen Technologies Limited, together with its subsidiary, designs, develops, manufactures, and sells training simulators in India and internationally. The company provides anti-drone systems; combat training simulation and war gaming solutions; armour combat training, indoor tracking, and tactical engagement simulation systems; and digital beamforming solutions. It also offers mortar integrated and carrier mortar tracked, anti-aircraft air defense, anti-tank guided missile, artillery forward observer, automatic grenade launcher, infantry weapon training, UAV mission, rotary wing, medium machine gun, integrated air defense combat, combat weapons training, infantry combat vehicle driving, crew gunnery, driving and automated driving, BMP II integrated missile, driver aptitude testing, advanced weapon, driving training, bus driving, and tatra driving simulators. In addition, the company provides containerized tubular and indoor shooting range, hand grenade simulator, smart target, shoot house for live and simulated indoor tactical training, master control station for live-firing ranges, tank target and zeroing, air-to-ground firing range, corner shot weapon, tank zeroing, and multi-functional target systems. It serves police, para-military, armed, and security forces; government departments comprising transport, mining, and infrastructure; and the civilian markets. Zen Technologies Limited was incorporated in 1993 and is headquartered in Hyderabad, India."],"shape":[461],"dtype":"object","order":"little"}],["ceo",{"type":"ndarray","array":["Dr. Aart J. de Geus","Takaya  Soga","Mr. Richard Clarence Kellam","Mr. Justin  Nuich M.B.A.","Mr. Yung-Chieh  Lin","Mr. Shing-Hwang  Kao","Mr. Jorge Luis Gonzalez","Mr. Kazuma  Yamanaka","Mr. Masahiro  Yamada","Mr. Jeffrey  Hu","Dr. Anirudh  Devgan Ph.D.","Mr. Michael L. Olosky","Mr. Seamus  Grady","Mr. M. Christopher Doyle","Mr. Roberto  Balls Sallouti","Mr. James Robert B. Quincey","Mr. Tushar  Sighat","Mr. Kean Cheong Lau","Mr. Stuart James Irving","Mr. Michael K. Wirth","Ta Chih Chu","Ms. Janis Fonda Kerns","Ms. Joanne C. Crevoiserat","Mr. Itsuro  Miki","Mr. Kung-Pin  Chen","Ms. Grethe  Bergly","Mr. Thomas Scott Caldwell C.M.","Mr. Louis  Ning","Mr. Yuji  Fukuda","Mr. Tomas  Spurny","Dr. Anirudh  Devgan Ph.D.","Mr. Ryan M. McInerney","Mr. Chung-Pin  Wong","Mr. Stephen Allen Schwarzman B.A., M.B.A.","Mr. Andre Augusto Telles Moreira","Mr. Jonathan A. Morgan CIM","Mr. William R. McDermott","Mr. Michael  Miebach","Mr. Robert J. Spurway B.E.","Mr. Andy  Hsi","Mr. Michael J. Gilfeather","Mr. Alan Clifford Bence Giddins F.C.A.","Mr. David A. Zapico","Mr. Mitsunori  Watanabe","Mr. John Cameron MacDonald CFA","Mr. Kazuaki  Hakomori","Mr. Tyler  Glover","Mr. Takaya  Maeda","Mr. Enrique Javier Beltranena Mejicano","Mr. Kevin David Strain C.A., C.P.A.","Mr. Terrence R. Curtin CPA","Dr. Anthony Francis Fernandes CBE, Ph.D.","Mr. Vincenzo James Vena","Ms. Caroline  Gurney","Mr. Takumi  Yamaguchi","Mr. Douglas L. Peterson M.B.A.","Mr. Douglas L. P
